(317, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0435 \u0438\u043c\u044f \u043d\u043e\u0441\u0438\u043b \u0441\u0430\u043c\u044b\u0439 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0438\u0443\u0434\u0435\u0439\u0441\u043a\u0438\u0439 \u0446\u0430\u0440\u044c \u0438\u0437 \u0440\u043e\u0434\u0430 \u0425\u0430\u0441\u043c\u043e\u043d\u0435\u0435\u0432, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432\u043e\u0448\u0435\u043b \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u044e \u043f\u043e\u0434 \u0438\u043c\u0435\u043d\u0435\u043c \"\u0412\u0435\u043b\u0438\u043a\u0438\u0439\".'), 80),
