(321, STRINGDECODE('\u041e \u0447\u0435\u043c \u0433\u043e\u0432\u043e\u0440\u0438\u043b\u043e\u0441\u044c \u0432 11-\u043e\u0439 \u0438\u0437 \u0434\u0432\u0435\u043d\u0430\u0434\u0446\u0430\u0442\u0438 \u0442\u0430\u0431\u043b\u0438\u0447\u0435\u043a, \u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044b\u0445 \u0432 \u0412\u0430\u0432\u0438\u043b\u043e\u043d\u0435 \u0414\u0436\u043e\u0440\u0434\u0436\u0435\u043c \u0421\u043c\u0438\u0442\u043e\u043c, \u0435\u0441\u043b\u0438 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e, \u0447\u0442\u043e \u043e\u0434\u0438\u043d\u043d\u0430\u0434\u0446\u0430\u0442\u044b\u0439 \u043c\u0435\u0441\u044f\u0446 \u0432\u0430\u0432\u0438\u043b\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u044f \u043f\u0440\u0438\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043d\u0430 \u0434\u043e\u0436\u0434\u043b\u0438\u0432\u044b\u0439 \u0441\u0435\u0437\u043e\u043d?'), 81),
