(349, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0432 \u044d\u043f\u043e\u0445\u0443 \u0418\u0432\u0430\u043d\u0430 III \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438 \u0432\u0441\u0435 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0435 \u043c\u043e\u043d\u0435\u0442\u044b, \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u0442 \u043e\u0442 \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0441\u043b\u043e\u0432\u0430 \"\u0437\u043e\u043b\u043e\u0442\u043e\u0439\" \u0438\u043b\u0438 \"\u043a\u0440\u0430\u0441\u043d\u044b\u0439\".'), 88),
