(361, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0443 \u0434\u0440\u0435\u0432\u043d\u0438\u0445 \u0433\u0440\u0435\u043a\u043e\u0432 \u043d\u043e\u0441\u0438\u043b\u0430 \u0440\u0435\u043a\u0430, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043e\u043c\u044b\u0432\u0430\u0435\u0442 \u043d\u0430 \u043a\u0440\u0430\u0439\u043d\u0435\u043c \u0417\u0430\u043f\u0430\u0434\u0435 \u0433\u0440\u0430\u043d\u0438\u0446\u044b \u043c\u0435\u0436\u0434\u0443 \u043c\u0438\u0440\u043e\u043c \u0436\u0438\u0437\u043d\u0438 \u0438 \u0441\u043c\u0435\u0440\u0442\u0438.'), 91),
