(463, STRINGDECODE('\u041c\u043d\u043e\u0433\u0438\u0435 \u0433\u0435\u0440\u043e\u0438 \u041b\u044c\u0432\u0430 \u0422\u043e\u043b\u0441\u0442\u043e\u0433\u043e \u0431\u044b\u043b\u0438 \u0437\u0430\u0438\u043c\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u044b \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u0435\u043c \u0438\u0437 \u0436\u0438\u0437\u043d\u0438. \u0422\u0430\u043a \u0412\u043e\u043b\u043a\u043e\u043d\u0441\u043a\u0438\u0439 \u043f\u0440\u0435\u0432\u0440\u0430\u0442\u0438\u043b\u0441\u044f \u0443 \u043d\u0435\u0433\u043e \u0432 \u0411\u043e\u043b\u043a\u043e\u043d\u0441\u043a\u043e\u0433\u043e, \u041a\u0443\u0440\u0430\u043a\u0438\u043d \u0432 \u041a\u0443\u0440\u0430\u0433\u0438\u043d\u0430. \u041d\u0430\u0437\u043e\u0432\u0438\u0442\u0435 \u0444\u0430\u043c\u0438\u043b\u0438\u044e \u0442\u043e\u0433\u043e, \u043a\u0442\u043e \u044f\u0432\u0438\u043b\u0441\u044f \u043f\u0440\u043e\u0442\u043e\u0442\u0438\u043f\u043e\u043c \u0434\u043b\u044f \u0432\u0441\u0435\u043c \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u041f\u044c\u0435\u0440\u0430 \u0411\u0435\u0437\u0443\u0445\u043e\u0432\u0430.'), 116),
