(465, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0435 \u0438\u043c\u044f, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0435 \u0441\u043e\u0432\u0441\u0435\u043c \u043d\u0435\u0434\u0430\u0432\u043d\u043e \u043b\u044e\u0431\u043e\u043c\u0443 \u043c\u0430\u043b\u044b\u0448\u0443, \u043d\u043e\u0441\u0438\u043b \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043c\u0435\u0431\u0435\u043b\u044c\u0449\u0438\u043a 18-\u0433\u043e \u0432\u0435\u043a\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0435\u0440\u0432\u044b\u043c \u0441\u0442\u0430\u043b \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u043b\u044f\u0442\u044c \u043c\u0435\u0431\u0435\u043b\u044c \u0438\u0437 \u043a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u0434\u0435\u0440\u0435\u0432\u0430.'), 117),
(466, STRINGDECODE('\u0414\u0440\u0435\u0432\u043d\u0438\u0435 \u0433\u0440\u0435\u043a\u0438 \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438 \u044d\u0442\u043e \"\u0432\u043e\u0441\u043a\u043e\u043c \u0437\u0435\u043c\u043b\u0438\" \u0438 \u0438\u043c\u0435\u043d\u043d\u043e \u0435\u0433\u043e \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u043f\u0435\u0440\u0432\u044b\u0445 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0432 1852 \u0433\u043e\u0434\u0443 \u043f\u043e\u043b\u044f\u043a \u0418\u0433\u043d\u0430\u0441\u0438\u0439 \u041b\u0443\u043a\u0430\u0441\u0435\u0432\u0438\u0447.'), 117);
