(471, STRINGDECODE('\u041e\u043d \u0431\u044b\u043b \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0430\u043c\u0438 \u0432 1754 \u0433\u043e\u0434\u0443 \u0438 \u043d\u0430\u0437\u0432\u0430\u043d \u0424\u043e\u0440\u0442 \u0414\u044e\u043a\u044d\u043d\u044c, \u0430 \u043a\u0430\u043a\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0435\u043c\u0443 \u0434\u0430\u043b\u0438 \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0435 \u0432 1758 \u0433\u043e\u0434\u0443 \u0432 \u0447\u0435\u0441\u0442\u044c \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0434\u0435\u044f\u0442\u0435\u043b\u044f \u0423\u0438\u043b\u044c\u044f\u043c\u0430 \u041f\u0438\u0442\u0442\u0430?'), 118),
(472, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0433\u043e\u0440\u043e\u0434 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d \u043d\u0435\u043f\u043e\u0434\u0430\u043b\u0435\u043a\u0443 \u043e\u0442 \u0443\u0441\u0442\u044c\u044f \u0440\u0435\u043a\u0438 \u0414\u0438.'), 118),
