(500, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0434\u0440\u0435\u0432\u043d\u0435\u0433\u0440\u0435\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0431\u043e\u0433\u0430 \u0447\u0430\u0441\u0442\u043e \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u0438 \u0441 \u043d\u0430\u0431\u0443\u0445\u0448\u0438\u043c\u0438 \u0432\u0435\u043a\u0430\u043c\u0438 \u0438 \u043e\u043f\u0443\u0449\u0435\u043d\u043d\u044b\u043c\u0438 \u0440\u0435\u0441\u043d\u0438\u0446\u0430\u043c\u0438, \u0442\u0435\u043b\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0431\u044b\u043b\u043e \u0443\u0432\u0435\u0448\u0430\u043d\u043e \u0446\u0432\u0435\u0442\u043a\u0430\u043c\u0438 \u043c\u0430\u043a\u0430.'), 125),
(501, STRINGDECODE('\u0423 \u043f\u043e\u044d\u0442\u0430 (\u041d. \u0417\u0430\u0431\u043e\u043b\u043e\u0446\u043a\u043e\u0433\u043e) \u044d\u0442\u043e\u0442 \u0441\u0442\u0438\u0445 \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0441\u043b\u043e\u0432\u043e\u043c \"\u043e\u0446\u0435\u043b\u043e\u0432\u0430\u043d\u0430\". \u0410 \u043a\u0430\u043a\u0438\u043c \u0441\u043b\u043e\u0432\u043e\u043c \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u0430\u044f \u043d\u0430 \u044d\u0442\u0438 \u0441\u0442\u0438\u0445\u0438 \u044d\u0441\u0442\u0440\u0430\u0434\u043d\u0430\u044f \u043f\u0435\u0441\u043d\u044f?'), 126),
(502, STRINGDECODE('\u041f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u043f\u0435\u0440\u0438\u043e\u0434 \u0433\u0440\u0443\u043f\u043f\u0430 \"\u041c\u0430\u0448\u0438\u043d\u0430 \u0432\u0440\u0435\u043c\u0435\u043d\u0438\" \u0441\u0447\u0438\u0442\u0430\u043b\u0430 \"\u0437\u0430\u043f\u0440\u0435\u0442\u043d\u043e\u0439\" \u0434\u043b\u044f \u0441\u0432\u043e\u0435\u0433\u043e \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0443 \u0442\u0435\u043c\u0443.'), 126);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(503, STRINGDECODE('\u0418\u0437 \u0432\u0441\u0435\u0445 \u0441\u0432\u043e\u0438\u0445 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u044b\u0445 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u041e\u0441\u043a\u0430\u0440 \u0424\u0435\u043b\u044c\u0446\u043c\u0430\u043d \u0441\u0447\u0438\u0442\u0430\u043b, \u0447\u0442\u043e \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u043f\u0435\u0441\u043d\u044f \u0441 \u0435\u0433\u043e \u043c\u0443\u0437\u044b\u043a\u043e\u0439 \u0434\u043e\u043d\u0435\u0441\u0435\u0442 \u0435\u0433\u043e \u0438\u043c\u044f \u043f\u043e\u0442\u043e\u043c\u043a\u0430\u043c, \u043d\u043e \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u0435\u0433\u043e \u0432\u043e\u0441\u043f\u043e\u043c\u0438\u043d\u0430\u043d\u0438\u044f\u043c \u043e\u043d\u0430 \u0438 \u0441\u0442\u0430\u043b\u0430 \u0434\u043b\u044f \u043c\u043d\u043e\u0433\u0438\u0445 \u0435\u0433\u043e \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0438\u043a\u043e\u0432 \u0432\u0435\u0440\u0445\u043e\u043c \u043d\u0435\u043f\u0440\u0438\u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u0438.'), 126),
(504, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043f\u043e \u044d\u0442\u043e\u0439 \u043f\u0440\u0438\u0447\u0438\u043d\u0435 \u043c\u043d\u043e\u0433\u0438\u0435 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0435 \u043f\u0435\u0432\u0446\u044b \u043e\u0442\u043a\u0430\u0437\u044b\u0432\u0430\u043b\u0438\u0441\u044c \u043f\u0435\u0442\u044c \u0434\u0443\u044d\u0442\u043e\u043c \u0441 \u0410\u043d\u043d\u043e\u0439 \u0413\u0435\u0440\u043c\u0430\u043d.'), 126),
(505, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u043a\u0438\u043d\u043e\u0430\u043a\u0442\u0435\u0440 \u0442\u0430\u043a \u043e\u0442\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043e \u0441\u0432\u043e\u0435\u0439 \u043a\u0430\u0440\u044c\u0435\u0440\u0435: \"\u041c\u043d\u0435 \u043f\u0440\u0438\u0445\u043e\u0434\u0438\u043b\u043e\u0441\u044c \u0438\u0433\u0440\u0430\u0442\u044c \u0432\u0441\u0435\u0445 - \u0440\u0443\u0441\u0441\u043a\u0438\u0445, \u0435\u0432\u0440\u0435\u0435\u0432, \u0442\u0443\u0440\u043e\u043a \u0438 \u0434\u0430\u0436\u0435 \u0430\u0440\u043c\u044f\u043d\".'), 127),
(506, STRINGDECODE('\u0412\u0441\u043f\u043e\u043c\u043d\u0438\u0442\u0435 \u0444\u0430\u043c\u0438\u043b\u0438\u044e \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u044d\u0441\u0442\u0440\u0430\u0434\u043d\u043e\u0439 \u0430\u043a\u0442\u0440\u0438\u0441\u044b, \u0441\u0442\u0430\u0432\u0448\u0435\u0439 \u043c\u0430\u0442\u0435\u0440\u044c\u044e \u043b\u0435\u0433\u0435\u043d\u0434\u0430\u0440\u043d\u043e\u0433\u043e \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0430\u043a\u0442\u0435\u0440\u0430, \u0435\u0441\u043b\u0438 \u0435\u0433\u043e \u043e\u0442\u0446\u043e\u043c \u0431\u044b\u043b \u0435\u0435 \u043f\u0430\u0440\u0442\u043d\u0435\u0440 \u043f\u043e \u0441\u0446\u0435\u043d\u0435 - \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041c\u0435\u043d\u0430\u043a\u0435\u0440.'), 127),
(507, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0437\u0432\u0430\u043b\u0438 \u043c\u043e\u043b\u043e\u0434\u043e\u0433\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0432 1967 \u0433. \u0437\u0430\u043c\u0435\u0442\u0438\u043b \u0432 \u0440\u0435\u0441\u0442\u043e\u0440\u0430\u043d\u0435 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0411\u0430\u0441\u043e\u0432, \u0440\u0430\u0437\u043c\u044b\u0448\u043b\u044f\u044f \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u0444\u0438\u043b\u044c\u043c\u0430 \"\u0429\u0438\u0442 \u0438 \u043c\u0435\u0447\".'), 127),
(508, STRINGDECODE('\u041a\u043e\u043d\u0434\u0438\u0442\u0435\u0440, \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u044b\u0439 \u043f\u043e\u043f\u0443\u0442\u0447\u0438\u043a, \u0441\u043f\u044f\u0449\u0438\u0439 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0438\u043d - \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438 \u0440\u043e\u043b\u0438 \u043f\u043e\u0437\u0432\u043e\u043b\u044f\u044e\u0442 \u0435\u043c\u0443 \u043d\u0430\u0437\u044b\u0432\u0430\u0442\u044c \u0441\u0435\u0431\u044f \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a\u043e\u043c, \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0430\u044e\u0449\u0438\u043c \u043d\u0430 \u0445\u043e\u043b\u0441\u0442\u0435 \u0441\u0432\u043e\u0435 \u043b\u0438\u0446\u043e \u0441\u0440\u0435\u0434\u0438 \u0442\u043e\u043b\u043f\u044b.'), 127);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(509, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0436\u0435\u043d\u0441\u043a\u043e\u0435 \u0438\u043c\u044f \u0441\u0442\u0430\u043b\u043e \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u044b\u043c \u0443 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0438\u043d\u0442\u0435\u043b\u043b\u0438\u0433\u0435\u043d\u0446\u0438\u0438 \u0432 \u043a\u043e\u043d\u0446\u0435 \u043f\u0440\u043e\u0448\u043b\u043e\u0433\u043e \u0432\u0435\u043a\u0430, \u0430 \u0420\u0443\u0441\u0441\u043a\u0430\u044f \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c, \u0441\u0447\u0438\u0442\u0430\u044f \u0435\u0433\u043e \u044f\u0437\u044b\u0447\u0435\u0441\u043a\u0438\u043c, \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u043b\u043e \u0435\u0433\u043e, \u0438 \u0440\u043e\u0434\u0438\u0442\u0435\u043b\u0438 \u043a\u0440\u0435\u0441\u0442\u0438\u043b\u0438 \u0441\u0432\u043e\u0438\u0445 \u0434\u0435\u0442\u0435\u0439 \u043f\u043e\u0434 \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u0438\u043c \u0438\u043c\u0435\u043d\u0435\u043c \u0424\u043e\u0442\u0438\u043d\u0430.'), 128),
(510, STRINGDECODE('\"\u041a\u0440\u0430\u0441\u0430\u0432\u0447\u0438\u043a\", \"\u0420\u0430\u0431 \u0410\u043b\u043b\u0430\u0445\u0430 \u0432\u0441\u0435\u043c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u043e\u0433\u043e\", \"\u0423\u0447\u0435\u043d\u044b\u0439 \u043c\u0443\u0434\u0440\u0435\u0446, \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u044b\u0439 \u0447\u0438\u0442\u0430\u0442\u044c \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0435 \u041f\u0438\u0441\u0430\u043d\u0438\u0435\", \u0430 \u043a\u0430\u043a\u043e\u0435 \u043f\u0440\u043e\u0437\u0432\u0438\u0449\u0435 \u0435\u043c\u0443 \u0434\u0430\u043b \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447?'), 128),
(511, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0435\u0433\u043e \u0430\u0440\u0430\u0431\u044b \u0441\u0442\u0430\u043b\u0438 \u043d\u0430\u0437\u044b\u0432\u0430\u0442\u044c \u043d\u0435 \u043e\u0442\u0446\u043e\u043c \u0441\u044b\u043d\u0430, \u0430 \"\u043e\u0442\u0446\u043e\u043c \u0434\u0435\u0432\u0443\u0448\u043a\u0438\", \u043a\u0442\u043e \u043e\u043d, \u0435\u0441\u043b\u0438 \u043d\u0430 \u0441\u0430\u043c\u043e\u043c \u0434\u0435\u043b\u0435 \u043e\u043d \u0431\u044b\u043b \u043f\u0435\u0440\u0432\u044b\u043c?'), 128),
(512, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0436\u0435\u043d\u0441\u043a\u043e\u0435 \u0438\u043c\u044f \u043b\u044e\u0431\u0438\u043b\u0438 \u0434\u0430\u0432\u0430\u0442\u044c \u0441\u0432\u043e\u0438\u043c \u0434\u043e\u0447\u0435\u0440\u044f\u043c \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0435 \u043f\u043e\u043b\u044f\u0440\u043d\u0438\u043a\u0438 \u0432 20-\u0435-30-\u0435 \u0433\u0433. \u043d\u0430\u0448\u0435\u0433\u043e \u0441\u0442\u043e\u043b\u0435\u0442\u0438\u044f.'), 128),
(513, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430\u044f \u0444\u0440\u0430\u0437\u0430, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0437\u0430\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441\u043b\u043e\u0432\u0430\u043c\u0438 \"... \u043a\u0430\u043a \u043e\u043d \u0441\u0434\u0435\u043b\u0430\u043b \u043f\u043e\u0432\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u043d\u0430 \u0442\u0435\u043b\u0435 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u0442\u0430\u043a \u0438 \u0435\u043c\u0443 \u0434\u043e\u043b\u0436\u043d\u043e \u0441\u0434\u0435\u043b\u0430\u0442\u044c\".'), 129),
(514, STRINGDECODE('\u0427\u0435\u0445\u043e\u0432 \u0441\u043a\u0430\u0437\u0430\u043b \"\u042f \u0442\u0430\u043a \u0434\u0430\u0432\u043d\u043e \u043d\u0435 \u043f\u0438\u043b \u0448\u0430\u043c\u043f\u0430\u043d\u0441\u043a\u043e\u0433\u043e\", \u042e\u043b\u0438\u0439 \u0426\u0435\u0437\u0430\u0440\u044c - \"\u0418 \u0442\u044b, \u0411\u0440\u0443\u0442\", \u0430 \u0447\u0442\u043e \u0432 \u0430\u043d\u0430\u043b\u043e\u0433\u0438\u0447\u043d\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435 \u0441\u043a\u0430\u0437\u0430\u043b \u042f\u043d \u0413\u0443\u0441?'), 129);
