(539, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0440\u0443\u0441\u0441\u043a\u0430\u044f \u043f\u043e\u0441\u043b\u043e\u0432\u0438\u0446\u0430, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0437\u0430\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441\u043b\u043e\u0432\u0430\u043c\u0438 \"\u0430 \u0440\u0430\u043d\u044c\u0448\u0435 \u0432\u0441\u0442\u0430\u0432\u0430\u0439 \u0438 \u0441\u0432\u043e\u0439 \u0437\u0430\u0442\u0435\u0432\u0430\u0439\".'), 135),
(540, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0440\u0443\u0441\u0441\u043a\u0430\u044f \u043f\u043e\u0441\u043b\u043e\u0432\u0438\u0446\u0430, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0437\u0430\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441\u043b\u043e\u0432\u0430\u043c\u0438 \"\u0442\u0443\u0434\u0430 \u0438 \u0441\u044e\u0434\u0430 \u0431\u044c\u0435\u0442\".'), 135),
