(544, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0433\u043e\u0440\u043e\u0434 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043d\u0430 \u0440\u0435\u043a\u0435 \u0421\u0443\u0445\u043e\u043d\u0435 \u043d\u0435\u043f\u043e\u0434\u0430\u043b\u0435\u043a\u0443 \u043e\u0442 \u0443\u0441\u0442\u044c\u044f \u0440\u0435\u043a\u0438 \u042e\u0433.'), 136),
(545, STRINGDECODE('\u041d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u043c\u0435\u0442\u0430\u043b\u043b\u0430 \u0441\u0432\u044f\u0437\u044b\u0432\u0430\u044e\u0442 \u0441 \u0431\u043e\u0433\u0438\u043d\u0435\u0439 \u043c\u0443\u0434\u0440\u043e\u0441\u0442\u0438 - \u0410\u0444\u0438\u043d\u043e\u0439.'), 137),
(546, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u043c\u0435\u0442\u0430\u043b\u043b, \u043e\u0442\u043a\u0440\u044b\u0442\u044b\u0439 \u0448\u0432\u0435\u0434\u0441\u043a\u0438\u043c \u0445\u0438\u043c\u0438\u043a\u043e\u043c \u042d\u043a\u0435\u0431\u0435\u0440\u0433\u043e\u043c, \u0437\u0430 \u0442\u043e, \u0447\u0442\u043e \u0435\u0433\u043e \u043e\u043a\u0438\u0441\u0435\u043b \u043d\u0435 \u0440\u0430\u0441\u0442\u0432\u043e\u0440\u044f\u0435\u0442\u0441\u044f \u0432 \u043a\u0438\u0441\u043b\u043e\u0442\u0430\u0445.'), 137);
