(548, STRINGDECODE('\u041e\u043d \u043c\u044f\u0433\u0447\u0435 \u0432\u043e\u0441\u043a\u0430, \u043b\u0435\u0433\u0447\u0435 \u0434\u0435\u0440\u0435\u0432\u0430 \u0438 \u0433\u043e\u0440\u0438\u0442 \u043a\u0430\u043a \u0441\u043f\u0438\u0447\u043a\u0430, \u0438\u043c\u0435\u043d\u043d\u043e \u0435\u0433\u043e \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0448\u0432\u0435\u0434\u0441\u043a\u0438\u0439 \u0445\u0438\u043c\u0438\u043a \u0410\u0440\u0444\u0435\u0434\u0441\u043e\u043d \u0441\u0430\u043c\u044b\u043c \u043f\u0435\u0440\u0432\u044b\u043c \u0438\u0437 \u0446\u0430\u0440\u0441\u0442\u0432\u0430 \u043a\u0430\u043c\u043d\u0435\u0439.'), 137),
(549, STRINGDECODE('\u0415\u043c\u0443 \u0434\u0430\u043b\u0438 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \"\u0444\u0438\u043e\u043b\u0435\u0442\u043e\u0432\u044b\u0439\", \u043d\u0430 \u0441\u0430\u043c\u043e\u043c \u0434\u0435\u043b\u0435 \u043e\u043d \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 \u0447\u0435\u0440\u043d\u043e-\u0431\u0443\u0440\u044b\u0445 \u043a\u0440\u0438\u0441\u0442\u0430\u043b\u043b\u043e\u0432 \u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u043d\u0430\u043c\u0438 \u0434\u043b\u044f \u0437\u0430\u0449\u0438\u0442\u044b \u0437\u0434\u043e\u0440\u043e\u0432\u044c\u044f.'), 138),
(550, STRINGDECODE('\u0420\u0430\u0441\u0442\u0432\u043e\u0440\u044b \u0441\u043e\u043b\u0435\u0439 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u0430 \u0438\u043c\u0435\u044e\u0442 \u0440\u043e\u0437\u043e\u0432\u0430\u0442\u043e-\u043a\u0440\u0430\u0441\u043d\u044b\u0439 \u0446\u0432\u0435\u0442. \u041a\u0430\u043a \u043e\u043d \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f?'), 138),
(551, STRINGDECODE('\u041d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u0430 \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0438\u0442\u0441\u044f \u0441 \u043b\u0430\u0442\u044b\u043d\u0438 \u043a\u0430\u043a \"\u043f\u043b\u043e\u0434\u043e\u0440\u043e\u0434\u043d\u044b\u0439, \u043f\u043b\u043e\u0434\u043e\u043d\u043e\u0441\u043d\u044b\u0439\".'), 138),
(552, STRINGDECODE('\u041d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u044d\u0442\u043e\u0433\u043e \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0440\u043e\u0434\u0430 \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0438\u0442\u0441\u044f \u043a\u0430\u043a \"\u0433\u043e\u0440\u043e\u0434 \u043d\u0430 \u0445\u043e\u043b\u043c\u0435\", \u0430 \u043a\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u044d\u043b\u0435\u043c\u0435\u043d\u0442, \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u044b\u0439 \u0432 \u0435\u0433\u043e \u0447\u0435\u0441\u0442\u044c?'), 138),
(553, STRINGDECODE('\u0420\u0438\u043c\u043b\u044f\u043d\u0435 \u0441\u0447\u0438\u0442\u0430\u043b\u0438, \u0447\u0442\u043e \u0443 \u043a\u0430\u0436\u0434\u043e\u0439 \u0432\u0435\u0449\u0438, \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0438 \u0434\u0430\u0436\u0435 \u043c\u0435\u0441\u0442\u0430, \u0435\u0441\u0442\u044c \u0441\u0432\u043e\u0439 \u0431\u043e\u0433. \u041a\u0430\u043a \u043e\u043d\u0438 \u0435\u0433\u043e \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438?'), 139);
