(554, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438 \"\u0431\u0435\u043b\u0443\u044e \u0434\u043e\u0441\u043a\u0443, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0432\u0435\u0448\u0430\u043b\u0438\u0441\u044c \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u0438\u044f\", \u0430 \u043f\u043e\u0437\u0434\u043d\u0435\u0435 \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438 \"\u043a\u043d\u0438\u0436\u043a\u0443 \u0441 \u0431\u0435\u043b\u044b\u043c\u0438 \u043b\u0438\u0441\u0442\u0430\u043c\u0438\". \u041e \u0447\u0435\u043c \u0438\u0434\u0435\u0442 \u0440\u0435\u0447\u044c, \u0435\u0441\u043b\u0438 \u0441\u0435\u0439\u0447\u0430\u0441 \u0435\u0433\u043e \u0441\u0432\u044f\u0437\u044b\u0432\u0430\u044e\u0442 \u0441 \u043c\u0443\u0437\u044b\u043a\u043e\u0439?'), 139),
(555, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0432 \u0434\u0440\u0435\u0432\u043d\u0435\u0440\u0438\u043c\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0435 \u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043b\u0441\u044f \u044e\u0440\u0438\u0441\u0442, \u043a \u0441\u043e\u0432\u0435\u0442\u0443 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0447\u0430\u0441\u0442\u043e \u043f\u0440\u0438\u0431\u0435\u0433\u0430\u043b\u0438 \u043f\u0440\u0438 \u0440\u0430\u0441\u0441\u043c\u043e\u0442\u0440\u0435\u043d\u0438\u0438 \u0432\u0430\u0436\u043d\u044b\u0445 \u0434\u0435\u043b.'), 139),
(556, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0432 \u0414\u0440\u0435\u0432\u043d\u0435\u043c \u0420\u0438\u043c\u0435 \u043f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043b\u0438 \u043b\u0438\u0447\u043d\u043e\u0433\u043e \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044f, \u0432\u043b\u0430\u0434\u0435\u044e\u0449\u0435\u0433\u043e \u0437\u043d\u0430\u043d\u0438\u0435\u043c \u0422\u0438\u0440\u0440\u043e\u043d\u043e\u0432\u044b\u0445 \u0437\u043d\u0430\u0447\u043a\u043e\u0432, \u0442.\u0435. \u0441\u0442\u0435\u043d\u043e\u0433\u0440\u0430\u0444\u0438\u0438, \u0430 \u0441 \u0442\u0440\u0435\u0442\u044c\u0435\u0433\u043e \u0432\u0435\u043a\u0430 \u043d.\u044d. \u0442\u0430\u043a \u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043b\u0438 \u0432\u0441\u0435\u0445 \u0434\u043e\u0432\u0435\u0440\u0435\u043d\u043d\u044b\u0445 \"\u043f\u0438\u0441\u0446\u043e\u0432\" \u0438 \u043a\u0430\u043d\u0446\u0435\u043b\u044f\u0440\u0441\u043a\u0438\u0445 \u0441\u043b\u0443\u0436\u0430\u0449\u0438\u0445.'), 139),
(557, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u043c\u0443 \u043c\u0438\u0444\u0438\u0447\u0435\u0441\u043a\u043e\u043c\u0443 \u0433\u0435\u0440\u043e\u044e, \u043f\u043e\u043c\u043e\u0433\u0448\u0435\u043c\u0443 \u0441\u043f\u0430\u0441\u0442\u0438 \u0415\u0432\u0440\u043e\u043f\u0443, \u0431\u044b\u043b\u0438 \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u044b \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0435\u043d\u043d\u044b\u0435 \u041f\u043b\u0430\u0442\u043e\u043d\u043e\u043c \u0433\u0438\u043c\u043d\u0430\u0441\u0438\u0439 \u0438 \u0441\u0430\u0434 \u0432\u0431\u043b\u0438\u0437\u0438 \u0410\u0444\u0438\u043d.'), 140),
(558, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u043f\u0440\u0438\u0437\u044b\u0432 \u0431\u043e\u0433\u0430 \u0410\u043f\u043e\u043b\u043b\u043e\u043d\u0430 \u043c\u043e\u0433 \u043f\u0440\u043e\u0447\u0438\u0442\u0430\u0442\u044c \u043a\u0430\u0436\u0434\u044b\u0439 \u0432\u0445\u043e\u0434\u044f\u0449\u0438\u0439 \u0432 \u0435\u0433\u043e \u0445\u0440\u0430\u043c \u0432 \u0414\u0435\u043b\u044c\u0444\u0430\u0445.'), 140),
(559, STRINGDECODE('\"\u0421\u043e\u043a\u0440\u0430\u0442, \u0441\u043e\u0448\u0435\u0434\u0448\u0438\u043c \u0441 \u0443\u043c\u0430\" - \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0435\u0433\u043e \u043d\u0430\u0437\u0432\u0430\u043b \u041f\u043b\u0430\u0442\u043e\u043d. \u041e\u043d \u0438 \u0435\u0433\u043e \u043f\u043e\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u043d\u0435\u043b\u0438\u0446\u0435\u043f\u0440\u0438\u044f\u0442\u043d\u044b\u0435 \u043f\u0440\u043e\u0437\u0432\u0438\u0449\u0430 \u043f\u043e \u043c\u0435\u0441\u0442\u043e\u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u044e \u0433\u0438\u043c\u043d\u0430\u0441\u0438\u044f \u0438 \u0445\u043e\u043b\u043c\u0430, \u0433\u0434\u0435 \u043e\u043d\u0438 \u0437\u0430\u043d\u0438\u043c\u0430\u043b\u0438\u0441\u044c. \u041a\u0442\u043e \u043e\u043d?'), 140);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(560, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0432 \u0414\u0440\u0435\u0432\u043d\u0435\u0439 \u0413\u0440\u0435\u0446\u0438\u0438 \u0438 \u0420\u0438\u043c\u0435 \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u043e\u0441\u044c \u043c\u0435\u0441\u0442\u043e, \u0441 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u044b \u0438 \u0440\u0438\u0442\u043e\u0440\u044b \u043f\u0440\u043e\u0438\u0437\u043d\u043e\u0441\u0438\u043b\u0438 \u0441\u0432\u043e\u0438 \u0440\u0435\u0447\u0438.'), 140),
(561, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u043c\u043e\u0440\u0435 \u043d\u0435 \u0438\u043c\u0435\u0435\u0442 \u0431\u0435\u0440\u0435\u0433\u043e\u0432 \u0438 \u043d\u043e\u0441\u0438\u0442 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \"\u043c\u043e\u0440\u0435 \u0432\u0438\u043d\u043e\u0433\u0440\u0430\u0434\u043d\u044b\u0445 \u043b\u043e\u0437\".'), 141),
(562, STRINGDECODE('\u0410\u0440\u043c\u044f\u043d\u0435 \u043d\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u0435\u0435 \"\u0432\u0435\u043b\u0438\u043a\u043e\u0439\", \u0442\u0443\u0440\u043a\u0438 - \"\u043a\u0440\u0438\u0432\u043e\u0439\", \u0432\u0441\u043f\u043e\u043c\u043d\u0438\u0432 \u043d\u043e\u0432\u0435\u0439\u0448\u0443\u044e \u044d\u0442\u0438\u043c\u043e\u043b\u043e\u0433\u0438\u044e \"\u0441\u043b\u0430\u0432\u043d\u044b\u0439 \u043e\u0442\u0435\u0446 \u0433\u043e\u0440\", \u0432\u044b \u043d\u0430\u0437\u043e\u0432\u0435\u0442\u0435 \u043c\u0435\u0441\u0442\u043e, \u0433\u0434\u0435 \u0430\u0440\u043c\u044f\u043d\u0441\u043a\u0438\u0439 \u0446\u0430\u0440\u044c \u0410\u0440\u0430 \u041f\u0440\u0435\u043a\u0440\u0430\u0441\u043d\u044b\u0439 \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043e\u0442 \u0432\u0430\u0432\u0438\u043b\u043e\u043d\u044f\u043d.'), 141),
(563, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u043c\u0443 \u043d\u0430\u0440\u043e\u0434\u0443 \u0430\u043b\u0433\u043e\u043d\u043a\u0438\u043d\u0441\u043a\u0438\u0435 \u0438\u043d\u0434\u0435\u0439\u0446\u044b \u0434\u0430\u043b\u0438 \u043f\u0440\u043e\u0437\u0432\u0438\u0449\u0435 \"\u043f\u043e\u0435\u0434\u0430\u0442\u0435\u043b\u0438 \u0441\u044b\u0440\u043e\u0433\u043e \u043c\u044f\u0441\u0430\".'), 141),
(564, STRINGDECODE('\"\u0420\u0435\u043a\u0430 \u0441\u0432. \u041c\u0430\u0440\u0438\u0438 \u043f\u0440\u0435\u0441\u043d\u043e\u0433\u043e \u043c\u043e\u0440\u044f\" - \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u0432\u0430\u043b \u0435\u0435 \u0432 1500 \u0433\u043e\u0434\u0443 \u0438\u0441\u043f\u0430\u043d\u0435\u0446 \u0412\u0438\u0441\u0435\u043d\u0442\u0435 \u041f\u0438\u043d\u0441\u043e\u043d. \u041f\u043e\u0441\u043b\u0435 \u0442\u043e\u0433\u043e, \u043a\u0430\u043a \u043f\u043e \u043d\u0435\u0439 \u043f\u0440\u043e\u0435\u0445\u0430\u043b\u0430 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0430\u044f \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f \u0424\u0440\u0430\u043d\u0441\u0438\u0441\u043a\u043e \u041e\u0440\u0435\u043b\u044c\u044f\u043d\u044b \u0435\u0435 \u043d\u0430\u0437\u0432\u0430\u043b\u0438 \u0420\u0438\u043e-\u041e\u0440\u0435\u043b\u044c\u044f\u043d\u0430. \u0412\u0441\u043f\u043e\u043c\u043d\u0438\u0432 \u043e\u0434\u0438\u043d \u0438\u0437 \u043f\u043e\u0434\u0432\u0438\u0433\u043e\u0432 \u0413\u0435\u0440\u0430\u043a\u043b\u0430, \u0432\u044b \u043d\u0430\u0437\u043e\u0432\u0435\u0442\u0435 \u0435\u0435 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435.'), 141),
(565, STRINGDECODE('\u0423 \u0434\u0440\u0435\u0432\u043d\u0438\u0445 \u0433\u0440\u0435\u043a\u043e\u0432 - \u042d\u0440\u043e\u0442, \u0443 \u0434\u0440\u0435\u0432\u043d\u0438\u0445 \u0440\u0438\u043c\u043b\u044f\u043d - \u041a\u0443\u043f\u0438\u0434\u043e\u043d \u0438\u043b\u0438 \u0410\u043c\u0443\u0440, \u0430 \u043a\u0442\u043e \u0443 \u0438\u043d\u0434\u0438\u0439\u0446\u0435\u0432?'), 142);
