(566, STRINGDECODE('\u041c\u0430\u0442\u044c \u043d\u0430\u0437\u0432\u0430\u043b\u0430 \u0435\u0433\u043e \"\u0411\u0435\u043d-\u043e\u043d\u0438\", \u0442.\u0435. \"\u0441\u044b\u043d \u043d\u0435\u0441\u0447\u0430\u0441\u0442\u044c\u044f\", \u043e\u0434\u043d\u0430\u043a\u043e \u043e\u0442\u0435\u0446 \u0434\u0430\u043b \u0435\u043c\u0443 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u043f\u043e\u043b\u043e\u0436\u043d\u043e\u0435 \u0438\u043c\u044f - \"\u0441\u044b\u043d \u0441\u0447\u0430\u0441\u0442\u044c\u044f\", \u043a\u0430\u043a \u0436\u0435 \u043e\u043d\u043e \u0437\u0432\u0443\u0447\u0438\u0442?'), 142),
(567, STRINGDECODE('\u0418\u043c\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0431\u0438\u0431\u043b\u0435\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430 \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0438\u0442\u0441\u044f \u043a\u0430\u043a \"\u043f\u044f\u0442\u043a\u0430\".'), 142),
