(569, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438 \u0441\u043b\u043e\u0432\u0430 \u0432\u044b\u0431\u0438\u0442\u044b \u043d\u0430 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0435 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u043c\u0443 \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0443 \u041a\u0430\u043c\u0431\u0440\u043e\u043d\u0443, \u0438 \u0432\u0441\u0435 \u0441\u0447\u0438\u0442\u0430\u044e\u0442, \u0447\u0442\u043e \u043e\u043d \u043f\u0440\u043e\u0438\u0437\u043d\u0435\u0441 \u0438\u0445 18 \u0438\u044e\u043d\u044f 1815 \u0433\u043e\u0434\u0430.'), 143),
(570, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438\u043c\u0438 \u0441\u043b\u043e\u0432\u0430\u043c\u0438 \u043f\u043e\u043c\u0435\u0447\u0435\u043d \u043e\u0433\u0440\u043e\u043c\u043d\u044b\u0439 \u043c\u0430\u0442\u0435\u0440\u0438\u043a \u043d\u0430 \u0433\u0435\u043e\u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u0430\u0440\u0442\u0435 \u042f\u043d\u0430 \u0421\u0442\u043e\u0431\u043d\u0438\u0446\u043a\u043e\u0433\u043e, \u0432\u044b\u0448\u0435\u0434\u0448\u0435\u0439 \u0432 \u041f\u043e\u043b\u044c\u0448\u0435 \u0432 1522 \u0433\u043e\u0434\u0443.'), 143),
(571, STRINGDECODE('\u042d\u0442\u043e\u0442 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043b\u043e\u0433\u0438\u043a, \u0438\u0441\u0441\u043b\u0435\u0434\u0443\u044f \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0443 \u0432\u0437\u0430\u0438\u043c\u043e\u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u0440\u0430\u0437\u0443\u043c\u0430 \u0438 \u0432\u043e\u043b\u0438, \u043f\u0440\u0438\u0448\u0435\u043b \u043a \u0432\u044b\u0432\u043e\u0434\u0443, \u0447\u0442\u043e \u043a\u043e\u0433\u0434\u0430 \u0440\u0430\u0437\u0443\u043c \u0444\u0438\u043a\u0441\u0438\u0440\u0443\u0435\u0442 \u0440\u0430\u0432\u043d\u043e\u0446\u0435\u043d\u043d\u044b\u0435 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u0438 \u0432\u044b\u0431\u043e\u0440\u0430 \u043c\u0435\u0436\u0434\u0443 \u0441\u0445\u043e\u0434\u043d\u044b\u043c\u0438 \u043c\u043e\u0442\u0438\u0432\u0430\u043c\u0438, \u0442\u043e \u0432\u043e\u043b\u044f \u0441\u0435\u0431\u044f \u043d\u0435 \u043f\u0440\u043e\u044f\u0432\u043b\u044f\u0435\u0442. \u0410 \u043a\u043e\u0433\u043e \u043e\u043d \u043f\u0440\u0438\u0432\u043e\u0434\u0438\u043b \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043f\u0440\u0438\u043c\u0435\u0440\u0430?'), 143);
