(615, STRINGDECODE('\u041a\u0430\u043a\u043e\u0435 \u043f\u0440\u043e\u0437\u0432\u0438\u0449\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0435, \u043d\u0435 \u0438\u043c\u0435\u044f \u043f\u0440\u0438\u0445\u043e\u0434\u0430, \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d\u044b \u0431\u044b\u043b\u0438 \u0440\u0430\u0431\u043e\u0442\u0430\u0442\u044c \"\u043f\u043e \u0445\u0430\u0440\u0442\u0438\u0438\", \u0442\u043e \u0435\u0441\u0442\u044c \u043a\u043e\u0447\u0435\u0432\u0430\u0442\u044c \u043f\u043e \u0433\u043b\u0443\u0445\u0438\u043c \u0434\u0435\u0440\u0435\u0432\u043d\u044f\u043c, \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u044f \u0441\u0432\u043e\u044e \u0440\u0430\u0431\u043e\u0442\u0443 \u0441\u0442\u043e\u043b\u044c \u043d\u0435\u0431\u0440\u0435\u0436\u043d\u043e, \u0447\u0442\u043e \u0434\u0430\u0436\u0435 \u0432\u043e\u0448\u043b\u0438 \u0432 \u043f\u043e\u0441\u043b\u043e\u0432\u0438\u0446\u0443.'), 154),
(616, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043d\u043e\u0441\u0438\u0442 \u043f\u0442\u0438\u0446\u0430, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0432 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0434\u0443\u0445\u043e\u0432\u043d\u044b\u0445 \u0441\u0442\u0438\u0445\u0430\u0445 \u043e \"\u0413\u043e\u043b\u0443\u0431\u0438\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0435\" \u0443\u043f\u043e\u043c\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u043f\u043e\u0434 \u0438\u043c\u0435\u043d\u0435\u043c \u0421\u0442\u0440\u0435\u0444\u0438\u043b.'), 154),
(617, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0441\u043b\u043e\u0432\u043e \u0432 \u0442\u043e\u043b\u043a\u043e\u0432\u043e\u043c \u0441\u043b\u043e\u0432\u0430\u0440\u0435 \u0414\u0430\u043b\u044f \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043e \u043a\u0430\u043a \"\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0435 \u0441\u043b\u043e\u0432\u043e, \u0432\u043e\u0438\u043d \u0434\u043b\u044f \u0437\u0435\u043c\u043b\u044f\u043d\u044b\u0445 \u0440\u0430\u0431\u043e\u0442, \u0432 \u0447\u044c\u0438 \u043e\u0431\u044f\u0437\u0430\u043d\u043d\u043e\u0441\u0442\u0438 \u0432\u0445\u043e\u0434\u0438\u043b\u043e \u043f\u0440\u043e\u043b\u0430\u0433\u0430\u0442\u044c \u0434\u043e\u0440\u043e\u0433\u0443 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\".'), 155),
(618, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0432\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0430 \u0414\u0430\u043b\u044f \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438\u0441\u044c \u0431\u043e\u043b\u044c\u0448\u0438\u0435 \u043a\u0443\u0447\u0438 \u043c\u0443\u0441\u043e\u0440\u0430, \u0441\u043e\u0431\u0438\u0440\u0430\u0435\u043c\u044b\u0435 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043e\u0447\u0438\u0441\u0442\u043a\u0438 \u0433\u043e\u0440\u043e\u0434\u0430.'), 155);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(619, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0441\u043b\u043e\u0432\u043e \u0432 \u0442\u043e\u043b\u043a\u043e\u0432\u043e\u043c \u0441\u043b\u043e\u0432\u0430\u0440\u0435 \u0414\u0430\u043b\u044f \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043e \u043a\u0430\u043a \"\u0442\u043e\u043d\u043a\u0430\u044f, \u043b\u0435\u0442\u0443\u0447\u0430\u044f, \u0433\u043e\u0440\u044e\u0447\u0430\u044f, \u0441\u0438\u043b\u044c\u043d\u043e \u043e\u0445\u043c\u0435\u043b\u044f\u044e\u0449\u0430\u044f \u0436\u0438\u0434\u043a\u043e\u0441\u0442\u044c, \u0440\u0430\u0441\u0442\u0432\u043e\u0440\u044f\u044e\u0449\u0430\u044f \u0441\u043c\u043e\u043b\u044b\".'), 155),
(620, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a, \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u0442\u043e\u043b\u043a\u043e\u0432\u043e\u043c\u0443 \u0441\u043b\u043e\u0432\u0430\u0440\u044e \u0414\u0430\u043b\u044f, \u0434\u0440\u0435\u0432\u043d\u0438\u0435 \u0440\u0443\u0441\u0438\u0447\u0438 \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438 \u043a\u0430\u0440\u0430\u043a\u0430\u0442\u0438\u0446\u0443 \u0438\u043b\u0438 \u0441\u043f\u0440\u0443\u0442\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0435\u0449\u0435 \u0438 \u0432 XIX \u0432\u0435\u043a\u0435 \u0441\u0447\u0438\u0442\u0430\u043b\u0438 \u0431\u043b\u0438\u0437\u043a\u0438\u043c \u043a \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u044f\u043c.'), 155),
(621, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043d\u043e\u0441\u0438\u0442 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u0430\u044f \u043a\u043e\u0441\u0442\u044c, \u043f\u043e\u0445\u043e\u0436\u0430\u044f \u043f\u043e \u0444\u043e\u0440\u043c\u0435 \u043d\u0430 \u0434\u043b\u0438\u043d\u043d\u044b\u0439 \u0442\u043e\u043d\u043a\u0438\u0439 \u043a\u043b\u044e\u0447, \u0438\u0437\u043e\u0433\u043d\u0443\u0442\u044b\u0439 \u043d\u0430 \u043e\u0434\u043d\u043e\u043c \u043a\u043e\u043d\u0446\u0435.'), 156),
(622, STRINGDECODE('\u0427\u0442\u043e \u043e\u0442\u043a\u0440\u044b\u043b \u0432 1892 \u0433\u043e\u0434\u0443 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0443\u0447\u0435\u043d\u044b\u0439 \u0414\u043c\u0438\u0442\u0440\u0438\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447 \u0418\u0432\u0430\u043d\u043e\u0432\u0441\u043a\u0438\u0439, \u0438\u0437\u0443\u0447\u0430\u044f \u043c\u043e\u0437\u0430\u0438\u0447\u043d\u0443\u044e \u0431\u043e\u043b\u0435\u0437\u043d\u044c \u0442\u0430\u0431\u0430\u043a\u0430, \u0435\u0441\u043b\u0438 \u043f\u043e\u0437\u0434\u043d\u0435\u0435 \u0438\u0445 \u043d\u0430\u0437\u0432\u0430\u043b\u0438 \"\u044f\u0434\u0430\u043c\u0438\"?'), 156),
(623, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u0438\u0439 \u043e\u0440\u0433\u0430\u043d \u0441\u043b\u0443\u0436\u0438\u043b, \u043f\u043e \u043c\u043d\u0435\u043d\u0438\u044e \u0434\u0440\u0435\u0432\u043d\u0438\u0445 \u0433\u0440\u0435\u043a\u043e\u0432, \u043b\u0438\u0448\u044c \u0434\u043b\u044f \u043e\u0445\u043b\u0430\u0436\u0434\u0435\u043d\u0438\u044f \u0432\u043e\u0437\u0434\u0443\u0445\u0430 \u0438 \u043a\u0440\u043e\u0432\u0438.'), 156),
(624, STRINGDECODE('\u041a\u0430\u043a\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043d\u043e\u0441\u0438\u0442 \u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 \u0430\u043a\u0440\u043e\u043c\u0438\u0446\u0438\u043d\u0430, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0441\u043e\u0431\u043e\u0439 \u0441\u0432\u044f\u0437\u044c \u0447\u0435\u0442\u044b\u0440\u0435\u0445 \u0443\u0433\u043b\u0435\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043b\u0435\u0446.'), 156),
(625, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043b\u043e\u0441\u044c \u0432 \u0430\u043f\u0440\u0435\u043b\u0435 1964 \u0433\u043e\u0434\u0430 \u043f\u043e\u0441\u043b\u0435 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044f \u0434\u0432\u0443\u0445 \u0441\u0442\u0440\u0430\u043d \u0417\u0430\u043d\u0437\u0438\u0431\u0430\u0440\u0430 \u0438 \u0422\u0430\u043d\u0433\u0430\u043d\u044c\u0438\u043a\u0438.'), 157);
