(629, STRINGDECODE('\u041a\u0430\u043a\u0438\u043c \u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u043c \u0441\u043b\u043e\u0432\u043e\u043c \u043c\u044b \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c \u0441\u0435\u0439\u0447\u0430\u0441 \u043f\u0443\u0448\u043a\u0443 \u0441 \u043a\u043e\u0440\u043e\u0442\u043a\u0438\u043c \u0441\u0442\u0432\u043e\u043b\u043e\u043c, \u043f\u043e\u0445\u043e\u0436\u0443\u044e \u043d\u0430 \u0441\u0442\u0443\u043f\u043a\u0443?'), 158),
