(2843, STRINGDECODE('\u041f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u0435 \u0446\u0438\u0442\u0430\u0442\u0443 \u0438\u0437 \u043c\u0438\u043d\u0438\u0430\u0442\u044e\u0440\u044b \"\u0416\u0435\u043d\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\": \"\u0412\u0441\u0451 \u043e\u0447\u0435\u043d\u044c \u043f\u0440\u043e\u0441\u0442\u043e, \u0435\u0441\u043b\u0438 \u043f\u043e\u043d\u0438\u043c\u0430\u0435\u0448\u044c \u0436\u0435\u043d\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a... \u041a\u043e\u043b\u044c\u0446\u043e \u043d\u0430 \u043f\u0440\u0430\u0432\u043e\u0439 \u0440\u0443\u043a\u0435 - \u0437\u0430\u043c\u0443\u0436\u0435\u043c, \u0441\u043f\u043e\u043a\u043e\u0439\u043d\u043e, \u0432\u0441\u0435 \u0441\u0442\u043e\u044f\u0442 \u043d\u0430 \u0441\u0432\u043e\u0438\u0445 \u043c\u0435\u0441\u0442\u0430\u0445. \u041a\u043e\u043b\u044c\u0446\u043e \u043d\u0430 \u043b\u0435\u0432\u043e\u0439 - \u0440\u0430\u0437\u0432\u0435\u043b\u0430\u0441\u044c. \u041a\u043e\u043b\u044c\u0446\u043e \u043d\u0430 \u043f\u0440\u0430\u0432\u043e\u0439, \u043a\u043e\u043b\u044c\u0446\u043e \u043d\u0430 \u043b\u0435\u0432\u043e\u0439 - \u0434\u0432\u0430\u0436\u0434\u044b \u0437\u0430\u043c\u0443\u0436\u0435\u043c, \u0432\u0442\u043e\u0440\u043e\u0439 \u0440\u0430\u0437 \u0443\u0434\u0430\u0447\u043d\u043e. \u0414\u0432\u0430 \u043a\u043e\u043b\u044c\u0446\u0430 \u043d\u0430 \u043f\u0440\u0430\u0432\u043e\u0439, \u0441\u0435\u0440\u044c\u0433\u0438 - \u0437\u0430\u043c\u0443\u0436\u0435\u043c, \u043d\u043e \u0435\u0441\u0442\u044c \u0435\u0449\u0435 \u0447\u0435\u043b\u043e\u0432\u0435\u043a. \u041e\u0431\u0430 \u0436\u0435\u043d\u0430\u0442\u044b. \u041e\u0434\u0438\u043d \u043d\u0430 \u043c\u043d\u0435...\" \u0410 \u0447\u0442\u043e \u0435\u0449\u0451 \u0440\u043e\u0434\u043d\u0438\u0442 \u044d\u0442\u0438\u0445 \u043e\u0431\u043e\u0438\u0445?'), 711);
