(3382, STRINGDECODE('\u0421\u043e\u0432\u0441\u0435\u043c \u043d\u0435\u0434\u0430\u0432\u043d\u043e \u0433\u0430\u0437\u0435\u0442\u044b \u043f\u0438\u0441\u0430\u043b\u0438: \"\u041b\u0438\u0442\u0432\u0438\u043d\u043e\u0432\u0430 \u043d\u0435 \u043f\u0435\u0440\u0435\u0441\u0442\u0430\u0435\u0442 \u0443\u0434\u0438\u0432\u043b\u044f\u0442\u044c. \u041f\u0440\u0435\u0434\u043f\u043e\u0447\u0438\u0442\u0430\u0435\u0442 \u043e\u0434\u0435\u0432\u0430\u0442\u044c\u0441\u044f \u0441\u043a\u0440\u043e\u043c\u043d\u043e, \u0441\u043e\u0433\u043b\u0430\u0448\u0430\u0435\u0442\u0441\u044f \u0441\u043d\u044f\u0442\u044c\u0441\u044f \u0434\u043b\u044f \"\u041f\u043b\u0435\u0439\u0431\u043e\u044f\". \u0423 \u043d\u0435\u0435 \u0443\u0442\u043e\u043d\u0447\u0435\u043d\u043d\u044b\u0439 \u0432\u043a\u0443\u0441, \u043d\u043e \u0434\u0443\u0445\u0438 \u043e\u043d\u0430 \u0432\u044b\u0431\u0438\u0440\u0430\u0435\u0442 \u0442\u043e\u043b\u044c\u043a\u043e \u044d\u0442\u0438\".'), 846),
(3383, STRINGDECODE('\u041d\u0430 \u044d\u0442\u043e \u043d\u0435\u0434\u0430\u0432\u043d\u0435\u0435 \u043f\u0440\u043e\u0438\u0441\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u0410\u043d\u0434\u0440\u0435\u0439 \u0412\u043e\u0437\u043d\u0435\u0441\u0435\u043d\u0441\u043a\u0438\u0439 \u043e\u0442\u043a\u043b\u0438\u043a\u043d\u0443\u043b\u0441\u044f \u043f\u043e\u044d\u043c\u043e\u0439, \u0433\u0434\u0435 \u043f\u0438\u0441\u0430\u043b: \"\u041a\u043e\u043c\u0443-\u0442\u043e \u0431\u0435\u0434\u0430 \u0441\u043b\u0443\u0447\u0438\u043b\u0430\u0441\u044c, \u043a\u043e\u043c\u0443-\u0442\u043e \u0431\u0430\u0440\u044b\u0448. \u0420\u043e\u0441\u0441\u0438\u044f, \u043c\u043e\u044f \u043b\u0443\u0447\u0438\u043d\u0430, \u0437\u0430\u0447\u0435\u043c \u0442\u0430\u043a \u044f\u0440\u043a\u043e \u0433\u043e\u0440\u0438\u0448\u044c?\".'), 846);
