(3384, STRINGDECODE('\u042d\u0442\u043e\u0433\u043e \u0443\u0440\u043e\u0436\u0435\u043d\u0446\u0430 \u041c\u043e\u0433\u0438\u043b\u0435\u0432\u0430, \u0443\u0447\u0435\u043d\u043e\u0433\u043e \u0438 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043a\u0430 \u043f\u0440\u043e\u0437\u0432\u0430\u043b\u0438 \"\u043a\u0440\u0430\u0441\u043d\u044b\u043c \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u043a\u043e\u043c\".'), 846),
(3385, STRINGDECODE('\u0412 \u043a\u0430\u043d\u0443\u043d \u043f\u044f\u0442\u043e\u0439 \u0433\u043e\u0434\u043e\u0432\u0449\u0438\u043d\u044b \u0435\u0435 \u0433\u0438\u0431\u0435\u043b\u0438 \u0432\u044b\u0448\u043b\u0430 \u0432 \u0441\u0432\u0435\u0442 \u043a\u043d\u0438\u0433\u0430 \u041a\u0435\u043d\u0430 \u0423\u043e\u0440\u0444\u0430 \"\u0422\u0449\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u043e\u0445\u0440\u0430\u043d\u044f\u0435\u043c\u044b\u0439 \u0441\u0435\u043a\u0440\u0435\u0442\" - \u0438 \u0441\u0440\u0430\u0437\u0443 \u0441\u0442\u0430\u043b\u0430 \u0431\u0435\u0441\u0442\u0441\u0435\u043b\u043b\u0435\u0440\u043e\u043c, \u0445\u043e\u0442\u044f \u0438 \u0432\u044b\u0437\u0432\u0430\u043b\u0430 \u044f\u0440\u043e\u0441\u0442\u044c \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0443 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u0441\u0435\u043c\u044c\u0438, \u043d\u043e \u0438 \u0443 \u0431\u043e\u043b\u044c\u0448\u0438\u043d\u0441\u0442\u0432\u0430 \u0431\u0440\u0438\u0442\u0430\u043d\u0446\u0435\u0432.'), 847),
(3386, STRINGDECODE('\u0412 \u0441\u0430\u043c\u043e\u043c \u043a\u043e\u043d\u0446\u0435 \u044d\u0442\u043e\u0433\u043e \u0440\u043e\u043c\u0430\u043d\u0430 \u042d\u0440\u0438\u0445\u0430 \u041c\u0430\u0440\u0438\u0438 \u0420\u0435\u043c\u0430\u0440\u043a\u0430 \u0435\u0441\u0442\u044c \u0441\u043b\u043e\u0432\u0430: \"\u0412\u043e\u0435\u043d\u043d\u044b\u0435 \u0441\u0432\u043e\u0434\u043a\u0438 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0438 \u0438\u0437 \u043e\u0434\u043d\u043e\u0439 \u0442\u043e\u043b\u044c\u043a\u043e \u0444\u0440\u0430\u0437\u044b...\".'), 847),
