(3388, STRINGDECODE('14 \u0444\u0435\u0432\u0440\u0430\u043b\u044f 1994 \u0433. \u043d\u0430 \u043a\u043d\u0438\u0433\u0435 \u041a\u0440\u0438\u0432\u0438\u0447\u0430 \u0438 \u041e\u043b\u044c\u0433\u0438\u043d\u0430 \"\u0422\u043e\u0432\u0430\u0440\u0438\u0449 \u0443\u0431\u0438\u0439\u0446\u0430\" \u043e\u043d \u0441\u0434\u0435\u043b\u0430\u043b \u043d\u0430\u0434\u043f\u0438\u0441\u044c: \"\u0421\u043f\u0430\u0441\u0438\u0431\u043e \u0432\u0430\u043c \u0432\u0441\u0435\u043c, \u043a\u0442\u043e \u0441\u043e \u043c\u043d\u043e\u0439 \u043c\u0443\u0447\u0438\u043b\u0441\u044f, \u0438 \u0447\u0442\u043e\u0431 \u0431\u043e\u043b\u044c\u0448\u0435 \u043d\u0435 \u0431\u044b\u043b\u043e \u0442\u0430\u043a\u0438\u0445, \u043a\u0430\u043a \u044f, \u0442\u0430\u043a\u0438\u0445 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043d\u0438\u043a\u043e\u0432 \u0438\u043b\u0438 \u0431\u043e\u043b\u044c\u043d\u044b\u0445\".'), 847),
