(3514, STRINGDECODE('\u041d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u0436\u0435\u043d\u0441\u043a\u043e\u0439 \u043d\u0430\u043a\u0438\u0434\u043a\u0438 \u0441\u043e\u0432\u043f\u0430\u0434\u0430\u0435\u0442 \u0441 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \u0443\u0432\u0435\u043d\u0447\u0430\u043d\u043d\u043e\u0439 \u043a\u0443\u043f\u043e\u043b\u043e\u043c \u043a\u0440\u0443\u0433\u043b\u043e\u0439 \u0432 \u043f\u043b\u0430\u043d\u0435 \u043f\u043e\u0441\u0442\u0440\u043e\u0439\u043a\u0438.'), 879),
(3515, STRINGDECODE('\u0420\u0443\u0441\u0441\u043a\u0430\u044f \u043f\u043e\u0433\u043e\u0432\u043e\u0440\u043a\u0430 \u0433\u043b\u0430\u0441\u0438\u0442: \"\u0423\u0442\u043a\u0430 \u0432 \u044e\u0431\u043a\u0435, \u043a\u0443\u0440\u043e\u0447\u043a\u0430 \u0432 \u0441\u0430\u043f\u043e\u0436\u043a\u0430\u0445, \u0441\u0435\u043b\u0435\u0437\u0435\u043d\u044c \u0432 \u0441\u0435\u0440\u0435\u0436\u043a\u0430\u0445, \u043a\u043e\u0440\u043e\u0432\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u043e\u043c, \u0434\u0430 \u0432\u0441\u0435\u0445 \u0434\u043e\u0440\u043e\u0436\u0435\".'), 879),
(3516, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0442\u0435\u0430\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0430 \u0421\u0435\u0440\u0433\u0435\u044f \u041d\u0438\u043a\u0438\u0442\u0438\u043d\u0430, \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u0430\u044f \u043f\u043e \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0443 \u0410.\u041f. \u0427\u0435\u0445\u043e\u0432\u0430.'), 879),
(3517, STRINGDECODE('\u0412 \u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u043e\u0442 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f, \u0438\u0445 \u0438\u0437\u0433\u043e\u0442\u0430\u0432\u043b\u0438\u0432\u0430\u044e\u0442 \u0438\u0437 \u0442\u0440\u0435\u0445 \u043a\u043e\u043b\u044c\u0435\u0432 \u0438\u043b\u0438 \u0440\u0435\u043b\u044c\u0441, \u0441\u043a\u0440\u0435\u043f\u043b\u0435\u043d\u043d\u044b\u0445 \u043f\u043e\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0435, \u0430 \u0432\u043e\u043e\u0431\u0449\u0435 \u044d\u0442\u043e \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u0438\u0435 \u0436\u0438\u0432\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u0440\u044f\u0434\u0430 \u043d\u0430\u0441\u0435\u043a\u043e\u043c\u043e\u044f\u0434\u043d\u044b\u0445.'), 880),
(3518, STRINGDECODE('\u0421\u0442\u0440\u043e\u0439 \u043b\u0435\u0433\u0438\u043e\u043d\u043e\u0432, \u043f\u0440\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0432\u043e\u0438\u043d\u044b \u0437\u0430\u043a\u0440\u044b\u0432\u0430\u043b\u0438 \u0433\u043e\u043b\u043e\u0432\u044b \u0449\u0438\u0442\u0430\u043c\u0438, \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0441\u044f \u0442\u0430\u043a \u0436\u0435, \u043a\u0430\u043a \u044d\u0442\u043e \u043f\u0440\u0435\u0441\u043c\u044b\u043a\u0430\u044e\u0449\u0435\u0435\u0441\u044f.'), 880),
(3519, STRINGDECODE('\u041f\u0435\u0440\u0432\u044b\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \"\u041f\u0435\u0442\u0440 \u0412\u0435\u043b\u0438\u043a\u0438\u0439\". \u0412 \u0436\u0438\u0432\u043e\u0442\u043d\u043e\u043c \u043c\u0438\u0440\u0435 \u044d\u0442\u043e \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u043e \u043c\u0438\u0440\u043d\u044b\u0439 \u0437\u0432\u0435\u0440\u044c, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0440\u0438 \u0432\u0441\u0442\u0440\u0435\u0447\u0435 \u0441 \u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u044c\u044e \u043f\u0440\u0435\u0434\u043f\u043e\u0447\u0438\u0442\u0430\u0435\u0442 \u043f\u043e\u0431\u044b\u0441\u0442\u0440\u0435\u0435 \u0437\u0430\u043a\u043e\u043f\u0430\u0442\u044c\u0441\u044f \u0432 \u0437\u0435\u043c\u043b\u044e.'), 880),
(3520, STRINGDECODE('\u0415\u0441\u043b\u0438 \u043e\u043d \u0431\u043e\u043b\u044c\u0448\u043e\u0439 - \u0442\u043e \u043c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c \u043e\u043f\u043e\u0440\u043e\u0439 \u0438\u043b\u0438 \u043a\u0440\u0443\u043f\u043d\u044b\u043c \u043f\u0430\u0440\u043d\u043e\u043a\u043e\u043f\u044b\u0442\u043d\u044b\u043c, \u0435\u0441\u043b\u0438 \u043c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u0439 - \u043f\u0440\u043e\u0441\u0442\u043e \u043c\u0443\u0441\u043e\u0440\u043e\u043c, \u043e\u0441\u0442\u0430\u0442\u043a\u043e\u043c \u0438\u043b\u0438 \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0440\u044b\u0431\u043e\u0439.'), 880);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(3521, STRINGDECODE('\u042d\u0442\u0438 \u0441\u0432\u044f\u0442\u044b\u0435 \u0441\u0447\u0438\u0442\u0430\u043b\u0438\u0441\u044c \u043f\u043e\u043a\u0440\u043e\u0432\u0438\u0442\u0435\u043b\u044f\u043c\u0438 \u0432\u0440\u0430\u0447\u0435\u0439, \u0444\u0430\u0440\u043c\u0430\u0446\u0435\u0432\u0442\u043e\u0432 \u0438 \u043a\u0443\u0437\u043d\u0435\u0446\u043e\u0432. \u0410\u0442\u0440\u0438\u0431\u0443\u0442\u0430\u043c\u0438, \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u044e\u0449\u0438\u043c\u0438 \u043d\u0430 \u0438\u0445 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u044c \u043a \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0435, \u044f\u0432\u043b\u044f\u043b\u0438\u0441\u044c \u0432\u0440\u0430\u0447\u0435\u0431\u043d\u044b\u0439 \u044f\u0449\u0438\u0447\u0435\u043a \u0443 \u043e\u0434\u043d\u043e\u0433\u043e \u0438 \u043f\u0442\u0438\u0447\u044c\u0435 \u043f\u0435\u0440\u043e \u0432 \u0440\u0443\u043a\u0435 \u0443 \u0434\u0440\u0443\u0433\u043e\u0433\u043e.'), 881),
(3522, STRINGDECODE('\u0412\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0430 \u041a\u0440\u044b\u043c\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u041d.\u0410. \u041d\u0435\u043a\u0440\u0430\u0441\u043e\u0432 \u043f\u0438\u0441\u0430\u043b \u043e \u043d\u0435\u043c \u0442\u0430\u043a: \"\u041f\u0440\u043e\u0439\u0434\u0435\u0442 \u0432\u043e\u0439\u043d\u0430, \u0438 \u0438\u043c\u044f \u0435\u0433\u043e \u0440\u0430\u0437\u043d\u0435\u0441\u0443\u0442 \u043f\u043e \u0432\u0441\u0435\u043c \u043a\u043e\u043d\u0446\u0430\u043c \u0420\u043e\u0441\u0441\u0438\u0438, \u043e\u043d\u043e \u0437\u0430\u0433\u043b\u044f\u043d\u0435\u0442 \u0442\u0443\u0434\u0430, \u043a\u0443\u0434\u0430 \u043d\u0435 \u0437\u0430\u0433\u043b\u044f\u0434\u044b\u0432\u0430\u043b\u0430 \u0435\u0449\u0435 \u043d\u0438 \u043e\u0434\u043d\u0430 \u0440\u0443\u0441\u0441\u043a\u0430\u044f \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u043e\u0441\u0442\u044c\".'), 881),
(3523, STRINGDECODE('\"\u041c\u0435\u0434\u0438\u0446\u0438\u043d\u0430 \u043d\u0435 \u043f\u0440\u043e\u0442\u044f\u0433\u0438\u0432\u0430\u0435\u0442 \u0440\u0443\u043a\u0438 \u0442\u043e\u043c\u0443, \u043a\u0442\u043e \u0443\u0436\u0435 \u043f\u043e\u0431\u0435\u0436\u0434\u0435\u043d \u0431\u043e\u043b\u0435\u0437\u043d\u044c\u044e\" - \u043a\u0430\u043a \u043d\u0438 \u0441\u0442\u0440\u0430\u043d\u043d\u043e, \u044d\u0442\u043e\u0442 \u0430\u0444\u043e\u0440\u0438\u0437\u043c \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \u0438\u043c\u0435\u043d\u043d\u043e \u0435\u043c\u0443.'), 881),
(3524, STRINGDECODE('\u0415\u0433\u043e \u043f\u0435\u0440\u0443 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \"\u0422\u0440\u0430\u043a\u0442\u0430\u0442 \u043e \u044f\u0434\u0430\u0445\" \u0438 \u043e\u0431\u0448\u0438\u0440\u043d\u044b\u0439 \u0442\u0440\u0443\u0434 \u043e\u0431 \u043e\u0433\u043d\u0435\u0441\u0442\u0440\u0435\u043b\u044c\u043d\u044b\u0445 \u0440\u0430\u043d\u0435\u043d\u0438\u044f\u0445. \u0415\u0433\u043e \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u043e\u0441\u0442\u044c \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u0431\u044b\u043b\u0430 \u0442\u0430\u043a \u0432\u0435\u043b\u0438\u043a\u0430, \u0447\u0442\u043e \u0432 \u0412\u0430\u0440\u0444\u043e\u043b\u043e\u043c\u0435\u0435\u0432\u0441\u043a\u0443\u044e \u043d\u043e\u0447\u044c \u041a\u0430\u0440\u043b IX \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u043b \u0435\u043c\u0443 \u0436\u0438\u0437\u043d\u044c, \u0445\u043e\u0442\u044c \u043e\u043d \u0438 \u0431\u044b\u043b \u0433\u0443\u0433\u0435\u043d\u043e\u0442\u043e\u043c.'), 881),
(3525, STRINGDECODE('\u0421\u0430\u043c\u0430\u044f \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430\u044f \u0440\u0430\u0431\u043e\u0442\u0430 \u043e\u0442\u0446\u0430 \u0438 \u0441\u044b\u043d\u0430 \u041c\u043e\u0442\u043e\u0440\u0438\u043d\u044b\u0445 \u0432\u043e\u0448\u043b\u0430 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u044e \u0438\u043c\u0435\u043d\u043d\u043e \u043f\u043e\u0434 \u044d\u0442\u0438\u043c \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c.'), 882);
