(3526, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043d\u0430\u0431\u043e\u0440 \u043a\u043e\u043b\u043e\u043a\u043e\u043b\u043e\u0432, \u0438\u0441\u043f\u043e\u043b\u043d\u044f\u044e\u0449\u0438\u0445 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043d\u0443\u044e \u043c\u0443\u0437\u044b\u043a\u0443.'), 882),
(3527, STRINGDECODE('\u0422\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u044b\u0439 \"\u043a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u043d\u044b\u0439 \u043c\u0435\u0442\u0430\u043b\u043b\" \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0441\u043e\u0431\u043e\u0439 \u0441\u043f\u043b\u0430\u0432, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u044d\u0442\u0438 \u0434\u0432\u0430 \u043a\u043e\u043c\u043f\u043e\u043d\u0435\u043d\u0442\u0430 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u043c\u0438.'), 882),
(3528, STRINGDECODE('\u041f\u0440\u043e\u0438\u0441\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u044d\u0442\u043e\u0433\u043e \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f - \u043f\u0435\u0440\u0435\u0434\u0435\u043b\u0430\u043d\u043d\u0430\u044f \u043d\u0430 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u043b\u0430\u0434 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \"ring the bell\".'), 882),
(3529, STRINGDECODE('\u0412 \u0441\u0440\u0435\u0434\u043d\u0438\u0435 \u0432\u0435\u043a\u0430 \u0432 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 \u0441\u0435\u043c\u0435\u043d\u0430 \u044d\u0442\u043e\u0433\u043e \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u044f \u043f\u0440\u0438\u043c\u0435\u043d\u044f\u043b\u0438 \u0434\u043b\u044f \u0443\u0441\u0438\u043b\u0435\u043d\u0438\u044f \u043e\u043f\u044c\u044f\u043d\u044f\u044e\u0449\u0435\u0433\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043d\u0430\u043f\u0438\u0442\u043a\u043e\u0432. \u041e\u043d\u043e \u0434\u0430\u043b\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043c\u043d\u043e\u0433\u0438\u043c \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u043c \u0433\u043e\u0440\u043e\u0434\u0430\u043c. \u041e\u0442\u0441\u044e\u0434\u0430 \u0436\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \"\u041f\u043b\u044c\u0437\u0435\u043d\u044c\u0441\u043a\u043e\u0435 \u043f\u0438\u0432\u043e\".'), 883),
(3530, STRINGDECODE('\u0418\u043c\u044f \u044d\u0442\u043e\u0433\u043e \u0430\u0440\u0442\u0438\u0441\u0442\u0430 \u0441\u0432\u044f\u0437\u0430\u043d\u043e \u0441 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u043c \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0441\u0435\u043c\u0435\u0439\u0441\u0442\u0432\u0430, \u0430 \u043e\u0442\u0447\u0435\u0441\u0442\u0432\u043e \u043d\u0430\u043f\u043e\u043c\u0438\u043d\u0430\u0435\u0442 \u043e \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u0438, \u043a \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0434\u0430\u043d\u043d\u043e\u0435 \u0441\u0435\u043c\u0435\u0439\u0441\u0442\u0432\u043e \u043f\u0438\u0442\u0430\u0435\u0442 \u0441\u043b\u0430\u0431\u043e\u0441\u0442\u044c.'), 883),
(3531, STRINGDECODE('\u041a\u0430\u043d\u0430\u0440\u0435\u0439\u043a\u0438, \u043f\u043e\u043a\u043b\u0435\u0432\u0430\u0432\u0448\u0438\u0435 \u0441\u0435\u043c\u0435\u043d\u0430 \u044d\u0442\u043e\u0433\u043e \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u044f, \u0437\u0430\u043b\u0438\u0432\u0430\u044e\u0442\u0441\u044f \u043d\u0430 \u0432\u0441\u0435 \u043b\u0430\u0434\u044b. \u041f\u0440\u0438\u0441\u0442\u0440\u0430\u0441\u0442\u0438\u0435 \u0436\u0438\u0442\u0435\u043b\u0435\u0439 \u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0430 \u043a \u043f\u0442\u0438\u0447\u044c\u0435\u043c\u0443 \u043f\u0435\u043d\u0438\u044e \u043f\u0440\u0438\u0432\u0435\u043b\u043e \u043a \u0442\u043e\u043c\u0443, \u0447\u0442\u043e \u043e\u0441\u0442\u0430\u0442\u043a\u0438 \u0441\u0435\u043c\u044f\u043d, \u043f\u043e\u043f\u0430\u0432\u0448\u0438\u0435 \u043d\u0430 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u0435 \u043b\u0443\u0436\u0430\u0439\u043a\u0438, \u0434\u0430\u043b\u0438 \u043e\u0431\u0438\u043b\u044c\u043d\u044b\u0435 \u0432\u0441\u0445\u043e\u0434\u044b. \u041f\u043e\u0438\u0441\u043a\u043e\u043c \u043f\u043e\u0434\u043e\u0431\u043d\u044b\u0445 \u043b\u0443\u0436\u0430\u0435\u043a \u0431\u044b\u043b\u0438 \u0437\u0430\u043d\u044f\u0442\u044b \u0438 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u043d\u044b\u0435 \u043b\u0438\u0446\u0430, \u0438 \u043b\u044e\u0431\u0438\u0442\u0435\u043b\u0438, \u043f\u0440\u0430\u0432\u0434\u0430, \u0441 \u0440\u0430\u0437\u043d\u044b\u043c\u0438 \u0446\u0435\u043b\u044f\u043c\u0438.'), 883);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(3532, STRINGDECODE('\u0421\u0430\u043c\u044b\u0439 \u043a\u0440\u0443\u043f\u043d\u044b\u0439 \u0438\u0437 \u043d\u0438\u0445 \u0431\u044b\u043b \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d \u0432 \u041c\u0430\u043d\u044c\u0447\u0436\u0443\u0440\u0438\u0438. \u041c\u0430\u0441\u0441\u0430 \u0435\u0433\u043e \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u043b\u0430 600 \u0433, \u0430 \u0432\u043e\u0437\u0440\u0430\u0441\u0442 \u043e\u043a\u043e\u043b\u043e 200 \u043b\u0435\u0442. \u041f\u0440\u043e\u0434\u0430\u043d \u043e\u043d \u0431\u044b\u043b \u0437\u0430 5000 \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432, \u0447\u0442\u043e, \u043f\u043e \u043c\u043d\u0435\u043d\u0438\u044e \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u043e\u0432, \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u043b\u043e \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0443 \u0435\u0433\u043e \u0441\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u0438.'), 883),
(3533, STRINGDECODE('\u041a\u043e\u0433\u0434\u0430-\u0442\u043e \u0443 \u0410\u043b\u043b\u044b \u0411\u043e\u0440\u0438\u0441\u043e\u0432\u043d\u044b \u0418\u0425 \u0431\u044b\u043b\u043e \u0442\u043e\u043b\u044c\u043a\u043e \u0442\u0440\u0438, \u0430 \u0432\u043e\u0442 \u0437\u043e\u043b\u043e\u0442\u043e\u0439 \u0440\u044b\u0431\u043a\u0438 \u043d\u0435 \u0431\u044b\u043b\u043e.'), 884),
(3534, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0430\u0432\u0442\u043e\u0440\u043e\u043c \u0441\u043a\u0430\u0437\u043a\u0438 \u043e \u0441\u0430\u043c\u043e\u0439 \u0441\u043a\u0440\u043e\u043c\u043d\u043e\u0439 \u0438\u0437 \u0437\u043e\u043b\u043e\u0442\u044b\u0445 \u0440\u044b\u0431\u043e\u043a, \u043f\u0440\u0430\u0432\u0434\u0430, \u0441 \u043d\u0435\u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u043d\u043e\u0439 \u0434\u043b\u044f \u0440\u044b\u0431 \u0436\u0438\u0437\u043d\u0435\u043d\u043d\u043e\u0439 \u043f\u043e\u0437\u0438\u0446\u0438\u0435\u0439.'), 884),
(3535, STRINGDECODE('\u0412 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043e \u043d\u0435\u043c, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u043f\u0440\u0438\u0434\u0443\u043c\u0430\u043b \u041c\u0438\u043b\u043e\u0448 \u041c\u0430\u0446\u043e\u0443\u0440\u0435\u043a, \u043e\u043d \u0442\u043e\u0436\u0435 \u0435\u0434\u0435\u0442 \u043a \u0431\u0430\u0431\u0443\u0448\u043a\u0435, \u043d\u043e \u0441\u043e\u0432\u0441\u0435\u043c \u043d\u0435 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u0443\u0435\u0442\u0441\u044f \u0437\u043e\u043b\u043e\u0442\u044b\u043c\u0438 \u0440\u044b\u0431\u043a\u0430\u043c\u0438.'), 884),
(3536, STRINGDECODE('\u0425\u0432\u043e\u0441\u0442 \u044d\u0442\u043e\u0439 \u0437\u043e\u043b\u043e\u0442\u043e\u0439 \u0440\u044b\u0431\u043a\u0438 \u0432 \u0442\u0440\u0438-\u0447\u0435\u0442\u044b\u0440\u0435 \u0440\u0430\u0437\u0430 \u0431\u043e\u043b\u044c\u0448\u0435 \u0435\u0435 \u0441\u0430\u043c\u043e\u0439, \u0447\u0435\u043c \u0438 \u043e\u0431\u044a\u044f\u0441\u043d\u044f\u0435\u0442\u0441\u044f \u0435\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435.'), 884),
(3537, STRINGDECODE('\u041e\u043d \u043c\u043e\u0433 \u043e\u0447\u0435\u043d\u044c \u043c\u043d\u043e\u0433\u043e\u0435, \u043d\u043e \u043d\u0435 \u0441\u043c\u043e\u0433 \u043f\u043e\u0447\u0438\u043d\u0438\u0442\u044c \u043a\u0443\u043a\u043b\u0443 \u043d\u0430\u0441\u043b\u0435\u0434\u043d\u0438\u043a\u0430.'), 885),
(3538, STRINGDECODE('\u0415\u0435 \u043c\u0435\u0442\u043e\u0434\u044b \u043b\u0435\u0447\u0435\u043d\u0438\u044f \u043c\u043e\u0436\u043d\u043e \u0440\u0430\u0441\u0441\u043c\u0430\u0442\u0440\u0438\u0432\u0430\u0442\u044c \u043a\u0430\u043a \u0430\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u044b\u0435 \u043c\u0435\u0442\u043e\u0434\u0430\u043c \u0434\u043e\u043a\u0442\u043e\u0440\u0430 \u041f\u0438\u043b\u044e\u043b\u044c\u043a\u0438\u043d\u0430.'), 885),
(3539, STRINGDECODE('\u0412\u044b\u0437\u0432\u0430\u043d\u043d\u044b\u0435 \u043a \u0411\u0443\u0440\u0430\u0442\u0438\u043d\u043e \u0421\u043e\u0432\u0430, \u0416\u0430\u0431\u0430 \u0438 \u0411\u043e\u0433\u043e\u043c\u043e\u043b \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u043b\u0438\u0441\u044c \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u0438\u043c\u0438 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0430\u043c\u0438.'), 885);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(3540, STRINGDECODE('\u041a\u043e\u0440\u043d\u0435\u0439 \u0427\u0443\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u043f\u0440\u0438\u0434\u0443\u043c\u0430\u043b \u0434\u043e\u043a\u0442\u043e\u0440\u0430 \u0410\u0439\u0431\u043e\u043b\u0438\u0442\u0430, \u0430 \u043e\u043d - \u0434\u043e\u043a\u0442\u043e\u0440\u0430 \u0414\u0443\u043b\u0438\u0442\u0442\u043b\u0430.'), 885),
(3541, STRINGDECODE('\u0412 \u044d\u0442\u043e\u043c \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u0441\u0442\u0430\u0440\u0438\u0447\u043a\u0443 \u0441\u0440\u0443\u0431\u0430\u044e\u0442 \u0433\u043e\u043b\u043e\u0432\u0443 \u0441\u0430\u0431\u043b\u0435\u0439, \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u044f, \u0447\u0442\u043e \u043e\u043d \u0443\u0431\u0438\u0439\u0446\u0430 \u0438 \u0437\u043b\u043e\u0434\u0435\u0439.'), 886),
(3542, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u043f\u0440\u044f\u0442\u0430\u043b \u0432\u043e\u043b\u0448\u0435\u0431\u043d\u044b\u0439 \u043c\u0435\u0447 \u043f\u043e\u0434 \u0433\u043e\u043b\u043e\u0432\u043e\u0439 \u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0431\u0440\u0430\u0442\u0430.'), 886),
(3543, STRINGDECODE('\u041e\u043d\u0430 \u0431\u044b\u043b\u0430 \u0441\u043c\u0435\u0440\u0442\u043d\u043e\u0439, \u0432 \u043e\u0442\u043b\u0438\u0447\u0438\u0435 \u043e\u0442 \u0441\u0432\u043e\u0438\u0445 \u0441\u0435\u0441\u0442\u0435\u0440 \u0421\u0444\u0435\u043d\u043e \u0438 \u042d\u0432\u0440\u0438\u0430\u043b\u044b.'), 886),
(3544, STRINGDECODE('\"\u042f \u043c\u044b\u0441\u043b\u044e. \u0421\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e, \u044f \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044e\" - \u0441 \u0433\u043e\u0440\u044c\u043a\u043e\u0439 \u0443\u043b\u044b\u0431\u043a\u043e\u0439 \u043b\u044e\u0431\u0438\u043b \u0446\u0438\u0442\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043e\u043d, \u0432\u0435\u0440\u043d\u0435\u0435 \u043e\u043d\u0430.'), 886),
(3545, STRINGDECODE('\u041c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u044b\u0439 \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u0439 \u0441\u043e\u0431\u043e\u0439 \u0434\u0432\u0430 \u0440\u044f\u0434\u0430 \u0445\u0440\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u044b\u0445 \u043c\u0435\u0442\u0430\u043b\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043f\u043b\u0430\u0441\u0442\u0438\u043d\u043e\u043a, \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a.'), 887),
(3546, STRINGDECODE('\u0422\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0441\u044f \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u044b\u0439 \u043a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u0447\u0438\u043a, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u043e\u0434\u0432\u0435\u0448\u0438\u0432\u0430\u043b\u0438 \u043d\u0430 \u0448\u0435\u044e \u043a\u043e\u0440\u043e\u0432\u0435.'), 887),
(3547, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0435 \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u0438\u0435, \u043f\u0440\u0438\u0431\u0438\u0442\u043e\u0435 \u043f\u043e\u0434 \u043a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u0447\u0438\u043a\u043e\u043c, \u043a\u0440\u0430\u0441\u043e\u0432\u0430\u043b\u0430\u0441\u044c \u043d\u0430 \u0434\u0432\u0435\u0440\u044f\u0445 \u0437\u0430\u043c\u043a\u0430 \"\u041a\u0430\u0448\u0442\u0430\u043d\u044b\".'), 887),
(3548, STRINGDECODE('\"\u041a\u0430\u0436\u0435\u0442\u0441\u044f, \u0431\u0443\u0434\u0442\u043e \u043a\u0442\u043e-\u0442\u043e \u0437\u0432\u043e\u043d\u0438\u0442 \u0432 \u043c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u0435 \u0437\u043e\u043b\u043e\u0442\u044b\u0435 \u043a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u0447\u0438\u043a\u0438, - \u0442\u0430\u043a \u043e\u043d\u0438 \u0433\u043e\u0432\u043e\u0440\u044f\u0442, \u044d\u0442\u043e \u0438\u0445 \u044f\u0437\u044b\u043a\" - \u043f\u0438\u0441\u0430\u043b \u043e\u0431 \u044d\u0442\u0438\u0445 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0430\u0445 \u0414\u0436\u0435\u0439\u043c\u0441 \u0411\u0430\u0440\u0440\u0438.'), 887);
