(3549, STRINGDECODE('\u041f\u0435\u0440\u0432\u044b\u0439 \u0438\u0437 \u043d\u0438\u0445 \u0431\u044b\u043b \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d \u041e. \u041f\u0438\u043a\u0430\u0440\u043e\u043c \u0432 1948 \u0433. \u0414\u043e \u0441\u0438\u0445 \u043f\u043e\u0440 \u043e\u043d\u0438 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043e\u043c \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u043e\u043c \u043f\u0440\u0435\u0434\u0435\u043b\u044c\u043d\u044b\u0445 \u0433\u043b\u0443\u0431\u0438\u043d \u043e\u043a\u0435\u0430\u043d\u0430.'), 888),
(3550, STRINGDECODE('\u0417\u0430\u0434\u043e\u043b\u0433\u043e \u0434\u043e \u0442\u043e\u0433\u043e, \u043a\u0430\u043a \u043f\u0435\u0440\u0432\u044b\u0435 \u0431\u0430\u0442\u0438\u0441\u043a\u0430\u0444\u044b \u043d\u0430\u0447\u0430\u043b\u0438 \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u0442\u044c \u0433\u043b\u0443\u0431\u043e\u043a\u043e\u0432\u043e\u0434\u043d\u044b\u0435 \u043f\u043e\u0433\u0440\u0443\u0436\u0435\u043d\u0438\u044f, \u0433\u0435\u0440\u043e\u0438 \u044d\u0442\u043e\u0439 \u043f\u043e\u0432\u0435\u0441\u0442\u0438 \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u043e\u043f\u0443\u0441\u043a\u0430\u044e\u0442\u0441\u044f \u043d\u0430 \u0434\u043d\u043e \u0410\u0442\u043b\u0430\u043d\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043e\u043a\u0435\u0430\u043d\u0430, \u043d\u043e \u0438 \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u044e\u0442 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435, \u0434\u043e\u0441\u0442\u043e\u0439\u043d\u043e\u0435 \u0428\u043b\u0438\u043c\u0430\u043d\u0430.'), 888),
(3551, STRINGDECODE('\u041f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430 \u0424\u0443\u043b\u0442\u043e\u043d\u0430, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u0430\u044f \u0432 1800 \u0433., \u0431\u044b\u043b\u0430 \u043f\u0435\u0440\u0432\u043e\u0439 \u043b\u043e\u0434\u043a\u043e\u0439, \u0438\u043c\u0435\u044e\u0449\u0435\u0439 \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u0435 \u0447\u0435\u0440\u0442\u044b \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0445. \u041a\u0440\u043e\u043c\u0435 \u0442\u043e\u0433\u043e, \u043e\u043d\u0430 \u0431\u044b\u043b\u0430 \u043f\u0435\u0440\u0432\u043e\u0439 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u0439 \u043b\u043e\u0434\u043a\u043e\u0439 \u0441 \u0442\u0430\u043a\u0438\u043c \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c. \u041f\u043e\u0437\u0434\u043d\u0435\u0435 \u0435\u0433\u043e \u0434\u0430\u0432\u0430\u043b\u0438 \u043c\u043d\u043e\u0433\u0438\u043c \u043a\u043e\u0440\u0430\u0431\u043b\u044f\u043c, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u0438 \u043f\u0435\u0440\u0432\u043e\u0439 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0430\u0442\u043e\u043c\u043d\u043e\u0439 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u0439 \u043b\u043e\u0434\u043a\u0435.'), 888),
(3552, STRINGDECODE('\u0423\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u043e, \u043f\u043e\u0434\u043e\u0431\u043d\u043e\u0435 \u044d\u0442\u043e\u043c\u0443, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0438 \u0435\u0449\u0435 \u0432\u043e\u0438\u043d\u044b \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041c\u0430\u043a\u0435\u0434\u043e\u043d\u0441\u043a\u043e\u0433\u043e. \u041f\u043e \u043e\u043f\u0438\u0441\u0430\u043d\u0438\u044e \u0410\u0440\u0438\u0441\u0442\u043e\u0442\u0435\u043b\u044f, \u043e\u043d\u043e \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u043b\u043e \u0441\u043e\u0431\u043e\u0439 \u043e\u043f\u0440\u043e\u043a\u0438\u043d\u0443\u0442\u044b\u0439 \u0441\u043e\u0441\u0443\u0434, \u043a\u0440\u0430\u044f \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0434\u043e\u043b\u0436\u043d\u044b \u0431\u044b\u043b\u0438 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u0432 \u0441\u0442\u0440\u043e\u0433\u043e \u0433\u043e\u0440\u0438\u0437\u043e\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u043c \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0438.'), 888);
