(3556, STRINGDECODE('\u0412\u043e \u0432\u0440\u0435\u043c\u044f \u0441\u0432\u043e\u0435\u0433\u043e \u043d\u0435\u0434\u043e\u043b\u0433\u043e\u0433\u043e \u043f\u0440\u0435\u0431\u044b\u0432\u0430\u043d\u0438\u044f \u0432 \u043f\u0438\u0440\u0430\u0442\u0430\u0445 \u043e\u043d \u043d\u043e\u0441\u0438\u043b \u043f\u0440\u043e\u0437\u0432\u0438\u0449\u0435 \"\u041a\u0440\u043e\u0432\u0430\u0432\u0430\u044f \u0440\u0443\u043a\u0430\".'), 889),
