(3559, STRINGDECODE('\u042d\u0442\u043e\u0442 \u0444\u0438\u043b\u044c\u043c \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0430 \u041f\u0430\u0432\u043b\u0430 \u0427\u0443\u0445\u0440\u0430\u044f \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0413\u043b\u0430\u0432\u043d\u044b\u0439 \u043f\u0440\u0438\u0437 \"\u0417\u043e\u043b\u043e\u0442\u0430\u044f \u0420\u043e\u0437\u0430\" XV \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044f \"\u041a\u0438\u043d\u043e\u0442\u0430\u0432\u0440\".'), 890),
