(3571, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u0438\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0432\u044b\u043f\u0443\u0441\u043a\u0430\u0435\u0442 \u0441\u0435\u0440\u0438\u0438 \"\u041c\u043e\u0439 XX \u0432\u0435\u043a\" \u0438 \"\u0421\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0430\u044f \u043f\u0440\u043e\u0437\u0430\", \u0430 \u0442\u0430\u043a\u0436\u0435 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u0441\u0435\u0440\u0438\u0438, \u043e\u0440\u0438\u0435\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u043d\u0430 \u043c\u043e\u043b\u043e\u0434\u043e\u0435 \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u0435, - \"\u0410\u0444\u0440\u043e\u0434\u0438\u0442\u0430\" \u0438 \"\u0428\u043a\u043e\u043b\u0430 \u0432 \u043b\u0430\u0441\u043a\u043e\u0432\u043e\u0439 \u0434\u043e\u043b\u0438\u043d\u0435\".'), 893),
