(3574, STRINGDECODE('\u0412\u0441\u0442\u0430\u0432\u044c\u0442\u0435 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043d\u043e\u0435 \u0441\u043b\u043e\u0432\u043e \u0432 \u0448\u0443\u0442\u043a\u0443 \u0416\u0432\u0430\u043d\u0435\u0446\u043a\u043e\u0433\u043e: \"- \u0421\u043a\u043e\u043b\u044c\u043a\u043e \u043b\u0435\u0442 \u0432\u0430\u0448\u0435\u043c\u0443 \u043c\u0435\u0440\u0437\u0430\u0432\u0446\u0443? - \u0427\u0435\u0442\u044b\u0440\u043d\u0430\u0434\u0446\u0430\u0442\u044c. - \u0414\u0430, (\u043f\u0440\u043e\u043f\u0443\u0441\u043a) \u0443\u0436\u0435 \u043f\u043e\u0437\u0434\u043d\u043e \u0434\u0435\u043b\u0430\u0442\u044c!\".'), 894),
