(3646, STRINGDECODE('\"\u041a\u0430\u043a \u043f\u043e\u0433\u043e\u0434\u0430? \u0417\u0434\u0435\u0441\u044c, \u0432 \u0425\u0430\u0440\u044c\u043a\u043e\u0432\u0435, \u0441\u043e\u0432\u0441\u0435\u043c \u043b\u0435\u0442\u043e. \u0413\u043e\u0440\u043e\u0434 \u0448\u0443\u043c\u043d\u044b\u0439 - \u0446\u0435\u043d\u0442\u0440 \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438. \u041f\u043e\u0441\u043b\u0435 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0438 \u043a\u0430\u0436\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u0437\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0443 \u043f\u043e\u043f\u0430\u043b...\".'), 912),
