(3649, STRINGDECODE('\"\u042f \u0443\u0442\u0440\u043e\u043c \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u0442\u044c \u0443\u0432\u0435\u0440\u0435\u043d, \u0447\u0442\u043e \u0441 \u0412\u0430\u043c\u0438 \u0434\u043d\u0435\u043c \u0443\u0432\u0438\u0436\u0443\u0441\u044c \u044f...\".'), 913),
(3650, STRINGDECODE('\"\u041b\u044e\u0431\u0438\u043c\u0430\u044f, \u043c\u0435\u043d\u044f \u0432\u044b \u043d\u0435 \u043b\u044e\u0431\u0438\u043b\u0438...\".'), 913),
