(3653, STRINGDECODE('\u042d\u0442\u0430 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u043f\u0435\u0432\u0438\u0446\u0430 \u0438\u0441\u043f\u043e\u043b\u043d\u044f\u0435\u0442 \u043f\u0435\u0441\u043d\u044e \"\u0421\u0442\u043e\u044f\u0442\u044c, \u0431\u043e\u044f\u0442\u044c\u0441\u044f\".'), 914),
(3654, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0443\u0440\u043e\u0436\u0435\u043d\u0446\u0430 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0430 \u043e\u0434\u043d\u0430\u0436\u0434\u044b \u043d\u0430\u0437\u0432\u0430\u043b\u0438 \"\u043c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u043c \u0435\u0432\u0440\u0435\u0435\u043c, \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0431\u043e\u044f\u043b\u0441\u044f \u0413\u0435\u0431\u0431\u0435\u043b\u044c\u0441\".'), 914),
(3655, STRINGDECODE('\u041c\u0438\u043d\u0438\u0441\u0442\u0440 \u044d\u0442\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u043a\u043e\u0433\u0434\u0430-\u0442\u043e \u0441\u043d\u044f\u043b\u0441\u044f \u0432 \u0444\u0438\u043b\u044c\u043c\u0435 \"\u041d\u0435 \u0431\u043e\u0439\u0441\u044f, \u044f \u0441 \u0442\u043e\u0431\u043e\u0439!\".'), 914),
(3656, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438 \u0442\u0440\u0438 \u0441\u043b\u043e\u0432\u0430 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u043e\u043c \u0443 \u0441\u0442\u0430\u0442\u044c\u0438, \u043f\u043e\u0434\u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043e\u043a \u043a\u043e\u0442\u043e\u0440\u043e\u0439 - \"\u0424\u0443\u043d\u043a\u0446\u0438\u0438 \u0440\u0430\u0437\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u044f \u043f\u0440\u0430\u0432 \u0434\u043e\u0441\u0442\u0443\u043f\u0430 \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u043d\u043e\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u0435 \u041a\u043e\u043c\u0422\u0435\u0445\".'), 914),
(3657, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0432\u043e \u0433\u043b\u0430\u0432\u043d\u043e\u0435 \u043e\u0442\u043b\u0438\u0447\u0438\u0435 \u043a\u043e\u0441\u0430\u0442\u043e\u043a-\u043c\u0435\u043b\u0430\u043d\u0438\u0441\u0442\u043e\u0432 \u043e\u0442 \u043e\u0431\u044b\u0447\u043d\u044b\u0445 \u043a\u043e\u0441\u0430\u0442\u043e\u043a.'), 915),
(3658, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0430\u043b\u044c\u0431\u043e\u043c, \u0432\u044b\u043f\u0443\u0449\u0435\u043d\u043d\u044b\u0439 \u0432 1994 \u0433. \u0433\u0440\u0443\u043f\u043f\u043e\u0439 \"\u0427\u0430\u0439-\u0424\".'), 915),
(3659, STRINGDECODE('\u0428\u0430\u0440 \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u0438\u0445 \u0446\u0432\u0435\u0442\u043e\u0432 \u043a\u0443\u043f\u0438\u043b\u0438 \u0432 \u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0438 \u041c\u0438\u0445\u0430\u043b\u043a\u043e\u0432\u0430 \"\u0410 \u0447\u0442\u043e \u0443 \u0432\u0430\u0441?\".'), 915),
(3660, STRINGDECODE('\u0418\u043c\u0435\u043d\u043e \u0432 \u044d\u0442\u043e\u043c \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u0444\u0438\u043b\u044c\u043c\u0435 \u0441 \u0443\u0447\u0430\u0441\u0442\u0438\u0435\u043c \u0428\u043e\u043d\u0430 \u041a\u043e\u043d\u043d\u0435\u0440\u0438 \u0437\u0432\u0443\u0447\u0438\u0442 \u043f\u0435\u0441\u043d\u044f: \"\u0412 \u043e\u043a\u0442\u044f\u0431\u0440\u0435, \u0432 \u043e\u043a\u0442\u044f\u0431\u0440\u0435 \u0420\u0430\u043f\u043e\u0440\u0442\u0443\u0435\u043c \u043c\u044b \u043d\u0430\u0448\u0438 \u043f\u043e\u0431\u0435\u0434\u044b. \u0412 \u043e\u043a\u0442\u044f\u0431\u0440\u0435, \u0432 \u043e\u043a\u0442\u044f\u0431\u0440\u0435 \u041d\u043e\u0432\u044b\u0439 \u043c\u0438\u0440 \u0434\u0430\u043b\u0438 \u043d\u0430\u043c \u043d\u0430\u0448\u0438 \u0434\u0435\u0434\u044b\".'), 915);
