(3763, STRINGDECODE('\u0422\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0435 \u041d. \u0417\u0430\u0431\u043e\u043b\u043e\u0446\u043a\u043e\u0433\u043e, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0430\u0432\u0442\u043e\u0440 \u0437\u0430\u0434\u0430\u0435\u0442\u0441\u044f \u0432\u043e\u043f\u0440\u043e\u0441\u043e\u043c, \"\u0447\u0442\u043e \u0435\u0441\u0442\u044c \u043a\u0440\u0430\u0441\u043e\u0442\u0430\": \"\u0441\u043e\u0441\u0443\u0434 \u043e\u043d\u0430, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0443\u0441\u0442\u043e\u0442\u0430, \u0438\u043b\u0438 \u043e\u0433\u043e\u043d\u044c, \u043c\u0435\u0440\u0446\u0430\u044e\u0449\u0438\u0439 \u0432 \u0441\u043e\u0441\u0443\u0434\u0435?\".'), 941),
