(3765, STRINGDECODE('\u0413\u0435\u0440\u043e\u0439 \u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u044f \u0410\u0433\u043d\u0438\u0438 \u0411\u0430\u0440\u0442\u043e \u043f\u0440\u0438\u0437\u043d\u0430\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u0438\u0437-\u0437\u0430 \u044d\u0442\u043e\u0439 \u0441\u0430\u043c\u043e\u0439 \u043f\u0442\u0438\u0446\u044b \u043e\u043d \u0440\u0435\u0432\u0435\u043b \u0447\u0435\u0442\u044b\u0440\u0435 \u0434\u043d\u044f.'), 942),
(3766, STRINGDECODE('\u0412 \u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0438 \u0421\u0430\u0448\u0438 \u0427\u0435\u0440\u043d\u043e\u0433\u043e \u043e\u0442\u0432\u0435\u0442 \u043d\u0430 \u044d\u0442\u043e\u0442 \u0432\u043e\u043f\u0440\u043e\u0441 \u0437\u0430\u043d\u0438\u043c\u0430\u0435\u0442 15 \u0441\u0442\u0440\u043e\u0447\u0435\u043a \u0438 \u0437\u0430\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441\u043b\u043e\u0432\u0430\u043c\u0438: \"\u0410 \u043f\u043e\u0442\u043e\u043c, \u0430 \u043f\u043e\u0442\u043e\u043c, \u0434\u0430\u043b \u043a\u043e\u0442\u0443 \u044f \u0432 \u0433\u043b\u0430\u0437 \u0445\u0432\u043e\u0441\u0442\u043e\u043c. \u041f\u043e\u0434\u043d\u044f\u043b \u043a\u0440\u044b\u043b\u044c\u044f, \u043a\u043b\u044e\u043d\u0443\u043b \u043f\u0441\u0430 \u0438 \u0443\u043c\u0447\u0430\u043b\u0441\u044f \u0432 \u043d\u0435\u0431\u0435\u0441\u0430\".'), 942),
(3767, STRINGDECODE('\u042d\u0442\u0430 \u043f\u0442\u0438\u0446\u0430 - \u0431\u043b\u0438\u0437\u043a\u0430\u044f \u0440\u043e\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u0446\u0430 \u0447\u0438\u0436\u0435\u0439. \u0414\u0430\u043d\u0438\u0438\u043b \u0425\u0430\u0440\u043c\u0441 \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u0435\u0442, \u0447\u0442\u043e \u0442\u0435\u0442\u043a\u0430.'), 942),
(3768, STRINGDECODE('\u0412 \u044d\u0442\u043e\u043c \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u0444\u0438\u043b\u044c\u043c\u0435 \u043e\u0434\u0438\u043d \u0438\u0437 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0435\u0439 \u0432\u0440\u0435\u043c\u044f \u043e\u0442 \u0432\u0440\u0435\u043c\u0435\u043d\u0438 \u043f\u0440\u043e\u0438\u0437\u043d\u043e\u0441\u0438\u0442 \u0444\u0440\u0430\u0437\u044b, \u0432 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0443\u043f\u043e\u043c\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u043d\u0435\u043a\u043e\u0435 \u0441\u043b\u043e\u0432\u043e. \u0418 \u0445\u043e\u0442\u044f \u0437\u0434\u0435\u0441\u044c \u043e\u043d\u043e \u0438\u043c\u0435\u0435\u0442 \u0434\u0440\u0443\u0433\u043e\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435, \u043d\u043e \u043c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c \u0438 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \u043f\u0442\u0438\u0446\u044b, \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u044f\u0449\u0438\u043c, \u0432 \u0441\u0432\u043e\u044e \u043e\u0447\u0435\u0440\u0435\u0434\u044c, \u043e\u0442 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u044f \u043a\u043e\u0440\u043c\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043e\u043d\u0430 \u043f\u0440\u0435\u0434\u043f\u043e\u0447\u0438\u0442\u0430\u0435\u0442 \u0432\u0441\u0435\u043c \u043e\u0441\u0442\u0430\u043b\u044c\u043d\u044b\u043c.'), 942);
