(3769, STRINGDECODE('\u041f\u0435\u0440\u0432\u043e\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u044d\u0442\u043e\u0433\u043e \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044f, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u043e\u044f\u0432\u0438\u043b\u0441\u044f \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436, \u043f\u0440\u0438\u043d\u0435\u0441\u0448\u0438\u0439 \u0430\u0432\u0442\u043e\u0440\u0443 \u0432\u0441\u0435\u043c\u0438\u0440\u043d\u0443\u044e \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0441\u0442\u044c, \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \"\u041f\u0438\u0442\u0435\u0440-\u043b\u0430\u0442\u044b\u0448\".'), 943),
(3770, STRINGDECODE('\u041f\u043e \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443 \u0434\u0440\u0443\u0437\u0435\u0439 \u041f\u0443\u0448\u043a\u0438\u043d\u0430, \u043d\u0438 \u043e\u0434\u043d\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u043d\u0435 \u0437\u043d\u0430\u0447\u0438\u043b\u043e \u043b\u0438\u0447\u043d\u043e \u0434\u043b\u044f \u043d\u0435\u0433\u043e \u0442\u0430\u043a \u043c\u043d\u043e\u0433\u043e, \u043a\u0430\u043a \u044d\u0442\u043e. \u0412 \u0442\u043e \u0436\u0435 \u0432\u0440\u0435\u043c\u044f \u0441\u0440\u0435\u0434\u0438 \u043e\u0442\u0437\u044b\u0432\u043e\u0432 \u043f\u0440\u0435\u043e\u0431\u043b\u0430\u0434\u0430\u043b\u0438 \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435: \"\u0413\u0430\u043b\u0438\u043c\u0430\u0442\u044c\u044f \u0432 \u0428\u0435\u043a\u0441\u043f\u0438\u0440\u043e\u0432\u0441\u043a\u043e\u043c \u0440\u043e\u0434\u0435\" \u0438\u043b\u0438 \"\u041d\u0443 \u0447\u0442\u043e \u044d\u0442\u043e \u0437\u0430 \u0441\u043e\u0447\u0438\u043d\u0435\u043d\u0438\u0435?! \u0418\u043d\u0434\u0435 \u043f\u0440\u043e\u0437\u043e\u044e, \u0438\u043d\u0434\u0435 \u0441\u0442\u0438\u0445\u0430\u043c\u0438, \u0438\u043d\u0434\u0435 \u043f\u043e-\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438, \u0438\u043d\u0434\u0435 \u043f\u043e-\u043b\u0430\u0442\u0438\u043d\u0435 \u0434\u0430 \u0435\u0449\u0435 \u0431\u0435\u0437 \u0440\u0438\u0444\u043c\u044b\".'), 943),
(3771, STRINGDECODE('\u042d\u0442\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0412\u043e\u043b\u044c\u0442\u0435\u0440 \u0437\u0430\u0434\u0443\u043c\u0430\u043b \u043a\u0430\u043a \u043f\u0430\u0440\u043e\u0434\u0438\u044e \u043d\u0430 \u043f\u043e\u044d\u043c\u0443 \u0441\u0432\u043e\u0435\u0433\u043e \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0438\u043a\u0430 \u0416\u0430\u043d\u0430 \u0428\u0430\u043f\u043b\u0435\u043d\u0430, \u043d\u043e \u0432 \u0445\u043e\u0434\u0435 \u0440\u0430\u0431\u043e\u0442\u044b \u0438\u0437\u043c\u0435\u043d\u0438\u043b \u043f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u044b\u0439 \u0437\u0430\u043c\u044b\u0441\u0435\u043b. \u041e\u0431\u0449\u0435\u043f\u0440\u0438\u0437\u043d\u0430\u043d\u043d\u043e, \u0447\u0442\u043e \u0438\u0437 \u0432\u0441\u0435\u0445 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u0412\u043e\u043b\u044c\u0442\u0435\u0440\u0430 \u044d\u0442\u043e - \u0441\u0430\u043c\u0430\u044f \u043e\u0441\u0442\u0440\u0430\u044f \u0441\u0430\u0442\u0438\u0440\u0430 \u043d\u0430 \u0446\u0435\u0440\u043a\u043e\u0432\u044c.'), 943),
(3772, STRINGDECODE('\u0422\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0433\u043b\u0430\u0432\u043d\u044b\u0439 \u0442\u0440\u0443\u0434 \u0432\u0441\u0435\u0439 \u0436\u0438\u0437\u043d\u0438 \u0440\u0438\u043c\u0441\u043a\u043e\u0433\u043e \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u0430 \u0422\u0430\u0446\u0438\u0442\u0430.'), 943),
(3773, STRINGDECODE('\u041e\u043d \u0431\u044b\u043b \u0438\u0437\u0431\u0440\u0430\u043d \u041a\u043e\u0440\u043e\u043b\u0435\u043c \u043f\u043e\u044d\u0442\u043e\u0432, \u0434\u0430 \u0438 \u0441\u0430\u043c \u043d\u0430\u0437\u044b\u0432\u0430\u043b \u0441\u0435\u0431\u044f \u0433\u0435\u043d\u0438\u0435\u043c.'), 944);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(3774, STRINGDECODE('\u042d\u0442\u043e\u0442 \u043f\u043e\u044d\u0442 \u0432 \u043a\u043e\u043d\u0446\u0435 \u0441\u0432\u043e\u0435\u0439 \u0436\u0438\u0437\u043d\u0438 \u043e\u0442\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u043e\u0442 \u043f\u043e\u0435\u0437\u0434\u043a\u0438 \u0432 \u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434, \u0441\u043a\u0430\u0437\u0430\u0432: \"\u041c\u044b \u0437\u043d\u0430\u0435\u043c, \u0447\u0442\u043e \u0434\u0432\u0430\u0436\u0434\u044b \u0432 \u0442\u0443 \u0436\u0435 \u0441\u0430\u043c\u0443\u044e \u0440\u0435\u043a\u0443 \u0432\u0441\u0442\u0443\u043f\u0438\u0442\u044c \u043d\u0435\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e, \u0434\u0430\u0436\u0435 \u0435\u0441\u043b\u0438 \u044d\u0442\u0430 \u0440\u0435\u043a\u0430 - \u041d\u0435\u0432\u0430\".'), 944),
(3775, STRINGDECODE('\u041f\u0435\u0440\u0443 \u044d\u0442\u043e\u0433\u043e \u043f\u043e\u044d\u0442\u0430 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \"\u0410\u0432\u0442\u043e\u043f\u043e\u0440\u0442\u0440\u0435\u0442\": \"\u0412 \u043f\u043e\u0434\u043d\u044f\u0442\u044c\u0438 \u0433\u043e\u043b\u043e\u0432\u044b \u043a\u0440\u044b\u043b\u0430\u0442\u044b\u0439 \u041d\u0430\u043c\u0435\u043a - \u043d\u043e \u043c\u0435\u0448\u043a\u043e\u0432\u0430\u0442 \u0441\u044e\u0440\u0442\u0443\u043a; \u0412 \u0437\u0430\u043a\u0440\u044b\u0442\u044c\u0438 \u0433\u043b\u0430\u0437, \u0432 \u043f\u043e\u043a\u043e\u0435 \u0440\u0443\u043a - \u0422\u0430\u0439\u043d\u0438\u043a \u0434\u0432\u0438\u0436\u0435\u043d\u044c\u044f \u043d\u0435\u043f\u043e\u0447\u0430\u0442\u044b\u0439; \u0422\u0430\u043a \u0432\u043e\u0442 \u043a\u043e\u043c\u0443 \u043b\u0435\u0442\u0430\u0442\u044c \u0438 \u043f\u0435\u0442\u044c \u0418 \u0441\u043b\u043e\u0432\u0430 \u043f\u043b\u0430\u043c\u0435\u043d\u043d\u0430\u044f \u043a\u043e\u0432\u043a\u043e\u0441\u0442\u044c - \u0427\u0442\u043e\u0431 \u043f\u0440\u0438\u0440\u043e\u0436\u0434\u0435\u043d\u043d\u0443\u044e \u043d\u0435\u043b\u043e\u0432\u043a\u043e\u0441\u0442\u044c \u0412\u0440\u043e\u0436\u0434\u0435\u043d\u043d\u044b\u043c \u0440\u0438\u0442\u043c\u043e\u043c \u043e\u0434\u043e\u043b\u0435\u0442\u044c!\".'), 944),
(3776, STRINGDECODE('\u041f\u0443\u0448\u043a\u0438\u043d \u043f\u0438\u0441\u0430\u043b \u043e \u043d\u0435\u043c \u0442\u0430\u043a: \"\u041e\u043d \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \u043a \u0447\u0438\u0441\u043b\u0443 \u043e\u0442\u043b\u0438\u0447\u043d\u044b\u0445 \u043d\u0430\u0448\u0438\u0445 \u043f\u043e\u044d\u0442\u043e\u0432. \u041e\u043d \u0443 \u043d\u0430\u0441 \u043e\u0440\u0438\u0433\u0438\u043d\u0430\u043b\u0435\u043d - \u0438\u0431\u043e \u043c\u044b\u0441\u043b\u0438\u0442\". \"\u0421\u0442\u0440\u043e\u0433\u0438\u043c \u0438 \u0441\u0443\u043c\u0440\u0430\u0447\u043d\u044b\u043c \u043f\u043e\u044d\u0442\u043e\u043c\" \u043d\u0430\u0437\u0432\u0430\u043b \u0435\u0433\u043e \u0413\u043e\u0433\u043e\u043b\u044c. \u041e\u043d \u0443\u043c\u0435\u0440 \u0447\u0435\u0440\u0435\u0437 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0434\u043d\u0435\u0439 \u043f\u043e\u0441\u043b\u0435 \u0442\u043e\u0433\u043e, \u043a\u0430\u043a \u043d\u0430\u043f\u0438\u0441\u0430\u043b \u0434\u0440\u0443\u0437\u044c\u044f\u043c \u0432 \u0420\u043e\u0441\u0441\u0438\u044e: \"\u041c\u044b \u0432\u0435\u0434\u0435\u043c \u0432 \u041d\u0435\u0430\u043f\u043e\u043b\u0435 \u0441\u0430\u043c\u0443\u044e \u0441\u043b\u0430\u0434\u043a\u0443\u044e \u0436\u0438\u0437\u043d\u044c\". \u0411\u044b\u043b\u043e \u0435\u043c\u0443 44 \u0433\u043e\u0434\u0430.'), 944),
(3777, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0435\u0433\u043e \u0412\u0438\u043a\u0442\u043e\u0440 \u0410\u0441\u0442\u0430\u0444\u044c\u0435\u0432 \u0441\u043f\u0440\u0430\u0432\u0435\u0434\u043b\u0438\u0432\u043e \u043d\u0430\u0437\u0432\u0430\u043b \u0426\u0430\u0440\u044c-\u0440\u044b\u0431\u043e\u0439, \u0443\u0432\u0438\u0434\u0435\u0432 \u0447\u0442\u043e-\u0442\u043e \u043f\u0435\u0440\u0432\u043e\u0431\u044b\u0442\u043d\u043e\u0435 \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0432 \u0435\u0433\u043e \u0440\u0430\u0437\u043c\u0435\u0440\u0430\u0445, \u043d\u043e \u0438 \u0432 \u0444\u043e\u0440\u043c\u0430\u0445 \u0442\u0435\u043b\u0430.'), 945);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(3778, STRINGDECODE('\u042d\u0442\u043e\u0442 \u0426\u0430\u0440\u044c \u043f\u0440\u043e\u043b\u0435\u0436\u0430\u043b \u0432 \u0437\u0435\u043c\u043b\u0435 \u0431\u0435\u0437 \u043c\u0430\u043b\u043e\u0433\u043e 100 \u043b\u0435\u0442. \u0418\u0437\u0432\u043b\u0435\u0447\u044c \u0435\u0433\u043e \u043d\u0430 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u044c \u043f\u043e\u0440\u0443\u0447\u0438\u043b\u0438 \u0410\u0432\u0433\u0443\u0441\u0442\u0443 \u041c\u043e\u043d\u0444\u0435\u0440\u0440\u0430\u043d\u0443. \u041f\u043e\u0434\u044a\u0435\u043c, \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u043f\u0440\u0435\u0434\u0448\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u0438 \u0434\u043e\u043b\u0433\u0438\u0435 \u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0440\u0430\u0431\u043e\u0442\u044b, \u0437\u0430\u043d\u044f\u043b 42 \u043c\u0438\u043d\u0443\u0442\u044b \u0438 33 \u0441\u0435\u043a\u0443\u043d\u0434\u044b.'), 945),
(3779, STRINGDECODE('\u0426\u0430\u0440\u044c-\u043f\u0443\u0448\u043a\u0430 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0430\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0439\u0441\u043a\u0438\u043c \u043e\u0440\u0443\u0434\u0438\u0435\u043c \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0442\u0438\u043f\u0430.'), 945),
(3780, STRINGDECODE('\u041c\u043e\u0436\u043d\u043e \u0441\u043a\u0430\u0437\u0430\u0442\u044c, \u0447\u0442\u043e \u044d\u0442\u043e\u0442 \u0426\u0430\u0440\u044c - \u043c\u043b\u0430\u0434\u0448\u0438\u0439 \u0431\u0440\u0430\u0442 \u0426\u0430\u0440\u044c-\u043f\u0443\u0448\u043a\u0438. \u0412\u0435\u0434\u044c \u044d\u0442\u043e \u043f\u0443\u0448\u043a\u0430, \u043e\u0442\u043b\u0438\u0442\u0430\u044f \u0442\u0435\u043c \u0436\u0435 \u043c\u0430\u0441\u0442\u0435\u0440\u043e\u043c \u0410\u043d\u0434\u0440\u0435\u0435\u043c \u0427\u043e\u0445\u043e\u0432\u044b\u043c, \u0442\u043e\u043b\u044c\u043a\u043e \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043f\u043e\u0437\u0434\u043d\u0435\u0435, \u0438 \u043d\u0435\u043c\u043d\u043e\u0433\u043e \u0443\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0435\u0439 \u043f\u043e \u0440\u0430\u0437\u043c\u0435\u0440\u0443 \u0438 \u0432\u0435\u0441\u0443. \u041d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043e\u043d \u0432 \u0430\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0439\u0441\u043a\u043e\u043c \u043c\u0443\u0437\u0435\u0435 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430.'), 945),
(3781, STRINGDECODE('\u0415\u0433\u043e \u043a\u043e\u0436\u0443 \u043d\u0430 \u0441\u043f\u0438\u043d\u0435 \u0443\u043a\u0440\u0430\u0448\u0430\u043b \u043a\u0440\u0430\u0441\u0438\u0432\u044b\u0439 \u043f\u0435\u0441\u0442\u0440\u044b\u0439 \u0443\u0437\u043e\u0440, \u043a\u043e\u0440\u0438\u0447\u043d\u0435\u0432\u044b\u0439 \u0438 \u0436\u0435\u043b\u0442\u044b\u0439. \u0418 \u043d\u0430\u0437\u044b\u0432\u0430\u0442\u044c \u0435\u0433\u043e \u0436\u0435\u043b\u0442\u044b\u043c \u0437\u0435\u043c\u043b\u044f\u043d\u044b\u043c \u0447\u0435\u0440\u0432\u044f\u043a\u043e\u043c \u0431\u044b\u043b\u043e \u043e\u0447\u0435\u043d\u044c \u0440\u0438\u0441\u043a\u043e\u0432\u0430\u043d\u043d\u043e.'), 946),
(3782, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043c \u0440\u0430\u0437\u0432\u043e\u0440\u0430\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 \u043f\u0435\u0441\u043d\u0438 \u0412. \u0412\u044b\u0441\u043e\u0446\u043a\u043e\u0433\u043e \u043e \u0436\u0438\u0440\u0430\u0444\u0435.'), 946),
(3783, STRINGDECODE('\u041a\u0440\u0443\u0448\u0438\u043d\u043d\u0438\u0446\u0430 - \u044d\u0442\u043e \u0431\u0435\u043b\u044f\u043d\u043a\u0430, \u043d\u043e \u0436\u0435\u043b\u0442\u0430\u044f, \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u0443 \u043d\u0435\u0435 \u0435\u0441\u0442\u044c \u0435\u0449\u0435 \u0438 \u0442\u0430\u043a\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435.'), 946);
