(3784, STRINGDECODE('\u0421\u0432\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u044d\u0442\u043e\u0442 \u043e\u0431\u044a\u0435\u043a\u0442 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u044f \u043e\u0442\u043a\u043b\u0430\u0434\u044b\u0432\u0430\u044e\u0449\u0435\u043c\u0443\u0441\u044f \u0432\u043e\u043a\u0440\u0443\u0433 \u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a\u043e\u0432 \u0438 \u0433\u0435\u0439\u0437\u0435\u0440\u043e\u0432 \u043d\u0430 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u0438 \u0437\u0435\u043c\u043b\u0438 \u0441\u043b\u043e\u044e \u0433\u0435\u0439\u0437\u0435\u0440\u0438\u0442\u0430.'), 946),
(3785, STRINGDECODE('\u041d\u0430 \u043e\u0434\u043d\u043e\u0439 \u043a\u0430\u0440\u0438\u043a\u0430\u0442\u0443\u0440\u0435 \u044d\u0442\u043e\u0442 \u0441\u0442\u0440\u0435\u043b\u043e\u043a \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d \u0434\u0435\u043b\u0430\u044e\u0449\u0438\u043c \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u044b\u0439 \u0432\u044b\u0441\u0442\u0440\u0435\u043b \u0432 \u0433\u043e\u043b\u043e\u0432\u0443, \u0445\u043e\u0442\u044f \u0438 \u043f\u0440\u0435\u0434\u044b\u0434\u0443\u0449\u0438\u0439 \u0434\u043e\u0441\u0442\u0438\u0433 \u0446\u0435\u043b\u0438.'), 947),
(3786, STRINGDECODE('\u041d\u0430 \u0437\u0432\u0435\u0437\u0434\u043d\u043e\u0439 \u043a\u0430\u0440\u0442\u0435 \u042e\u0436\u043d\u043e\u0433\u043e \u043f\u043e\u043b\u0443\u0448\u0430\u0440\u0438\u044f \u0421\u0442\u0440\u0435\u043b\u0430 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043c\u0435\u0436\u0434\u0443 \u044d\u0442\u0438\u043c\u0438 \u0437\u043e\u0434\u0438\u0430\u043a\u0430\u043b\u044c\u043d\u044b\u043c\u0438 \u0441\u043e\u0437\u0432\u0435\u0437\u0434\u0438\u044f\u043c\u0438, \u043d\u0430\u0447\u0438\u043d\u0430\u044e\u0449\u0438\u043c\u0438\u0441\u044f \u043d\u0430 \u043e\u0434\u043d\u0443 \u0431\u0443\u043a\u0432\u0443.'), 947),
(3787, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0434\u043b\u044f \u044d\u0442\u043e\u0433\u043e \u0444\u0438\u043b\u044c\u043c\u0430 \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0430 \u0412. \u0422\u0430\u0440\u0430\u0441\u043e\u0432\u0430 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u044b\u0441\u043e\u0446\u043a\u0438\u0439 \u043d\u0430\u043f\u0438\u0441\u0430\u043b \u0446\u0438\u043a\u043b \u0431\u0430\u043b\u043b\u0430\u0434.'), 947),
(3788, STRINGDECODE('\u0412 \u0441\u0442\u0430\u0440\u0438\u043d\u0443 \u0441\u0442\u0440\u0435\u043b\u044b \u0441 \u0442\u0443\u043f\u044b\u043c\u0438 \u043a\u043e\u0441\u0442\u044f\u043d\u044b\u043c\u0438 \u0438\u043b\u0438 \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u044b\u043c\u0438 \u043d\u0430\u043a\u043e\u043d\u0435\u0447\u043d\u0438\u043a\u0430\u043c\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0438, \u043a\u043e\u0433\u0434\u0430 \u043e\u0445\u043e\u0442\u0438\u043b\u0438\u0441\u044c \u043d\u0430 \u0442\u0430\u043a\u043e\u0433\u043e \u0437\u0432\u0435\u0440\u044f.'), 947),
(3789, STRINGDECODE('\u042d\u0442\u043e\u0442 \u043b\u0430\u0443\u0440\u0435\u0430\u0442 \u041d\u043e\u0431\u0435\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u043f\u0440\u0435\u043c\u0438\u0438 \u0432 \u043a\u043d\u0438\u0433\u0435 \"\u041e\u0442 \u043c\u043e\u0440\u044f \u0434\u043e \u043c\u043e\u0440\u044f\" \u0432\u0441\u043f\u043e\u043c\u0438\u043d\u0430\u0435\u0442: \"\u041d\u0430 \u043c\u0435\u043d\u044f \u043d\u0430\u043f\u0430\u043b\u043e \u043a\u0440\u044b\u043b\u0430\u0442\u043e\u0435 \u0447\u0443\u0434\u043e\u0432\u0438\u0449\u0435 \u043e\u0434\u0438\u043d\u0430\u043a\u043e\u0432\u043e\u0439 \u0441\u043e \u043c\u043d\u043e\u0439 \u0432\u0435\u043b\u0438\u0447\u0438\u043d\u044b, \u044f \u0443\u0431\u0435\u0436\u0430\u043b \u0438 \u0440\u0430\u0441\u043f\u043b\u0430\u043a\u0430\u043b\u0441\u044f. \u041e\u0442\u0435\u0446 \u043d\u0430\u0440\u0438\u0441\u043e\u0432\u0430\u043b \u0434\u043b\u044f \u043c\u0435\u043d\u044f \u043a\u0430\u0440\u0442\u0438\u043d\u0443 \u044d\u0442\u043e\u0439 \u0442\u0440\u0430\u0433\u0435\u0434\u0438\u0438 \u0438 \u0432\u043d\u0438\u0437\u0443 \u043d\u0430\u043f\u0438\u0441\u0430\u043b: \"\u041c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u0439 \u043c\u0430\u043b\u044c\u0447\u0438\u043a, \u0436\u0438\u0432\u0443\u0449\u0438\u0439 \u0432 \u0411\u043e\u043c\u0431\u0435\u0435, \u041c\u0447\u0430\u043b\u0441\u044f \u043e\u0442 \u043a\u0443\u0440\u0438\u0446\u044b \u0432\u0435\u0442\u0440\u0430 \u0431\u044b\u0441\u0442\u0440\u0435\u0435. \u0423\u0441\u043b\u044b\u0445\u0430\u0432: \"\u0422\u044b \u0447\u0443\u0434\u0430\u043a\", \u041e\u043d \u043e\u0442\u0432\u0435\u0442\u0438\u043b: \"\u041f\u0443\u0441\u0442\u044c \u0442\u0430\u043a, \u041d\u043e \u0442\u0435\u0440\u043f\u0435\u0442\u044c \u043d\u0435 \u043c\u043e\u0433\u0443 \u043a\u0443\u0440 \u0432 \u0411\u043e\u043c\u0431\u0435\u0435\".'), 948);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(3790, STRINGDECODE('\u0423 \u044d\u0442\u043e\u0433\u043e \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044f-\u0441\u043a\u0430\u0437\u043e\u0447\u043d\u0438\u043a\u0430 \u043e\u0442\u0435\u0446 \u0431\u044b\u043b \u0431\u0430\u0448\u043c\u0430\u0447\u043d\u0438\u043a\u043e\u043c.'), 948),
(3791, STRINGDECODE('\u0415\u0433\u043e \u043c\u0430\u0442\u044c \u0440\u0430\u0431\u043e\u0442\u0430\u043b\u0430 \u0432 \u0430\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u043c\u0443\u0437\u0435\u0435. \u0418 \u043e\u043d, \u0432 \u043e\u0442\u043b\u0438\u0447\u0438\u0435 \u043e\u0442 \u0441\u0432\u043e\u0438\u0445 \u0441\u0432\u0435\u0440\u0441\u0442\u043d\u0438\u043a\u043e\u0432, \u0447\u0438\u0442\u0430\u043b \u043d\u0435 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u044b\u0435 \u043d\u043e\u0440\u0432\u0435\u0436\u0441\u043a\u0438\u0435 \u0441\u043a\u0430\u0437\u043a\u0438, \u0430 \u043a\u043d\u0438\u0433\u0438 \u043f\u043e \u0430\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u0438. \u0410 \u0435\u0449\u0435 \u043e\u043d \u0441\u0442\u0440\u0430\u0448\u043d\u043e \u0431\u043e\u044f\u043b\u0441\u044f \u0432\u043e\u0434\u044b, \u043f\u043e\u0442\u043e\u043c\u0443 \u0447\u0442\u043e \u0434\u0432\u0430\u0436\u0434\u044b \u0447\u0443\u0442\u044c \u043d\u0435 \u0443\u0442\u043e\u043d\u0443\u043b.'), 948),
(3792, STRINGDECODE('\u0415\u0433\u043e \u043c\u0430\u0442\u044c \u0442\u0435\u0440\u043f\u0435\u0442\u044c \u043d\u0435 \u043c\u043e\u0433\u043b\u0430 \u043b\u0435\u0442\u0443\u0447\u0438\u0445 \u043c\u044b\u0448\u0435\u0439. \u041d\u0430\u0432\u0435\u0440\u043d\u043e\u0435, \u043f\u043e\u0442\u043e\u043c\u0443, \u0447\u0442\u043e \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0430 \u0438\u0445 \u0443 \u0441\u044b\u043d\u0430 \u0432 \u043a\u0430\u0440\u043c\u0430\u043d\u0430\u0445. \u0410 \u0435\u043c\u0443, \u043d\u0430\u043f\u0440\u043e\u0442\u0438\u0432, \u043a\u0430\u0437\u0430\u043b\u043e\u0441\u044c, \u0447\u0442\u043e \u043d\u0435\u0442 \u043d\u0438\u0447\u0435\u0433\u043e \u043c\u0438\u043b\u0435\u0435 \u043b\u0435\u0442\u0443\u0447\u0438\u0445 \u043c\u044b\u0448\u0435\u0439, \u0438 \u043e\u043d \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e \u043e\u0442\u043f\u0440\u0430\u0432\u043b\u044f\u043b\u0441\u044f \u0437\u0430 \u043d\u0438\u043c\u0438 \u0432 \u0431\u043e\u043b\u044c\u0448\u0443\u044e \u043f\u0435\u0449\u0435\u0440\u0443, \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0438\u0439 \u043b\u0430\u0431\u0438\u0440\u0438\u043d\u0442, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043d\u0438\u0447\u0435\u0433\u043e \u043d\u0435 \u0441\u0442\u043e\u0438\u043b\u043e \u0437\u0430\u0431\u043b\u0443\u0434\u0438\u0442\u044c\u0441\u044f.'), 948),
(3793, STRINGDECODE('\"\u042d\u043a\u0438\u043f\u0430\u0436 \u0441\u0430\u043c\u043e\u043b\u0435\u0442\u0430 \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u0435\u0442 \u0440\u0435\u0439\u0441 \u043f\u043e \u0434\u043e\u0441\u0442\u0430\u0432\u043a\u0435 \u043f\u0440\u043e\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0438\u044f \u0438 \u043c\u0435\u0434\u0438\u043a\u0430\u043c\u0435\u043d\u0442\u043e\u0432 \u0434\u043b\u044f \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f, \u043f\u043e\u0441\u0442\u0440\u0430\u0434\u0430\u0432\u0448\u0435\u0433\u043e \u043e\u0442 \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u044f. \u041f\u043e\u0434\u0437\u0435\u043c\u043d\u044b\u0439 \u0442\u043e\u043b\u0447\u043e\u043a \u043f\u0440\u0438\u0432\u043e\u0434\u0438\u0442 \u043a \u043f\u043e\u0432\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044e \u0432\u0437\u043b\u0435\u0442\u043d\u043e\u0439 \u043f\u043e\u043b\u043e\u0441\u044b\".'), 949),
(3794, STRINGDECODE('\"\u041b\u0438\u043a\u0432\u0438\u0434\u0438\u0440\u0443\u044f \u043d\u0435\u0438\u0441\u043f\u0440\u0430\u0432\u043d\u043e\u0441\u0442\u044c \u043b\u0435\u0441\u0442\u043d\u0438\u0446\u044b, \u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u041a\u0443\u0437\u044f\u043a\u0438\u043d \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0442\u0440\u0430\u0432\u043c\u0443 \u0438 \u043f\u0443\u0442\u0435\u0432\u043a\u0443 \u043d\u0430 \u044e\u0433. \u0422\u0430\u043c \u043e\u043d \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u043b \u0440\u043e\u043a\u043e\u0432\u0443\u044e \u0436\u0435\u043d\u0449\u0438\u043d\u0443, \u0432\u043b\u044e\u0431\u0438\u043b\u0441\u044f, \u0432\u044b\u043b\u0435\u0447\u0438\u043b\u0441\u044f \u0438 \u043d\u0435 \u0441\u0440\u0430\u0437\u0443 \u0432\u0435\u0440\u043d\u0443\u043b\u0441\u044f \u0432 \u0434\u043e\u043c, \u0433\u0434\u0435 \u0435\u0433\u043e \u0436\u0434\u0430\u043b\u0438 \u0436\u0435\u043d\u0430, \u0434\u0435\u0442\u0438 \u0438 \u0433\u043e\u043b\u0443\u0431\u0438\".'), 949);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(3795, STRINGDECODE('\"\u0418\u0441\u0442\u043e\u0440\u0438\u044f \u043e \u043b\u044e\u0431\u0432\u0438 \u041c\u0430\u0440\u0442\u044b \u0438 \u0410\u0440\u0442\u0443\u0440\u0430, \u043d\u0430 \u0434\u043e\u043b\u044e \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0432\u044b\u043f\u0430\u043b\u0438 \u0441\u0443\u0440\u043e\u0432\u044b\u0435 \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u044f. \u0418\u043c \u0441\u0443\u0436\u0434\u0435\u043d\u043e \u0431\u044b\u043b\u043e \u043f\u0435\u0440\u0435\u0436\u0438\u0442\u044c \u043e\u0431\u043c\u0430\u043d, \u043f\u0440\u0435\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e, \u0434\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u0443\u044e \u0440\u0430\u0437\u043b\u0443\u043a\u0443, \u0432\u043e\u0439\u043d\u0443 \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u0430\u0442\u0430\u043a\u043b\u0438\u0437\u043c\u044b, \u043d\u043e \u043e\u043d\u0438 \u0441\u0443\u043c\u0435\u043b\u0438 \u0441\u0431\u0435\u0440\u0435\u0447\u044c \u0438 \u043f\u0440\u043e\u043d\u0435\u0441\u0442\u0438 \u0447\u0435\u0440\u0435\u0437 \u0432\u0441\u044e \u0436\u0438\u0437\u043d\u044c \u043f\u0440\u0435\u043a\u0440\u0430\u0441\u043d\u043e\u0435 \u0433\u043b\u0443\u0431\u043e\u043a\u043e\u0435 \u0447\u0443\u0432\u0441\u0442\u0432\u043e\".'), 949),
(3796, STRINGDECODE('\"\u041c\u043e\u043b\u043e\u0434\u0435\u043d\u044c\u043a\u043e\u0439 \u043a\u043e\u043c\u0441\u043e\u043c\u043e\u043b\u043a\u0435 \u041d\u0430\u0434\u0435 \u0411\u0435\u0440\u0435\u0441\u0442\u043e\u0432\u043e\u0439 \u043f\u043e\u0440\u0443\u0447\u0430\u044e\u0442 \u0448\u0435\u0444\u0441\u0442\u0432\u043e \u043d\u0430\u0434 \u0441\u043d\u0438\u0441\u043a\u0430\u0432\u0448\u0438\u043c\u0438 \u043f\u0435\u0447\u0430\u043b\u044c\u043d\u0443\u044e \u0441\u043b\u0430\u0432\u0443 \u043d\u0435\u0440\u0430\u0437\u043b\u0443\u0447\u043d\u044b\u043c\u0438 \u0434\u0440\u0443\u0436\u043a\u0430\u043c\u0438 \u0413\u0440\u0430\u0447\u043a\u0438\u043d\u044b\u043c \u0438 \u0413\u0440\u043e\u043c\u043e\u0431\u043e\u0435\u0432\u044b\u043c\".'), 949),
