(3928, STRINGDECODE('\u0415\u0441\u043b\u0438 \u043e\u043d \u0431\u043e\u043b\u044c\u0448\u043e\u0439 - \u0442\u043e \u043c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c \u043e\u043f\u043e\u0440\u043e\u0439 \u0438\u043b\u0438 \u043a\u0440\u0443\u043f\u043d\u044b\u043c \u043f\u0430\u0440\u043d\u043e\u043a\u043e\u043f\u044b\u0442\u043d\u044b\u043c, \u0435\u0441\u043b\u0438 \u043c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u0439 - \u043f\u0440\u043e\u0441\u0442\u043e \u043c\u0443\u0441\u043e\u0440\u043e\u043c, \u043e\u0441\u0442\u0430\u0442\u043a\u043e\u043c \u0438\u043b\u0438 \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0440\u044b\u0431\u043e\u0439.'), 982),
(3929, STRINGDECODE('\u041e\u0442\u0440\u044f\u0434\u0443 \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0433\u043e \u0446\u0432\u0435\u0442\u0430 \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0410. \u041a\u043e\u043d\u0430\u043d \u0414\u043e\u0439\u043b\u044f.'), 983),
(3930, STRINGDECODE('\u0414\u0440\u0435\u0432\u043d\u0435\u0440\u0438\u043c\u0441\u043a\u0438\u0435 \u0441\u0435\u043d\u0430\u0442\u043e\u0440\u044b \u0438\u043c\u0435\u043b\u0438 \u043f\u0440\u0430\u0432\u043e \u043d\u043e\u0441\u0438\u0442\u044c \u0431\u0430\u0448\u043c\u0430\u043a\u0438 \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0433\u043e \u0446\u0432\u0435\u0442\u0430.'), 983),
(3931, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0435 \u043f\u0440\u043e\u0437\u0432\u0438\u0449\u0435 \u0438\u043c\u0435\u0435\u0442 \u041c\u0438\u0445\u0430\u044d\u043b\u044c \u0428\u0443\u043c\u0430\u0445\u0435\u0440.'), 983),
(3932, STRINGDECODE('\u0424\u0430\u043c\u0438\u043b\u0438\u044f \u044d\u0442\u043e\u0433\u043e \u0431\u0430\u043a\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u0430 \u0442\u043e\u0436\u0435 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0434\u0430\u043d\u043d\u043e\u0439 \u0442\u0435\u043c\u0435.'), 983),
(3933, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u043e\u043c \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u0441\u0442\u0430\u0440\u0438\u0447\u043a\u0443 \u0441\u0440\u0443\u0431\u0430\u044e\u0442 \u0433\u043e\u043b\u043e\u0432\u0443 \u0441\u0430\u0431\u043b\u0435\u0439, \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u044f, \u0447\u0442\u043e \u043e\u043d - \u0443\u0431\u0438\u0439\u0446\u0430 \u0438 \u0437\u043b\u043e\u0434\u0435\u0439.'), 984);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(3934, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u043f\u0440\u044f\u0442\u0430\u043b \u0432\u043e\u043b\u0448\u0435\u0431\u043d\u044b\u0439 \u043c\u0435\u0447 \u043f\u043e\u0434 \u0433\u043e\u043b\u043e\u0432\u043e\u0439 \u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0431\u0440\u0430\u0442\u0430.'), 984),
(3935, STRINGDECODE('\u041e\u043d\u0430 \u0431\u044b\u043b\u0430 \u0441\u043c\u0435\u0440\u0442\u043d\u043e\u0439, \u0432 \u043e\u0442\u043b\u0438\u0447\u0438\u0435 \u043e\u0442 \u0441\u0432\u043e\u0438\u0445 \u0441\u0435\u0441\u0442\u0435\u0440 \u0421\u0444\u0435\u043d\u043e \u0438 \u042d\u0432\u0440\u0438\u0430\u043b\u044b.'), 984),
(3936, STRINGDECODE('\"\u042f \u043c\u044b\u0441\u043b\u044e. \u0421\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e, \u044f \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044e\" - \u0441 \u0433\u043e\u0440\u044c\u043a\u043e\u0439 \u0443\u043b\u044b\u0431\u043a\u043e\u0439 \u043b\u044e\u0431\u0438\u043b \u0446\u0438\u0442\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043e\u043d, \u0432\u0435\u0440\u043d\u0435\u0435 \u043e\u043d\u0430.'), 984),
(3937, STRINGDECODE('\u042d\u0442\u0438 \u0441\u0432\u044f\u0442\u044b\u0435 \u0441\u0447\u0438\u0442\u0430\u043b\u0438\u0441\u044c \u043f\u043e\u043a\u0440\u043e\u0432\u0438\u0442\u0435\u043b\u044f\u043c\u0438 \u0432\u0440\u0430\u0447\u0435\u0439, \u0444\u0430\u0440\u043c\u0430\u0446\u0435\u0432\u0442\u043e\u0432 \u0438 \u043a\u0443\u0437\u043d\u0435\u0446\u043e\u0432. \u0410\u0442\u0440\u0438\u0431\u0443\u0442\u0430\u043c\u0438, \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u044e\u0449\u0438\u043c\u0438 \u043d\u0430 \u0438\u0445 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u044c \u043a \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0435, \u044f\u0432\u043b\u044f\u043b\u0438\u0441\u044c \u0432\u0440\u0430\u0447\u0435\u0431\u043d\u044b\u0439 \u044f\u0449\u0438\u0447\u0435\u043a \u0443 \u043e\u0434\u043d\u043e\u0433\u043e \u0438 \u043f\u0442\u0438\u0447\u044c\u0435 \u043f\u0435\u0440\u043e \u0432 \u0440\u0443\u043a\u0435 \u0443 \u0434\u0440\u0443\u0433\u043e\u0433\u043e.'), 985),
(3938, STRINGDECODE('\u0412\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0430 \u041a\u0440\u044b\u043c\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u041d.\u0410. \u041d\u0435\u043a\u0440\u0430\u0441\u043e\u0432 \u043f\u0438\u0441\u0430\u043b \u043e \u043d\u0435\u043c \u0442\u0430\u043a: \"\u041f\u0440\u043e\u0439\u0434\u0435\u0442 \u0432\u043e\u0439\u043d\u0430, \u0438 \u0438\u043c\u044f \u0435\u0433\u043e \u0440\u0430\u0437\u043d\u0435\u0441\u0443\u0442 \u043f\u043e \u0432\u0441\u0435\u043c \u043a\u043e\u043d\u0446\u0430\u043c \u0420\u043e\u0441\u0441\u0438\u0438, \u043e\u043d\u043e \u0437\u0430\u0433\u043b\u044f\u043d\u0435\u0442 \u0442\u0443\u0434\u0430, \u043a\u0443\u0434\u0430 \u043d\u0435 \u0437\u0430\u0433\u043b\u044f\u0434\u044b\u0432\u0430\u043b\u0430 \u0435\u0449\u0435 \u043d\u0438 \u043e\u0434\u043d\u0430 \u0440\u0443\u0441\u0441\u043a\u0430\u044f \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u043e\u0441\u0442\u044c\".'), 985),
(3939, STRINGDECODE('\"\u041c\u0435\u0434\u0438\u0446\u0438\u043d\u0430 \u043d\u0435 \u043f\u0440\u043e\u0442\u044f\u0433\u0438\u0432\u0430\u0435\u0442 \u0440\u0443\u043a\u0438 \u0442\u043e\u043c\u0443, \u043a\u0442\u043e \u0443\u0436\u0435 \u043f\u043e\u0431\u0435\u0436\u0434\u0435\u043d \u0431\u043e\u043b\u0435\u0437\u043d\u044c\u044e\" - \u043a\u0430\u043a \u043d\u0438 \u0441\u0442\u0440\u0430\u043d\u043d\u043e, \u044d\u0442\u043e\u0442 \u0430\u0444\u043e\u0440\u0438\u0437\u043c \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \u0438\u043c\u0435\u043d\u043d\u043e \u0435\u043c\u0443.'), 985),
(3940, STRINGDECODE('\u0415\u0433\u043e \u043f\u0435\u0440\u0443 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \"\u0422\u0440\u0430\u043a\u0442\u0430\u0442 \u043e \u044f\u0434\u0430\u0445\" \u0438 \u043e\u0431\u0448\u0438\u0440\u043d\u044b\u0439 \u0442\u0440\u0443\u0434 \u043e\u0431 \u043e\u0433\u043d\u0435\u0441\u0442\u0440\u0435\u043b\u044c\u043d\u044b\u0445 \u0440\u0430\u043d\u0435\u043d\u0438\u044f\u0445. \u0415\u0433\u043e \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u043e\u0441\u0442\u044c \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u0431\u044b\u043b\u0430 \u0442\u0430\u043a \u0432\u0435\u043b\u0438\u043a\u0430, \u0447\u0442\u043e \u0432 \u0412\u0430\u0440\u0444\u043e\u043b\u043e\u043c\u0435\u0435\u0432\u0441\u043a\u0443\u044e \u043d\u043e\u0447\u044c \u041a\u0430\u0440\u043b IX \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u043b \u0435\u043c\u0443 \u0436\u0438\u0437\u043d\u044c, \u0445\u043e\u0442\u044c \u043e\u043d \u0438 \u0431\u044b\u043b \u0433\u0443\u0433\u0435\u043d\u043e\u0442\u043e\u043c.'), 985);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(3941, STRINGDECODE('\u0412 \u0441\u0440\u0435\u0434\u043d\u0438\u0435 \u0432\u0435\u043a\u0430 \u0432 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 \u0441\u0435\u043c\u0435\u043d\u0430 \u044d\u0442\u043e\u0433\u043e \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u044f \u043f\u0440\u0438\u043c\u0435\u043d\u044f\u043b\u0438 \u0434\u043b\u044f \u0443\u0441\u0438\u043b\u0435\u043d\u0438\u044f \u043e\u043f\u044c\u044f\u043d\u044f\u044e\u0449\u0435\u0433\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043d\u0430\u043f\u0438\u0442\u043a\u043e\u0432. \u041e\u043d\u043e \u0434\u0430\u043b\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043c\u043d\u043e\u0433\u0438\u043c \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u043c \u0433\u043e\u0440\u043e\u0434\u0430\u043c. \u041e\u0442\u0441\u044e\u0434\u0430 \u0436\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \"\u041f\u043b\u044c\u0437\u0435\u043d\u044c\u0441\u043a\u043e\u0435 \u043f\u0438\u0432\u043e\".'), 986),
(3942, STRINGDECODE('\u0418\u043c\u044f \u044d\u0442\u043e\u0433\u043e \u0430\u0440\u0442\u0438\u0441\u0442\u0430 \u0441\u0432\u044f\u0437\u0430\u043d\u043e \u0441 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u043c \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0441\u0435\u043c\u0435\u0439\u0441\u0442\u0432\u0430, \u0430 \u043e\u0442\u0447\u0435\u0441\u0442\u0432\u043e \u043d\u0430\u043f\u043e\u043c\u0438\u043d\u0430\u0435\u0442 \u043e \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u0438, \u043a \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0434\u0430\u043d\u043d\u043e\u0435 \u0441\u0435\u043c\u0435\u0439\u0441\u0442\u0432\u043e \u043f\u0438\u0442\u0430\u0435\u0442 \u0441\u043b\u0430\u0431\u043e\u0441\u0442\u044c.'), 986),
(3943, STRINGDECODE('\u041a\u0430\u043d\u0430\u0440\u0435\u0439\u043a\u0438, \u043f\u043e\u043a\u043b\u0435\u0432\u0430\u0432\u0448\u0438\u0435 \u0441\u0435\u043c\u0435\u043d\u0430 \u044d\u0442\u043e\u0433\u043e \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u044f, \u0437\u0430\u043b\u0438\u0432\u0430\u044e\u0442\u0441\u044f \u043d\u0430 \u0432\u0441\u0435 \u043b\u0430\u0434\u044b. \u041f\u0440\u0438\u0441\u0442\u0440\u0430\u0441\u0442\u0438\u0435 \u0436\u0438\u0442\u0435\u043b\u0435\u0439 \u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0430 \u043a \u043f\u0442\u0438\u0447\u044c\u0435\u043c\u0443 \u043f\u0435\u043d\u0438\u044e \u043f\u0440\u0438\u0432\u0435\u043b\u043e \u043a \u0442\u043e\u043c\u0443, \u0447\u0442\u043e \u043e\u0441\u0442\u0430\u0442\u043a\u0438 \u0441\u0435\u043c\u044f\u043d, \u043f\u043e\u043f\u0430\u0432\u0448\u0438\u0435 \u043d\u0430 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u0435 \u043b\u0443\u0436\u0430\u0439\u043a\u0438, \u0434\u0430\u043b\u0438 \u043e\u0431\u0438\u043b\u044c\u043d\u044b\u0435 \u0432\u0441\u0445\u043e\u0434\u044b. \u041f\u043e\u0438\u0441\u043a\u043e\u043c \u043f\u043e\u0434\u043e\u0431\u043d\u044b\u0445 \u043b\u0443\u0436\u0430\u0435\u043a \u0431\u044b\u043b\u0438 \u0437\u0430\u043d\u044f\u0442\u044b \u0438 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u043d\u044b\u0435 \u043b\u0438\u0446\u0430, \u0438 \u043b\u044e\u0431\u0438\u0442\u0435\u043b\u0438, \u043f\u0440\u0430\u0432\u0434\u0430, \u0441 \u0440\u0430\u0437\u043d\u044b\u043c\u0438 \u0446\u0435\u043b\u044f\u043c\u0438.'), 986),
(3944, STRINGDECODE('\u0421\u0430\u043c\u044b\u0439 \u043a\u0440\u0443\u043f\u043d\u044b\u0439 \u0438\u0437 \u043d\u0438\u0445 \u0431\u044b\u043b \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d \u0432 \u041c\u0430\u043d\u044c\u0447\u0436\u0443\u0440\u0438\u0438. \u041c\u0430\u0441\u0441\u0430 \u0435\u0433\u043e \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u043b\u0430 600 \u0433, \u0430 \u0432\u043e\u0437\u0440\u0430\u0441\u0442 \u043e\u043a\u043e\u043b\u043e 200 \u043b\u0435\u0442. \u041f\u0440\u043e\u0434\u0430\u043d \u043e\u043d \u0431\u044b\u043b \u0437\u0430 5000 \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432, \u0447\u0442\u043e, \u043f\u043e \u043c\u043d\u0435\u043d\u0438\u044e \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u043e\u0432, \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u043b\u043e \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0443 \u0435\u0433\u043e \u0441\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u0438.'), 986);
