(3945, STRINGDECODE('\u041a\u043e\u0433\u0434\u0430-\u0442\u043e \u0443 \u0410\u043b\u043b\u044b \u0411\u043e\u0440\u0438\u0441\u043e\u0432\u043d\u044b \u0418\u0425 \u0431\u044b\u043b\u043e \u0442\u043e\u043b\u044c\u043a\u043e \u0442\u0440\u0438, \u0430 \u0432\u043e\u0442 \u0437\u043e\u043b\u043e\u0442\u043e\u0439 \u0440\u044b\u0431\u043a\u0438 \u043d\u0435 \u0431\u044b\u043b\u043e.'), 987),
(3946, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0430\u0432\u0442\u043e\u0440\u043e\u043c \u0441\u043a\u0430\u0437\u043a\u0438 \u043e \u0441\u0430\u043c\u043e\u0439 \u0441\u043a\u0440\u043e\u043c\u043d\u043e\u0439 \u0438\u0437 \u0437\u043e\u043b\u043e\u0442\u044b\u0445 \u0440\u044b\u0431\u043e\u043a, \u043f\u0440\u0430\u0432\u0434\u0430, \u0441 \u043d\u0435\u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u043d\u043e\u0439 \u0434\u043b\u044f \u0440\u044b\u0431 \u0436\u0438\u0437\u043d\u0435\u043d\u043d\u043e\u0439 \u043f\u043e\u0437\u0438\u0446\u0438\u0435\u0439.'), 987),
(3947, STRINGDECODE('\u0412 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043e \u043d\u0435\u043c, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u043f\u0440\u0438\u0434\u0443\u043c\u0430\u043b \u041c\u0438\u043b\u043e\u0448 \u041c\u0430\u0446\u043e\u0443\u0440\u0435\u043a, \u043e\u043d \u0442\u043e\u0436\u0435 \u0435\u0434\u0435\u0442 \u043a \u0431\u0430\u0431\u0443\u0448\u043a\u0435, \u043d\u043e \u0441\u043e\u0432\u0441\u0435\u043c \u043d\u0435 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u0443\u0435\u0442\u0441\u044f \u0437\u043e\u043b\u043e\u0442\u044b\u043c\u0438 \u0440\u044b\u0431\u043a\u0430\u043c\u0438.'), 987),
(3948, STRINGDECODE('\u0425\u0432\u043e\u0441\u0442 \u044d\u0442\u043e\u0439 \u0437\u043e\u043b\u043e\u0442\u043e\u0439 \u0440\u044b\u0431\u043a\u0438 \u0432 \u0442\u0440\u0438-\u0447\u0435\u0442\u044b\u0440\u0435 \u0440\u0430\u0437\u0430 \u0431\u043e\u043b\u044c\u0448\u0435 \u0435\u0435 \u0441\u0430\u043c\u043e\u0439, \u0447\u0435\u043c \u0438 \u043e\u0431\u044a\u044f\u0441\u043d\u044f\u0435\u0442\u0441\u044f \u0435\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435.'), 987),
(3949, STRINGDECODE('\u0421\u0430\u043c\u0430\u044f \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430\u044f \u0440\u0430\u0431\u043e\u0442\u0430 \u043e\u0442\u0446\u0430 \u0438 \u0441\u044b\u043d\u0430 \u041c\u043e\u0442\u043e\u0440\u0438\u043d\u044b\u0445 \u0432\u043e\u0448\u043b\u0430 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u044e \u0438\u043c\u0435\u043d\u043d\u043e \u043f\u043e\u0434 \u044d\u0442\u0438\u043c \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c.'), 988),
(3950, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043d\u0430\u0431\u043e\u0440 \u043a\u043e\u043b\u043e\u043a\u043e\u043b\u043e\u0432, \u0438\u0441\u043f\u043e\u043b\u043d\u044f\u044e\u0449\u0438\u0445 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043d\u0443\u044e \u043c\u0443\u0437\u044b\u043a\u0443.'), 988),
(3951, STRINGDECODE('\u0422\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u044b\u0439 \"\u043a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u043d\u044b\u0439 \u043c\u0435\u0442\u0430\u043b\u043b\" \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0441\u043e\u0431\u043e\u0439 \u0441\u043f\u043b\u0430\u0432, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u044d\u0442\u0438 \u0434\u0432\u0430 \u043a\u043e\u043c\u043f\u043e\u043d\u0435\u043d\u0442\u0430 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u043c\u0438.'), 988),
(3952, STRINGDECODE('\u041f\u0440\u043e\u0438\u0441\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u044d\u0442\u043e\u0433\u043e \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f - \u043f\u0435\u0440\u0435\u0434\u0435\u043b\u0430\u043d\u043d\u0430\u044f \u043d\u0430 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u043b\u0430\u0434 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \"ring the bell\".'), 988);
