(4006, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d\u0430 \u043e\u0437\u0432\u0443\u0447\u0438\u0432\u0430\u043b\u0430 \u0417\u0430\u0439\u0446\u0430 \u0432 \u043c\u0443\u043b\u044c\u0442\u0441\u0435\u0440\u0438\u0430\u043b\u0435 \"\u041d\u0443, \u043f\u043e\u0433\u043e\u0434\u0438!\".'), 1002),
(4007, STRINGDECODE('\u041f\u0435\u0440\u0443 \u044d\u0442\u043e\u0433\u043e \u043e\u0441\u043d\u043e\u0432\u043e\u043f\u043e\u043b\u043e\u0436\u043d\u0438\u043a\u0430 \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u0433\u043e \u0432\u043e\u0437\u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0430\u0442 \u0430\u043a\u0432\u0430\u0440\u0435\u043b\u0438 \"\u041a\u0443\u0441\u043e\u043a \u0434\u0435\u0440\u043d\u0430\" \u0438 \"\u0417\u0430\u044f\u0446\".'), 1002),
(4008, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0433\u043e \u0437\u0430\u0439\u0446\u0430 \u0432\u044b\u043d\u0435\u0441 \u0432 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0441\u0432\u043e\u0435\u0433\u043e \u0440\u043e\u043c\u0430\u043d\u0430 \u0414\u0443\u043c\u0438\u0442\u0440\u0443 \u0420\u0430\u0434\u0443 \u041f\u043e\u043f\u0435\u0441\u043a\u0443, \u0430 \u0443 \u0410\u043b\u0435\u043a\u0441\u0435\u044f \u0422\u043e\u043b\u0441\u0442\u043e\u0433\u043e \u044d\u0442\u043e\u0439 \u0436\u0435 \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e\u0441\u0442\u044c\u044e \u043e\u0431\u043b\u0430\u0434\u0430\u043b \u0432\u044b\u043d\u0435\u0441\u0435\u043d\u043d\u044b\u0439 \u0438\u043c \u0432 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0440\u043e\u043c\u0430\u043d\u0430 \u0431\u0430\u0440\u0438\u043d.'), 1002),
(4009, STRINGDECODE('\u041d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u043c\u043b\u0435\u043a\u043e\u043f\u0438\u0442\u0430\u044e\u0449\u0435\u0433\u043e \u0441\u0435\u043c\u0435\u0439\u0441\u0442\u0432\u0430 \u043a\u0443\u043d\u044c\u0438\u0445 \u043d\u0435\u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u043e \u0441 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \u0442\u0435\u043c\u044b.'), 1003),
(4010, STRINGDECODE('\u0423 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0430 \u0410\u0430\u0440\u043e\u043d\u0430 \u041a\u043e\u043f\u043b\u0435\u043d\u0434\u0430 \u043e\u043d\u0430 \u043b\u0430\u0441\u043a\u043e\u0432\u0430\u044f, \u0430 \u0443 \u041b\u0435\u043e\u043d\u0438\u0434\u0430 \u0411\u0440\u0435\u0436\u043d\u0435\u0432\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u0430\u044f.'), 1003);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(4011, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u0438\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0432\u044b\u043f\u0443\u0441\u043a\u0430\u0435\u0442 \u0441\u0435\u0440\u0438\u0438 \"\u041c\u043e\u0439 XX \u0432\u0435\u043a\" \u0438 \"\u0421\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0430\u044f \u043f\u0440\u043e\u0437\u0430\", \u0430 \u0442\u0430\u043a\u0436\u0435 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u0441\u0435\u0440\u0438\u0438, \u043e\u0440\u0438\u0435\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u043d\u0430 \u043c\u043e\u043b\u043e\u0434\u043e\u0435 \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u0435 - \"\u0410\u0444\u0440\u043e\u0434\u0438\u0442\u0430\" \u0438 \"\u0428\u043a\u043e\u043b\u0430 \u0432 \u043b\u0430\u0441\u043a\u043e\u0432\u043e\u0439 \u0434\u043e\u043b\u0438\u043d\u0435\".'), 1003),
(4012, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u043e\u043c \u0444\u0438\u043b\u044c\u043c\u0430 \"\u041c\u043e\u0439 \u043b\u0430\u0441\u043a\u043e\u0432\u044b\u0439 \u0438 \u043d\u0435\u0436\u043d\u044b\u0439 \u0437\u0432\u0435\u0440\u044c\".'), 1003),
(4013, STRINGDECODE('\u0417\u0430\u043a\u043e\u043d\u0447\u0438\u0442\u0435 \u0430\u0444\u043e\u0440\u0438\u0437\u043c, \u043f\u0440\u0438\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0439 \u0441\u0430\u0439\u0442\u043e\u043c \"\u0410\u043d\u0435\u043a\u0434\u043e\u0442.\u0440\u0443\" \u0414\u043e\u043d\u0443 \u041c\u0435\u0440\u0437\u0430\u0432\u0446\u0443: \"\u041b\u0443\u0447\u0448\u0435 \u043f\u043e\u0434\u043b\u043e, \u0447\u0435\u043c...\".'), 1004),
(4014, STRINGDECODE('\u0412\u0441\u0442\u0430\u0432\u044c\u0442\u0435 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043d\u043e\u0435 \u0441\u043b\u043e\u0432\u043e \u0432 \u0448\u0443\u0442\u043a\u0443 \u0416\u0432\u0430\u043d\u0435\u0446\u043a\u043e\u0433\u043e: \"- \u0421\u043a\u043e\u043b\u044c\u043a\u043e \u043b\u0435\u0442 \u0432\u0430\u0448\u0435\u043c\u0443 \u043c\u0435\u0440\u0437\u0430\u0432\u0446\u0443? - \u0427\u0435\u0442\u044b\u0440\u043d\u0430\u0434\u0446\u0430\u0442\u044c. - \u0414\u0430 (\u043f\u0440\u043e\u043f\u0443\u0441\u043a) \u0443\u0436\u0435 \u043f\u043e\u0437\u0434\u043d\u043e \u0434\u0435\u043b\u0430\u0442\u044c!\".'), 1004),
(4015, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0432 \u0435\u0433\u043e \u043f\u0438\u0441\u044c\u043c\u0435, \u0434\u0430\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u043c 1936 \u0433. \u0438 \u0430\u0434\u0440\u0435\u0441\u043e\u0432\u0430\u043d\u043d\u043e\u043c \u0447\u043b\u0435\u043d\u0430\u043c \u041f\u043e\u043b\u0438\u0442\u0431\u044e\u0440\u043e, \u0444\u0438\u0433\u0443\u0440\u0438\u0440\u0443\u0435\u0442 \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0430\u044f \u0417\u0438\u043d\u043e\u0432\u044c\u0435\u0432\u0443 \u0438 \u041a\u0430\u043c\u0435\u043d\u0435\u0432\u0443 \u0444\u0440\u0430\u0437\u0430: \"\u0447\u0442\u043e \u043c\u0435\u0440\u0437\u0430\u0432\u0446\u0435\u0432 \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u044f\u043b\u0438 - \u043e\u0442\u043b\u0438\u0447\u043d\u043e, \u0432\u043e\u0437\u0434\u0443\u0445 \u0441\u0440\u0430\u0437\u0443 \u043e\u0447\u0438\u0441\u0442\u0438\u043b\u0441\u044f\".'), 1004),
(4016, STRINGDECODE('\u0422\u0430\u043a\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043d\u043e\u0441\u0438\u0442 \u043c\u0435\u0441\u0442\u043e, \u0441 \u0441\u043e\u0431\u044b\u0442\u0438\u044f\u043c\u0438 \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0441\u0432\u044f\u0437\u0430\u043d\u043e \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0435 \u0437\u0430\u044f\u0432\u043b\u0435\u043d\u0438\u0435 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u043e\u0442 15 \u0430\u043f\u0440\u0435\u043b\u044f 1943 \u0433.: \"\u0412 \u0441\u0432\u043e\u0438\u0445 \u0447\u0443\u0434\u043e\u0432\u0438\u0449\u043d\u044b\u0445 \u0438\u0437\u043c\u044b\u0448\u043b\u0435\u043d\u0438\u044f\u0445 \u043d\u0435\u043c\u0435\u0446\u043a\u043e-\u0444\u0430\u0448\u0438\u0441\u0442\u0441\u043a\u0438\u0435 \u043c\u0435\u0440\u0437\u0430\u0432\u0446\u044b \u043d\u0435 \u0433\u043d\u0443\u0448\u0430\u044e\u0442\u0441\u044f \u0441\u0430\u043c\u043e\u0439 \u0431\u0435\u0441\u043f\u0430\u0440\u0434\u043e\u043d\u043d\u043e\u0439 \u0438 \u0433\u043d\u0443\u0441\u043d\u043e\u0439 \u043b\u043e\u0436\u044c\u044e, \u0441\u0442\u0440\u0435\u043c\u044f\u0441\u044c \u0441\u043a\u0440\u044b\u0442\u044c \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u044b\u0435, \u043a\u0430\u043a \u0442\u0435\u043f\u0435\u0440\u044c \u0441\u0442\u0430\u043b\u043e \u043e\u0447\u0435\u0432\u0438\u0434\u043d\u043e, \u0431\u044b\u043b\u0438 \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u044b \u0438\u043c\u0438 \u0441\u0430\u043c\u0438\u043c\u0438. \u0413\u0438\u0442\u043b\u0435\u0440\u043e\u0432\u0441\u043a\u0438\u043c \u0443\u0431\u0438\u0439\u0446\u0430\u043c \u043d\u0435 \u0443\u0434\u0430\u0441\u0442\u0441\u044f \u0438\u0437 \u0431\u0435\u0436\u0430\u0442\u044c \u0441\u043f\u0440\u0430\u0432\u0435\u0434\u043b\u0438\u0432\u043e\u0433\u043e \u0438 \u0441\u0443\u0440\u043e\u0432\u043e\u0433\u043e \u0432\u043e\u0437\u043c\u0435\u0437\u0434\u0438\u044f \u0437\u0430 \u0438\u0445 \u043a\u0440\u043e\u0432\u0430\u0432\u044b\u0435 \u0437\u043b\u043e\u0434\u0435\u044f\u043d\u0438\u044f\".'), 1004);
