(4019, STRINGDECODE('\u042d\u0442\u0438 \u0447\u0435\u0442\u044b\u0440\u0435 \u0441\u043b\u043e\u0432\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0442 \u0432 \u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0438 \u041c.\u042e. \u041b\u0435\u0440\u043c\u043e\u043d\u0442\u043e\u0432\u0430 \u0437\u0430 \u0441\u0442\u0440\u043e\u043a\u043e\u0439, \u0434\u0430\u0432\u0448\u0435\u0439 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0442\u0435\u043c\u0435.'), 1005),
(4020, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0439 \u0431\u044b\u043b\u0430 \u0441\u043a\u0443\u043a\u0430 \u0443 \u0411\u043e\u0433\u043e\u043c\u0438\u043b\u0430.'), 1005),
(4021, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u0443\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u0430 \u043f\u043e\u0433\u0438\u0431\u043b\u0430 \u043f\u0440\u0438 \u0432\u0437\u0440\u044b\u0432\u0435 \"\u0427\u0435\u043b\u043b\u0435\u043d\u0434\u0436\u0435\u0440\u0430\".'), 1006),
