(4037, STRINGDECODE('\"\u042f \u0432\u0430\u0441 \u043e\u0447\u0435\u043d\u044c \u043b\u044e\u0431\u043b\u044e, \u043d\u043e \u0438 \u0437\u0432\u0435\u0440\u0435\u0439 \u044f \u0442\u043e\u0436\u0435 \u043b\u044e\u0431\u043b\u044e...\".'), 1010),
(4038, STRINGDECODE('\"\u041a\u0430\u043a \u043f\u043e\u0433\u043e\u0434\u0430? \u0417\u0434\u0435\u0441\u044c, \u0432 \u0425\u0430\u0440\u044c\u043a\u043e\u0432\u0435, \u0441\u043e\u0432\u0441\u0435\u043c \u043b\u0435\u0442\u043e. \u0413\u043e\u0440\u043e\u0434 \u0448\u0443\u043c\u043d\u044b\u0439 - \u0446\u0435\u043d\u0442\u0440 \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438. \u041f\u043e\u0441\u043b\u0435 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0438 \u043a\u0430\u0436\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u0437\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0443 \u043f\u043e\u043f\u0430\u043b...\".'), 1010),
(4039, STRINGDECODE('\"\u041c\u043e\u043b\u044e \u0442\u0435\u0431\u044f \u043e\u0431 \u043e\u0434\u043d\u043e\u043c: \u043d\u0435 \u0432\u0435\u0440\u044c \u044d\u0442\u043e\u043c\u0443 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0443! \u041c\u043e\u0436\u043d\u043e \u0441\u043c\u0435\u043b\u043e \u0441\u043a\u0430\u0437\u0430\u0442\u044c, \u0447\u0442\u043e \u0432\u0441\u0435\u043c\u0438 \u043d\u0430\u0448\u0438\u043c\u0438 \u043d\u0435\u0443\u0434\u0430\u0447\u0430\u043c\u0438 \u043c\u044b \u043e\u0431\u044f\u0437\u0430\u043d\u044b \u0442\u043e\u043b\u044c\u043a\u043e \u0435\u043c\u0443\".'), 1010),
(4040, STRINGDECODE('\"\u041a\u043e\u0440\u0430\u0431\u043b\u044c \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0435\u043d, \u0441\u043d\u0430\u0440\u044f\u0436\u0435\u043d \u0438 \u0441\u0442\u043e\u0438\u0442 \u043d\u0430 \u044f\u043a\u043e\u0440\u0435, \u0433\u043e\u0442\u043e\u0432\u044b\u0439 \u043a \u043e\u0442\u043f\u043b\u044b\u0442\u0438\u044e. \u041d\u0435\u043b\u044c\u0437\u044f \u0438 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0441\u0435\u0431\u0435 \u0431\u043e\u043b\u0435\u0435 \u043f\u0440\u0435\u043b\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0441\u0443\u0434\u043d\u0430, \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u0442\u044c \u0438\u043c \u043c\u043e\u0433 \u0431\u044b \u0438 \u0440\u0435\u0431\u0435\u043d\u043e\u043a\".'), 1010),
(4041, STRINGDECODE('\"\u042f \u0443\u0442\u0440\u043e\u043c \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u0442\u044c \u0443\u0432\u0435\u0440\u0435\u043d, \u0447\u0442\u043e \u0441 \u0412\u0430\u043c\u0438 \u0434\u043d\u0435\u043c \u0443\u0432\u0438\u0436\u0443\u0441\u044c \u044f...\".'), 1011);
