(4044, STRINGDECODE('\"\u041f\u043e\u0437\u0432\u043e\u043b\u044c\u0442\u0435 \u0436\u0435, \u0434\u0440\u0430\u0433\u043e\u0446\u0435\u043d\u043d\u044b\u0435 \u0441\u043e\u0441\u0435\u0434\u0443\u0448\u043a\u0430, \u0445\u043e\u0442\u044c \u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043e\u043c \u0441\u0438\u0445 \u0441\u0442\u0430\u0440\u0447\u0435\u0441\u043a\u0438\u0445 \u0433\u0438\u0435\u0440\u043e\u0433\u043b\u0438\u0444\u043e\u0444 \u043f\u043e\u0437\u043d\u0430\u043a\u043e\u043c\u0438\u0442\u044c\u0441\u044f \u0441 \u0412\u0430\u043c\u0438, \u043f\u043e\u0436\u0430\u0442\u044c \u043c\u044b\u0441\u043b\u0435\u043d\u043d\u043e \u0412\u0430\u0448\u0443 \u0443\u0447\u0435\u043d\u0443\u044e \u0440\u0443\u043a\u0443 \u0438 \u043f\u043e\u0437\u0434\u0440\u0430\u0432\u0438\u0442\u044c \u0412\u0430\u0441 \u0441 \u043f\u0440\u0438\u0435\u0437\u0434\u043e\u043c \u0438\u0437 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430 \u0432 \u043d\u0430\u0448 \u043d\u0435\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u044b\u0439 \u043c\u0430\u0442\u0435\u0440\u0438\u043a, \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u043d\u044b\u0439 \u043c\u0443\u0436\u0438\u043a\u0430\u043c\u0438 \u0438 \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0438\u043c \u043d\u0430\u0440\u043e\u0434\u043e\u043c, \u0442.\u0435. \u043f\u043b\u0435\u0431\u0435\u0439\u0441\u043a\u0438\u043c \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u043c...\".'), 1011),
(4045, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0435\u0433\u043e \u0432 \u043a\u043d\u0438\u0433\u0435 \u0410. \u0414\u044e\u043c\u0430 \"\u0422\u0440\u0438 \u043c\u0443\u0448\u043a\u0435\u0442\u0435\u0440\u0430\" \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u043e\u043c \u0441\u043e \u0448\u0440\u0430\u043c\u043e\u043c.'), 1012),
