(4114, STRINGDECODE('\u041f\u043e \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443 \u0434\u0440\u0443\u0437\u0435\u0439 \u041f\u0443\u0448\u043a\u0438\u043d\u0430, \u043d\u0438 \u043e\u0434\u043d\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u043d\u0435 \u0437\u043d\u0430\u0447\u0438\u043b\u043e \u043b\u0438\u0447\u043d\u043e \u0434\u043b\u044f \u043d\u0435\u0433\u043e \u0442\u0430\u043a \u043c\u043d\u043e\u0433\u043e, \u043a\u0430\u043a \u044d\u0442\u043e. \u0412 \u0442\u043e \u0436\u0435 \u0432\u0440\u0435\u043c\u044f \u0441\u0440\u0435\u0434\u0438 \u043e\u0442\u0437\u044b\u0432\u043e\u0432 \u043f\u0440\u0435\u043e\u0431\u043b\u0430\u0434\u0430\u043b\u0438 \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435: \"\u0413\u0430\u043b\u0438\u043c\u0430\u0442\u044c\u044f \u0432 \u0428\u0435\u043a\u0441\u043f\u0438\u0440\u043e\u0432\u0441\u043a\u043e\u043c \u0440\u043e\u0434\u0435\" \u0438\u043b\u0438 \"\u041d\u0443 \u0447\u0442\u043e \u044d\u0442\u043e \u0437\u0430 \u0441\u043e\u0447\u0438\u043d\u0435\u043d\u0438\u0435?! \u0418\u043d\u0434\u0435 \u043f\u0440\u043e\u0437\u043e\u044e, \u0438\u043d\u0434\u0435 \u0441\u0442\u0438\u0445\u0430\u043c\u0438, \u0438\u043d\u0434\u0435 \u043f\u043e-\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438, \u0438\u043d\u0434\u0435 \u043f\u043e-\u043b\u0430\u0442\u0438\u043d\u0435 \u0434\u0430 \u0435\u0449\u0435 \u0431\u0435\u0437 \u0440\u0438\u0444\u043c\u044b\".'), 1029);
