(4116, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0433\u043b\u0430\u0432\u043d\u044b\u0439 \u0442\u0440\u0443\u0434 \u0432\u0441\u0435\u0439 \u0436\u0438\u0437\u043d\u0438 \u0440\u0438\u043c\u0441\u043a\u043e\u0433\u043e \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u0430 \u0422\u0430\u0446\u0438\u0442\u0430.'), 1029),
(4117, STRINGDECODE('\u0427\u0442\u043e\u0431\u044b \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u044c \u0434\u043b\u044f \u043f\u043e\u0442\u043e\u043c\u043a\u043e\u0432 \u044d\u0442\u043e \u0432\u044b\u043c\u0438\u0440\u0430\u044e\u0449\u0435\u0435 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u0434\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0435, \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0435 \u0443\u0447\u0435\u043d\u044b\u0435 \u0440\u0435\u0448\u0438\u043b\u0438 \u0437\u0430\u043c\u043e\u0440\u043e\u0437\u0438\u0442\u044c \u0435\u0433\u043e \u0414\u041d\u041a.'), 1030),
(4118, STRINGDECODE('\u041e\u043d\u0438 \u0432\u044b\u043a\u0430\u043f\u044b\u0432\u0430\u044e\u0442 \u0433\u043b\u0443\u0431\u043e\u043a\u0438\u0435 \u043d\u043e\u0440\u043a\u0438, \u0433\u0434\u0435 \u0443\u0441\u0442\u0440\u0430\u0438\u0432\u0430\u044e\u0442 \u043f\u043e\u0434\u0441\u0442\u0438\u043b\u043a\u0443 \u0438\u0437 \u0440\u044b\u0431\u044c\u0438\u0445 \u043a\u043e\u0441\u0442\u0435\u0439 \u0438 \u0432\u044b\u0432\u043e\u0434\u044f\u0442 \u043f\u0442\u0435\u043d\u0446\u043e\u0432. \u041c\u0435\u0436\u0434\u0443 \u043f\u0440\u043e\u0447\u0438\u043c, \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u0442 \u044d\u0442\u043e \u0432 \u0442\u0435\u043f\u043b\u043e\u0435 \u0432\u0440\u0435\u043c\u044f \u0433\u043e\u0434\u0430.'), 1030),
