(4120, STRINGDECODE('\u042d\u0442\u043e\u0442 \u043f\u043e\u043a\u0430\u0437\u0430\u0442\u0435\u043b\u044c \u0434\u043b\u044f \u041c\u0430\u043b\u044b\u0445 \u043f\u0438\u043d\u0433\u0432\u0438\u043d\u043e\u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 70, \u0434\u043b\u044f \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0445 - 230, \u0430 \u0434\u043b\u044f \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0441\u043a\u0438\u0445 - 265 \u043c\u0435\u0442\u0440\u043e\u0432.'), 1030),
(4121, STRINGDECODE('\u042d\u0442\u043e\u0442 \u043b\u0430\u0443\u0440\u0435\u0430\u0442 \u041d\u043e\u0431\u0435\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u043f\u0440\u0435\u043c\u0438\u0438 \u0432 \u043a\u043d\u0438\u0433\u0435 \"\u041e\u0442 \u043c\u043e\u0440\u044f \u0434\u043e \u043c\u043e\u0440\u044f\" \u0432\u0441\u043f\u043e\u043c\u0438\u043d\u0430\u043b: \"\u041d\u0430 \u043c\u0435\u043d\u044f \u043d\u0430\u043f\u0430\u043b\u043e \u043a\u0440\u044b\u043b\u0430\u0442\u043e\u0435 \u0447\u0443\u0434\u043e\u0432\u0438\u0449\u0435 \u043e\u0434\u0438\u043d\u0430\u043a\u043e\u0432\u043e\u0439 \u0441\u043e \u043c\u043d\u043e\u0439 \u0432\u0435\u043b\u0438\u0447\u0438\u043d\u044b, \u044f \u0443\u0431\u0435\u0436\u0430\u043b \u0438 \u0440\u0430\u0441\u043f\u043b\u0430\u043a\u0430\u043b\u0441\u044f. \u041e\u0442\u0435\u0446 \u043d\u0430\u0440\u0438\u0441\u043e\u0432\u0430\u043b \u0434\u043b\u044f \u043c\u0435\u043d\u044f \u043a\u0430\u0440\u0442\u0438\u043d\u0443 \u044d\u0442\u043e\u0439 \u0442\u0440\u0430\u0433\u0435\u0434\u0438\u0438 \u0438 \u0432\u043d\u0438\u0437\u0443 \u043d\u0430\u043f\u0438\u0441\u0430\u043b: \"\u041c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u0439 \u043c\u0430\u043b\u044c\u0447\u0438\u043a, \u0436\u0438\u0432\u0443\u0449\u0438\u0439 \u0432 \u0411\u043e\u043c\u0431\u0435\u0435, \u041c\u0447\u0430\u043b\u0441\u044f \u043e\u0442 \u043a\u0443\u0440\u0438\u0446\u044b \u0432\u0435\u0442\u0440\u0430 \u0431\u044b\u0441\u0442\u0440\u0435\u0435. \u0423\u0441\u043b\u044b\u0445\u0430\u0432: \"\u0422\u044b \u0447\u0443\u0434\u0430\u043a\", \u041e\u043d \u043e\u0442\u0432\u0435\u0442\u0438\u043b: \"\u041f\u0443\u0441\u0442\u044c \u0442\u0430\u043a, \u041d\u043e \u0442\u0435\u0440\u043f\u0435\u0442\u044c \u043d\u0435 \u043c\u043e\u0433\u0443 \u043a\u0443\u0440 \u0432 \u0411\u043e\u043c\u0431\u0435\u0435\".'), 1031);
