(4173, STRINGDECODE('\u041e\u043d\u0430 \u0431\u044b\u043b\u0430 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0442\u043a\u0440\u044b\u0442\u0430 \u0432 \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0438\u043d\u0441\u043a\u043e\u043c \u0434\u0432\u043e\u0440\u0446\u0435 \u0433. \u041f\u0443\u0448\u043a\u0438\u043d 31 \u043c\u0430\u044f 2003 \u0433. \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u0420\u043e\u0441\u0441\u0438\u0438 \u0438 \u043a\u0430\u043d\u0446\u043b\u0435\u0440\u043e\u043c \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438.'), 1044),
