(4254, STRINGDECODE('\"\u041e\u0442\u0434\u044b\u0445\" \u0438\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u043e\u0439 \u0442\u043e\u0447\u043a\u0435 \u041a\u0440\u044b\u043c\u0430 \u0434\u0430\u0432\u043d\u043e \u0443\u0436\u0435 \u0441\u0442\u0430\u043b \u043f\u0440\u0438\u0442\u0447\u0435\u0439 \u0434\u043b\u044f \u044f\u0437\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u044f\u0437\u044b\u043a\u043e\u0432, \u0430 \u0432\u043e\u0442 \u0434\u043b\u044f, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u041a\u0440\u044e\u0447\u043a\u043e\u0432\u0430 \u0438\u043b\u0438 \u0421\u0442\u0430\u0440\u043e\u0434\u0443\u0431\u0446\u0435\u0432\u0430 \u043e\u043d \u0432\u044b\u0437\u043e\u0432\u0435\u0442 \u043d\u0435 \u0441\u0430\u043c\u044b\u0435 \u043f\u0440\u0438\u044f\u0442\u043d\u044b\u0435 \u0430\u0441\u0441\u043e\u0446\u0438\u0430\u0446\u0438\u0438.'), 1064),
(4255, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0439 \u0432\u044b\u0432\u043e\u0434 \u043e \u043c\u0435\u0441\u0442\u0435 \u043f\u0440\u0438\u0432\u0430\u043b\u0430 \u043f\u0440\u043e\u0437\u0432\u0443\u0447\u0430\u043b \u0432 \u0433\u043e\u0431\u043b\u0438\u043d\u043e\u0432\u0441\u043a\u043e\u043c \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0435 \u0432\u0442\u043e\u0440\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \"\u0412\u043b\u0430\u0441\u0442\u0435\u043b\u0438\u043d\u0430 \u041a\u043e\u043b\u0435\u0446\" \u043f\u043e\u0441\u043b\u0435 \u0437\u0430\u044f\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u0440\u0435\u0434\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f \u043e\u0440\u043a\u043e\u0432 \u043e \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u043c \u043e\u0442\u0434\u044b\u0445\u0435.'), 1064),
(4256, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u0433\u043e\u0432\u043e\u0440\u0438\u043b \u0434\u0430\u043c\u0435: \"\u041d\u0435 \u0445\u043e\u0434\u0438\u043b \u0432 \u0411\u0430\u0433\u0434\u0430\u0434 \u044f \u0441 \u043a\u0430\u0440\u0430\u0432\u0430\u043d\u043e\u043c, \u043d\u0435 \u0432\u043e\u0437\u0438\u043b \u044f \u0448\u0435\u043b\u043a \u0442\u0443\u0434\u0430 \u0438 \u0445\u043d\u0443. \u041d\u0430\u043a\u043b\u043e\u043d\u0438\u0441\u044c \u0441\u0432\u043e\u0438\u043c \u043a\u0440\u0430\u0441\u0438\u0432\u044b\u043c \u0441\u0442\u0430\u043d\u043e\u043c, \u043d\u0430 \u043a\u043e\u043b\u0435\u043d\u044f\u0445 \u0434\u0430\u0439 \u043c\u043d\u0435 \u043e\u0442\u0434\u043e\u0445\u043d\u0443\u0442\u044c\".'), 1064),
(4257, STRINGDECODE('\u041b\u044e\u0431\u043e\u0439 \u0443\u0447\u0435\u043d\u0438\u043a \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0439 \u0448\u043a\u043e\u043b\u044b \u0441\u043a\u0430\u0436\u0435\u0442, \u0447\u0442\u043e \u0438\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u0431\u044b\u0432\u0430\u0435\u0442 \u0434\u0432\u0443\u0445 \u0432\u0438\u0434\u043e\u0432 - \u0430\u0431\u0441\u043e\u043b\u044e\u0442\u043d\u044b\u0439 \u0438 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439.'), 1065),
(4258, STRINGDECODE('\u041e\u0442\u043f\u0440\u0430\u0432\u0438\u0432\u0448\u0438\u0439\u0441\u044f \u043d\u0430 \u0441\u0432\u0435\u0436\u0438\u0439 \u0432\u043e\u0437\u0434\u0443\u0445 \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u043f\u0435\u0440\u0432\u044b\u0445 \u0441\u0442\u0430\u0440\u0438\u0447\u043e\u043a \u043d\u043e\u0441\u0438\u043b \u0441 \u0441\u043e\u0431\u043e\u0439 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0430\u0442\u0440\u0438\u0431\u0443\u0442, \u0441\u0438\u043b\u044c\u043d\u043e \u0440\u0430\u0437\u0434\u0440\u0430\u0436\u0430\u0432\u0448\u0438\u0439 \u0441\u044d\u0440\u0430.'), 1065);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(4259, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0431\u0430\u0440\u0434 \u043d\u0430\u0445\u043e\u0434\u0438\u043b \u0432 \u0441\u0435\u0431\u0435 \u0441\u0438\u043b\u044b \u0433\u043e\u0432\u043e\u0440\u0438\u0442\u044c: \"\u0427\u0442\u043e \u044f \u0441\u043a\u0430\u0436\u0443 \u0442\u0435\u0431\u0435, \u0442\u044b \u043d\u0435 \u0441\u043b\u0443\u0448\u0430\u0439\".'), 1065),
(4260, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0443 \u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0442\u043d\u0443\u044e \u0444\u043e\u0440\u043c\u0443\u043b\u0443 \u0440\u0438\u043c\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0430 \u0434\u0438\u043a\u0442\u043e\u0432\u0430\u043b \u0430\u0431\u0431\u0430\u0442 \u0424\u0430\u0440\u0438\u0430 \u042d\u0434\u043c\u043e\u043d\u0443 \u0414\u0430\u043d\u0442\u0435\u0441\u0443, \u043e\u0431\u044a\u044f\u0432\u0438\u0432 \u0435\u0435 \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u043f\u0435\u043d\u0438\u0435\u043c \u0431\u0435\u043b\u044c\u043a\u0430\u043d\u0442\u043e.'), 1065),
(4261, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u043f\u0435\u0441\u043d\u044f \u0443\u0447\u0438\u0442 \u043d\u0430\u0441 \u043d\u0435 \u0432\u0435\u0440\u0438\u0442\u044c \u0432\u0441\u0435\u043c\u0443, \u0447\u0442\u043e \u043d\u0430\u043c \u0433\u043e\u0432\u043e\u0440\u044f\u0442.'), 1066),
(4262, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d\u0430 \u0437\u0430\u044f\u0432\u0438\u043b\u0430: \"\u0422\u044b \u0432\u0435\u0434\u044c \u043d\u0430\u0448 \u043d\u043e\u0432\u044b\u0439 \u043c\u0443\u0436. \u0421\u043a\u0430\u0436\u0438 \u0441\u0432\u043e\u0435\u043c\u0443 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0443, \u0447\u0442\u043e\u0431\u044b \u043e\u043d \u043d\u0435 \u0432\u0445\u043e\u0434\u0438\u043b \u0441\u044e\u0434\u0430\".'), 1066),
(4263, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0438\u0434\u0443\u0449\u0430\u044f \u0441\u0435\u0439\u0447\u0430\u0441 \u0432 \u0444\u0443\u0442\u0431\u043e\u043b\u0435 \u0430\u043a\u0446\u0438\u044f \u043f\u0440\u043e\u0442\u0438\u0432 \u0440\u0430\u0441\u0438\u0437\u043c\u0430.'), 1066),
(4264, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u043f\u0438\u0441\u0430\u043b: \"\u041d\u044b\u043d\u0435\u0448\u043d\u0435\u0435 \u043d\u0430\u0448\u0435 \u0436\u0430\u043b\u043a\u043e\u0435 \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u0435, \u043a\u043e\u043d\u0435\u0447\u043d\u043e, \u0441\u0435\u0439\u0447\u0430\u0441 \u0436\u0435 \u0437\u0430\u043a\u0440\u0438\u0447\u0438\u0442 \u043f\u043e \u043f\u043e\u0432\u043e\u0434\u0443 \u043d\u0435\u0434\u043e\u043f\u0443\u0441\u0442\u0438\u043c\u043e\u0441\u0442\u0438 \u0432\u043c\u0435\u0448\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0432 \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u044b\u0445 \u043f\u0440\u0430\u0432 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430. \u041d\u0435\u0442, \u0441\u043a\u0430\u0436\u0435\u043c \u043c\u044b \u044d\u0442\u0438\u043c \u043b\u044e\u0434\u044f\u043c, \u043c\u044b \u0437\u043d\u0430\u0435\u043c \u0442\u043e\u043b\u044c\u043a\u043e \u043e\u0434\u043d\u043e \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430... - \u043d\u0435\u0443\u0441\u044b\u043f\u043d\u043e \u0437\u0430\u0431\u043e\u0442\u0438\u0442\u044c\u0441\u044f \u043e \u0442\u043e\u043c, \u0447\u0442\u043e\u0431\u044b \u0435\u0433\u043e \u043a\u0440\u043e\u0432\u044c \u043e\u0441\u0442\u0430\u0432\u0430\u043b\u0430\u0441\u044c \u0447\u0438\u0441\u0442\u043e\u0439\".'), 1066),
(4265, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \u041a\u0412\u041d \u043f\u043e\u0432\u0435\u0434\u0430\u043b\u0430 \u043d\u0430\u043c \u043f\u0440\u043e \u043d\u0430\u0447\u0438\u0442\u0430\u043d\u043d\u043e\u0433\u043e \u043e\u0445\u0440\u0430\u043d\u043d\u0438\u043a\u0430 \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0438, \u043f\u0440\u043e\u0447\u0438\u0442\u0430\u0432\u0448\u0435\u0433\u043e \u0442\u0440\u0438 \u043a\u043d\u0438\u0433\u0438: \u0431\u0443\u043a\u0432\u0430\u0440\u044c, \u0432\u0442\u043e\u0440\u0443\u044e \u0438 \u0441\u0438\u043d\u044e\u044e.'), 1067);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(4266, STRINGDECODE('\u041d\u0435 \u0441\u0447\u0438\u0442\u0430\u044f \"\u0410\u0437\u0431\u0443\u043a\u0438\" \u0438 \"\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430\", \u0430 \u0442\u0430\u043a\u0436\u0435 \u043c\u043d\u043e\u0433\u043e\u0441\u0442\u0432\u043e\u043b\u044c\u043d\u043e\u0439 \u043c\u043e\u0440\u0442\u0438\u0440\u044b, \u0433\u043b\u0430\u0432\u043d\u044b\u043c \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u0435\u043c \u0418\u0432\u0430\u043d\u0430 \u0424\u0435\u0434\u043e\u0440\u043e\u0432\u0430 \u043c\u043e\u0436\u043d\u043e \u0441\u0447\u0438\u0442\u0430\u0442\u044c \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u043e\u043b\u043d\u043e\u0435 \u0441\u043b\u0430\u0432\u044f\u043d\u043e\u044f\u0437\u044b\u0447\u043d\u043e\u0435 \u0438\u0437\u0434\u0430\u043d\u0438\u0435 \u0411\u0438\u0431\u043b\u0438\u0438, \u0438\u043d\u0430\u0447\u0435 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u043e\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a.'), 1067),
(4267, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438 \u0434\u0432\u0435 \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043a\u043d\u0438\u0436\u043a\u0438 \u0431\u044b\u043b\u0438 \u043d\u0430\u0437\u0432\u0430\u043d\u044b \u0443 \u0410.\u041d. \u0422\u043e\u043b\u0441\u0442\u043e\u0433\u043e \u0430\u0442\u0440\u0438\u0431\u0443\u0442\u0430\u043c\u0438 \u0430\u0437\u0431\u0443\u043a\u0438, \u043f\u043e\u0434\u0430\u0440\u0435\u043d\u043d\u043e\u0439 \u0411\u0443\u0440\u0430\u0442\u0438\u043d\u043e \u043f\u0430\u043f\u043e\u0439 \u041a\u0430\u0440\u043b\u043e.'), 1067),
(4268, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438\u043c \u043e\u0442\u043b\u0438\u0447\u0430\u043b\u0438\u0441\u044c \u043e\u0442 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0445 \u0441\u0435\u0431\u0435 \u0430\u043d\u0430\u043b\u043e\u0433\u043e\u0432 \u043f\u043e \u0446\u0435\u043b\u0435\u0432\u043e\u0439 \u0430\u0443\u0434\u0438\u0442\u043e\u0440\u0438\u0438 \u0441\u043b\u043e\u0432\u0430\u0440\u0438 \u041a\u0430\u0440\u0438\u043e\u043d\u0430 \u0418\u0441\u0442\u043e\u043c\u0438\u043d\u0430, \u0432\u044b\u0448\u0435\u0434\u0448\u0438\u0435 \u0432 \u043a\u043e\u043d\u0446\u0435 XVII \u0432\u0435\u043a\u0430.'), 1067),
(4269, STRINGDECODE('\u041f\u043e \u0432\u0435\u0440\u0441\u0438\u0438 \u0410. \u0414\u044e\u043c\u0430, \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 \u041c\u043e\u043d\u043a\u0430, \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0435\u0433\u043e \u0438\u043c\u0435\u043d\u043d\u043e \u0415\u0413\u041e \u0432 \u043f\u0440\u0430\u0432\u0430\u0445, \u043f\u043e\u0434\u0432\u0438\u0433 \u043d\u0430 \u044d\u0442\u043e \u0434''\u0410\u0440\u0442\u0430\u043d\u044c\u044f\u043d.'), 1068),
(4270, STRINGDECODE('\u0418\u0437\u0432\u0435\u0441\u0442\u043d\u0430 \u0446\u0435\u043f\u043e\u0447\u043a\u0430 \u043e\u0442 \u043f\u043e\u0441\u0442\u0443\u043f\u043a\u0430 \u0447\u0435\u0440\u0435\u0437 \u043d\u0435\u0435 \u0438 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043a \u0441\u0443\u0434\u044c\u0431\u0435, \u0430 \u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u043c\u0443\u0434\u0440\u043e\u0441\u0442\u044c \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0435\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a.'), 1068),
(4271, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u043a\u043e\u043c\u0430\u043d\u0434\u0430, \u043d\u0435\u043e\u0434\u043d\u043e\u043a\u0440\u0430\u0442\u043d\u043e \u0431\u044b\u0432\u0448\u0430\u044f \u0432\u0442\u043e\u0440\u043e\u0439 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0439 \u0420\u043e\u0441\u0441\u0438\u0438, \u043d\u0435\u0434\u0430\u0432\u043d\u043e \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b\u0430 \u0441\u0432\u043e\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 \u043d\u0430 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u043c \u0443\u0440\u043e\u0432\u043d\u0435.'), 1068);
