(4291, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u043c\u0443 \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u0443-\u043f\u0443\u0442\u0435\u0439\u0449\u0438\u043a\u0443 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \u043f\u0438\u0441\u044c\u043c\u0435\u043d\u043d\u0430\u044f \u0444\u0438\u043a\u0441\u0430\u0446\u0438\u044f \u0442\u0430\u043a\u0438\u0445 \u0441\u043a\u0430\u0437\u043e\u043a, \u043a\u0430\u043a, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \"\u0417\u043d\u0430\u0435\u043c!\" \u0438\u043b\u0438 \"\u0427\u0430\u043f\u043e\u0433\u0438\".'), 1073);
