(4292, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442, \u043f\u043e\u0434\u0445\u043e\u0434\u044f\u0449\u0438\u0439 \u043a \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u044e \u0442\u0435\u043c\u044b, \u0440\u043e\u043c\u0430\u043d \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \u0427\u0430\u0440\u043b\u044c\u0437\u0443 \u0414\u0438\u043a\u043a\u0435\u043d\u0441\u0443.'), 1073),
(4293, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u0441\u0442\u0430\u043b \u0441\u0438\u043c\u0432\u043e\u043b\u043e\u043c \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u044b \u0446\u0435\u043b\u043e\u0439 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u044b.'), 1074),
(4294, STRINGDECODE('\u0415\u0435 \u0443\u043f\u043e\u0440\u0441\u0442\u0432\u043e \u0441\u043f\u0430\u0441\u043b\u043e \u0435\u0435 \u0445\u043e\u0437\u044f\u0438\u043d\u0430, \u0445\u043e\u0442\u044f \u0438 \u043e\u0431\u0438\u0434 \u0431\u044b\u043b\u043e \u0443 \u043d\u0435\u0435 \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u043e.'), 1074),
(4295, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \"\u043e\u0442\u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u0438\u043b\" \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u0441\u0432\u043e\u044e \u043a\u043e\u0440\u043c\u0438\u043b\u0438\u0446\u0443 \u043a\u043e\u0437\u0443 \u0410\u043c\u0430\u043b\u0444\u0435\u044e \u0417\u0435\u0432\u0441.'), 1074),
(4296, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d, \u043d\u0435\u0441\u043c\u043e\u0442\u0440\u044f \u043d\u0430 \u0441\u0432\u043e\u0439 \u0434\u0435\u0432\u0438\u0437 \"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d \u0432\u0441\u0435\u0433\u0434\u0430 \u043f\u0440\u0430\u0432!\", \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b \u0441\u0432\u043e\u044e \u0436\u0438\u0437\u043d\u044c \u043d\u0430 \u0441\u043a\u043e\u0442\u043e\u0431\u043e\u0439\u043d\u0435.'), 1074),
(4297, STRINGDECODE('\u0412 \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0441\u0435\u0440\u0438\u0439 \u043c\u0443\u043b\u044c\u0442\u0444\u0438\u043b\u044c\u043c\u0430 \"\u0422\u043e\u043c \u0438 \u0414\u0436\u0435\u0440\u0440\u0438\" \u0422\u043e\u043c, \u043f\u043e\u043f\u0430\u0432 \u043d\u0430 \u043d\u0435\u0431\u043e, \u0432\u0438\u0434\u0438\u0442, \u043a\u0430\u043a \u0432 \u0440\u0430\u0439 \u043f\u043e\u043f\u0430\u0434\u0430\u044e\u0442 \u0442\u0440\u043e\u0435 \u043a\u043e\u0442\u044f\u0442, \u0432\u044b\u0431\u0440\u0430\u0432\u0448\u0438\u0435\u0441\u044f \u0438\u0437 \u043c\u0435\u0448\u043a\u0430. \u0410 \u0441\u0443\u0434\u044f \u043f\u043e \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u043d\u043e\u043c\u0443 \u0437\u0432\u0443\u043a\u0443 \u043f\u0435\u0440\u0435\u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f \u044d\u0442\u043e\u0433\u043e \u043c\u0435\u0448\u043a\u0430, \u043e\u043d\u0438 \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c.'), 1075),
(4298, STRINGDECODE('\u0412 \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u043e\u0439 \u0433\u043e\u0434\u0430 \u0447\u0435\u0442\u044b\u0440\u0435 \u043d\u0430\u0437\u0430\u0434 \u043f\u0435\u0441\u043d\u0435 \u043e\u043f\u0438\u0441\u044b\u0432\u0430\u043b\u0430\u0441\u044c \u0441\u0443\u0434\u044c\u0431\u0430 \u0431\u0435\u0437\u0434\u043e\u043c\u043d\u043e\u0433\u043e \u043a\u043e\u0442\u0435\u043d\u043a\u0430, \"\u043d\u0430 \u0443\u043b\u0438\u0446\u0443 \u0433\u043e\u0440\u043e\u0434\u0430 \u0431\u0440\u043e\u0448\u0435\u043d\u043d\u043e\u0433\u043e \u043b\u044e\u0434\u044c\u043c\u0438\", \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0437\u0432\u0430\u043b\u0438 \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a.'), 1075),
(4299, STRINGDECODE('\u0412\u043e \u0432\u0440\u0435\u043c\u044f \u043d\u0435\u0434\u0430\u0432\u043d\u0435\u0433\u043e \u043c\u0430\u0442\u0447\u0430 \u043a\u0443\u0431\u043a\u0430 \u0414\u044d\u0432\u0438\u0441\u0430 \u043a\u043e\u0442\u0435\u043d\u043e\u043a, \u043f\u0443\u0441\u0442\u044c \u0438 \u043d\u0435 \u0447\u0435\u0440\u043d\u043e\u0433\u043e \u0446\u0432\u0435\u0442\u0430, \u0432\u044b\u0441\u043a\u043e\u0447\u0438\u0432\u0448\u0438\u0439 \u043d\u0430 \u0435\u0433\u043e \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0443 \u043a\u043e\u0440\u0442\u0430, \u043f\u043e\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u043c\u0443 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u043c\u0443 \u0442\u0435\u043d\u043d\u0438\u0441\u0438\u0441\u0442\u0443 \u043f\u043b\u043e\u0445\u0438\u043c \u043f\u0440\u0435\u0434\u0437\u043d\u0430\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435\u043c. \u0418 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e, \u043e\u043d \u043f\u0440\u043e\u0438\u0433\u0440\u0430\u043b \u044f\u0432\u043d\u043e \u0443\u0441\u0442\u0443\u043f\u0430\u0432\u0448\u0435\u043c\u0443 \u0432 \u043a\u043b\u0430\u0441\u0441\u0435 \u0447\u0438\u043b\u0438\u0439\u0446\u0443.'), 1075);
