(4300, STRINGDECODE('\u0412 \u043e\u0434\u043d\u043e\u043c \u0438\u0437 \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u043e\u0432 \u0432 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0438\u0438 \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u043a\u043d\u0438\u0433 \u0446\u0435\u043b\u043e\u0433\u043e \u0446\u0438\u043a\u043b\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438\u043c \u043f\u044f\u0442\u0435\u0440\u044b\u043c \u0431\u044b\u043b\u0438 \u043f\u043e\u043e\u0431\u0435\u0449\u0430\u043d\u044b \u0441\u0438\u0430\u043c\u0441\u043a\u0438\u0435 \u043a\u043e\u0442\u044f\u0442\u0430.'), 1075),
(4301, STRINGDECODE('\u0415\u0441\u043b\u0438 \u0441\u043e\u0435\u0434\u0438\u043d\u0438\u0442\u044c \u043f\u043e \u043f\u0440\u0430\u0432\u0438\u043b\u0430\u043c \u0444\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e\u0439 \u043b\u043e\u0433\u0438\u043a\u0438 \u0440\u0443\u0441\u0441\u043a\u0443\u044e \u043f\u043e\u0433\u043e\u0432\u043e\u0440\u043a\u0443 \u0438 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0440\u043e\u043c\u0430\u043d\u0430 \u041e\u043b\u0434\u0438, \u043c\u044b \u043f\u043e\u043b\u0443\u0447\u0438\u043c, \u0447\u0442\u043e \u0433\u0435\u0440\u043e\u0439 \u0432\u043e\u0432\u0441\u0435 \u043d\u0435 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u0438\u043c.'), 1076),
(4302, STRINGDECODE('\"\u042d\u0442\u043e\u0442 \u043c\u0430\u043b\u044c\u0447\u0438\u0448\u043a\u0430 \u043e\u0434\u0438\u043d\u043e\u043a \u0432 \u043e\u0433\u0440\u043e\u043c\u043d\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0435, \u0433\u0434\u0435 \u0443 \u043d\u0435\u0433\u043e \u043d\u0435\u0442 \u043d\u0438\u043a\u043e\u0433\u043e... \u0418 \u0434\u043e\u043c\u0430, \u043d\u0430\u0447\u0438\u043d\u0435\u043d\u043d\u043e\u0433\u043e \u0432\u0441\u044f\u043a\u0438\u043c\u0438 \u0443\u0436\u0430\u0441\u043d\u044b\u043c\u0438 \u0448\u0442\u0443\u043a\u0430\u043c\u0438\" - \u0443\u0431\u0435\u0436\u0434\u0430\u043b \u043e\u0434\u0438\u043d \u0434\u0440\u0443\u0433\u043e\u0433\u043e. \u0410 \u043a\u0430\u043a\u043e\u0439 \u043c\u0430\u043b\u044c\u0447\u0438\u0448\u043a\u0430?'), 1076),
(4303, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a - \u043e\u0447\u0435\u0432\u0438\u0434\u043d\u043e, \u0432 \u0447\u0435\u0441\u0442\u044c \u043e\u0434\u043d\u043e\u0433\u043e \u0438\u0437 \u0448\u0442\u0430\u0442\u043e\u0432 - \u0432 \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0435 \u041a\u043e\u043d\u0430\u043d \u0414\u043e\u0439\u043b\u044f \"\u041f\u044f\u0442\u044c \u0430\u043f\u0435\u043b\u044c\u0441\u0438\u043d\u043e\u0432\u044b\u0445 \u0437\u0435\u0440\u043d\u044b\u0448\u0435\u043a\" \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0441\u044f \u043a\u043e\u0440\u0430\u0431\u043b\u044c, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043b \u0433\u043b\u0430\u0432\u0430\u0440\u044c \u041a\u0443-\u043a\u043b\u0443\u043a\u0441-\u043a\u043b\u0430\u043d\u0430.'), 1076),
(4304, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d, \u043f\u0440\u0435\u0434\u0432\u043a\u0443\u0448\u0430\u044f \u043d\u0430\u0440\u0443\u0448\u0435\u043d\u0438\u0435 \u0441\u0432\u043e\u0435\u0439 \u043f\u0440\u043e\u0441\u044c\u0431\u044b, \u0440\u0430\u0441\u0445\u0430\u0436\u0438\u0432\u0430\u043b \u043f\u043e \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0440\u0430\u0442\u0443\u0448\u0435, \u043d\u0430\u043f\u0435\u0432\u0430\u044f \"\u041e\u0434\u0438\u043d \u044f, \u043e\u0434\u0438\u043d, \u043a\u0430\u043a \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u0438\u043a\".'), 1076),
(4305, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0437\u0432\u0430\u043b\u0438 \u0441\u043b\u0430\u0431\u043e\u043d\u0435\u0440\u0432\u043d\u043e\u0433\u043e \u0441\u043b\u0443\u0436\u0430\u0449\u0435\u0433\u043e \u043c\u0435\u0442\u043b\u044b, \u043d\u0435 \u0432\u044b\u0434\u0435\u0440\u0436\u0430\u0432\u0448\u0435\u0433\u043e \u0437\u0440\u0435\u043b\u0438\u0449\u0430 \"\u043e\u043c\u043e\u043b\u043e\u0436\u0451\u043d\u043d\u043e\u0433\u043e \u0431\u0430\u0440\u0438\u043d\u0430\".'), 1077);
