(4306, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d\u0430 \u0431\u044b\u043b\u0430 \u0431\u043e\u0433\u0438\u043d\u0435\u0439 \u0441\u043b\u0443\u0447\u0430\u044f \u0438 \u0441\u0443\u0434\u044c\u0431\u044b \u0432 \u0434\u0440\u0435\u0432\u043d\u0435\u0433\u0440\u0435\u0447\u0435\u0441\u043a\u043e\u0439 \u043c\u0438\u0444\u043e\u043b\u043e\u0433\u0438\u0438.'), 1077),
