(4340, STRINGDECODE('\u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u043e\u043f\u0435\u0440\u044b \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0430, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u043e\u0439 \u043f\u043e \u043c\u043e\u0442\u0438\u0432\u0430\u043c \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0435\u0433\u043e \u043b\u0435\u0433\u0435\u043d\u0434\u0430\u0440\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0439\u043d\u043e\u0433\u043e \u0442\u0435\u0437\u043a\u0438, \u043f\u0440\u043e\u0432\u0430\u043b\u0438\u043b\u0430\u0441\u044c, \u043f\u043e \u0435\u0433\u043e \u0441\u043b\u043e\u0432\u0430\u043c, \u0438\u0437-\u0437\u0430 \"\u0433\u043d\u0443\u0441\u043d\u043e\u0439 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0438\".'), 1085);
