(4484, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0438\u0437 \u044d\u0442\u043e\u0439 \u043a\u043d\u0438\u0433\u0438 \u0432\u0437\u044f\u0442\u0430 \u0446\u0438\u0442\u0430\u0442\u0430: \"\u041f\u043e\u043c\u043d\u0438\u0442\u0435 \u0442\u0430\u043a\u0436\u0435, \u0447\u0442\u043e \u043b\u0438\u0448\u044c \u0447\u0438\u0441\u0442\u044b\u0435 \u043d\u0430\u0443\u043a\u0438 \u0436\u0438\u0432\u0443\u0442 \u043f\u043e \u0437\u0430\u043a\u043e\u043d\u0430\u043c - \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u044b\u0435 \u0436\u0435 \u043e\u0431\u0445\u043e\u0434\u044f\u0442\u0441\u044f \u043f\u043e\u043d\u044f\u0442\u0438\u044f\u043c\u0438\".'), 1121),
