(4492, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0432 \u0442\u0430\u043a\u043e\u043c \u0432\u0438\u0434\u0435 \u0432 \"\u0425\u043e\u0431\u0431\u0438\u0442\u0435\" \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0430 \u043f\u043e\u0433\u043e\u0432\u043e\u0440\u043a\u0430 \"\u0418\u0437 \u043e\u0433\u043d\u044f \u0434\u0430 \u0432 \u043f\u043e\u043b\u044b\u043c\u044f\".'), 1123),
(4493, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e \u043d\u0438\u0445 \u0433\u043e\u0432\u043e\u0440\u044f\u0442, \u043f\u044b\u0442\u0430\u044f\u0441\u044c \u043f\u043e\u043a\u0430\u0437\u0430\u0442\u044c \u043d\u0435\u0441\u0431\u044b\u0442\u043e\u0447\u043d\u043e\u0441\u0442\u044c \u043c\u0435\u0447\u0442\u0430\u043d\u0438\u0439.'), 1124);
