(4495, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u043d\u0430\u043f\u0438\u0441\u0430\u043b \u043a\u043d\u0438\u0433\u0443 \"\u0422\u043e\u0440\u0433\u043e\u0432\u0446\u044b \u0432\u043e\u0437\u0434\u0443\u0445\u043e\u043c\".'), 1124),
(4496, STRINGDECODE('\u0421\u0440\u0435\u0434\u043d\u0435\u0432\u0435\u043a\u043e\u0432\u0430\u044f \u043f\u043e\u0433\u043e\u0432\u043e\u0440\u043a\u0430 \u0433\u043e\u0432\u043e\u0440\u0438\u043b\u0430, \u0447\u0442\u043e \u0442\u0430\u043a\u043e\u0439 \u0432\u043e\u0437\u0434\u0443\u0445 \u0434\u0435\u043b\u0430\u0435\u0442 \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u044b\u043c.'), 1124),
(4497, STRINGDECODE('\"\u0415\u0433\u043e \u0441\u044b\u043d \u0420\u043e\u0431\u0435\u0440\u0442 \u0441\u0442\u0430\u043b \u0442\u0430\u043a\u0438\u043c \u0436\u0435 \u043c\u043e\u0440\u044f\u043a\u043e\u043c, \u043a\u0430\u043a \u043a\u0430\u043f\u0438\u0442\u0430\u043d \u0414\u0436\u043e\u043d \u041c\u0430\u043d\u0433\u043b\u0441, \u0438 \u043f\u043e\u0434 \u043f\u043e\u043a\u0440\u043e\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c \u0413\u043b\u0435\u043d\u0430\u0440\u0432\u0430\u043d\u0430 \u043e\u043d \u043d\u0430\u0434\u0435\u0435\u0442\u0441\u044f \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u044c \u043e\u0442\u0446\u043e\u0432\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0435\u043a\u0442: \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u044c \u0448\u043e\u0442\u043b\u0430\u043d\u0434\u0441\u043a\u0443\u044e \u043a\u043e\u043b\u043e\u043d\u0438\u044e \u043d\u0430 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\u0445 \u0422\u0438\u0445\u043e\u0433\u043e \u043e\u043a\u0435\u0430\u043d\u0430\".'), 1125),
(4498, STRINGDECODE('\"... \u041f\u043e \u043c\u043d\u0435\u043d\u0438\u044e \u043b\u044e\u0434\u0435\u0439, \u043f\u043e-\u0432\u0438\u0434\u0438\u043c\u043e\u043c\u0443 \u0445\u043e\u0440\u043e\u0448\u043e \u043e\u0441\u0432\u0435\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044b\u0445, \u043e\u043d \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0441\u0442\u043e\u043b \u0438 \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0443 \u0432 \u043e\u0434\u043d\u043e\u043c \u0438\u0437 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0445 \u0437\u0430\u043c\u043a\u043e\u0432 \u043e\u0442 \u0449\u0435\u0434\u0440\u043e\u0442 \u0435\u0433\u043e \u0432\u044b\u0441\u043e\u043a\u043e\u043f\u0440\u0435\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u0441\u0442\u0432\u0430\".'), 1125),
(4499, STRINGDECODE('\"\u042f \u043f\u043e\u043c\u043d\u044e \u044d\u0442\u043e \u0447\u0443\u0434\u043d\u043e\u0435 \u043c\u0433\u043d\u043e\u0432\u0435\u043d\u044c\u0435, / \u041a\u043e\u0433\u0434\u0430 \u043f\u0435\u0440\u0435\u0434\u043e \u043c\u043d\u043e\u0439 \u044f\u0432\u0438\u043b\u0430\u0441\u044c \u0442\u044b!\".'), 1125),
(4500, STRINGDECODE('\"\u041d\u043e \u0431\u044b\u043b\u0430 \u043b\u0438 \u0442\u043e \u042e\u0434\u0438\u0444\u044c, \u043f\u043e\u0432\u0442\u043e\u0440\u0438\u0432\u0448\u0430\u044f \u043e\u0448\u0438\u0431\u043a\u0443 \u043c\u043e\u043b\u043e\u0434\u043e\u0441\u0442\u0438, \u0438\u043b\u0438 \u043a\u0430\u043a\u0430\u044f-\u043d\u0438\u0431\u0443\u0434\u044c \u0434\u0440\u0443\u0433\u0430\u044f \u0436\u0435\u0440\u0442\u0432\u0430 \u044d\u0442\u043e\u0433\u043e \u0432\u043e\u0438\u043d\u0430, \u0421\u043e\u043a\u043e\u043b\u0438\u043d\u044b\u0439 \u0413\u043b\u0430\u0437 \u0442\u0430\u043a \u043d\u0438\u043a\u043e\u0433\u0434\u0430 \u0438 \u043d\u0435 \u0443\u0437\u043d\u0430\u043b\".'), 1125),
(4501, STRINGDECODE('\u042d\u0442\u043e\u043c\u0443 \u041d\u043e\u0431\u0435\u043b\u0435\u0432\u0441\u043a\u043e\u043c\u0443 \u043b\u0430\u0443\u0440\u0435\u0430\u0442\u0443 1907 \u0433\u043e\u0434\u0430 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0430\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0441\u043e\u0431\u0438\u0440\u0430\u043b\u0438\u0441\u044c \u043f\u0440\u0438\u0441\u0432\u043e\u0438\u0442\u044c \u0437\u0432\u0430\u043d\u0438\u0435 \u0441\u044d\u0440\u0430, \u043d\u043e \u043e\u043d \u0440\u0435\u0448\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u043e\u0442\u043a\u0430\u0437\u0430\u043b\u0441\u044f.'), 1126);
