(4502, STRINGDECODE('\u042d\u0442\u043e\u0442 \u043e\u0431\u043b\u0430\u0434\u0430\u0442\u0435\u043b\u044c \u041d\u043e\u0431\u0435\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u043f\u0440\u0435\u043c\u0438\u0438 \u043c\u0438\u0440\u0430 1953 \u0433\u043e\u0434\u0430 \u0431\u044b\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u043c \u0432\u043e\u0435\u043d\u043d\u044b\u043c \u0441\u0440\u0435\u0434\u0438 \u043b\u0430\u0443\u0440\u0435\u0430\u0442\u043e\u0432 \u041d\u043e\u0431\u0435\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u043f\u0440\u0435\u043c\u0438\u0438, \u0430 \u0431\u043e\u043b\u0435\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u0435\u043d \u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u044f \u043e\u0434\u043d\u043e\u043c\u0443 \u043d\u0435\u0432\u043e\u0435\u043d\u043d\u043e\u043c\u0443 \u043f\u043b\u0430\u043d\u0443.'), 1126),
