(4578, STRINGDECODE('\u042d\u0442\u043e\u0442 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0414\u0430\u043d\u0438\u0438 \u0431\u044b\u043b \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0432 1722 \u0433. \u043f\u043e\u0434 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \"\u0414\u0430\u0442\u0441\u043a\u0430\u044f \u0441\u0446\u0435\u043d\u0430\". \u0421 1748 \u0433. \u0442\u0440\u0443\u043f\u043f\u0430 \u043d\u0430\u0447\u0430\u043b\u0430 \u0440\u0430\u0431\u043e\u0442\u0430\u0442\u044c \u0432 \u043d\u043e\u0432\u043e\u043c \u0437\u0434\u0430\u043d\u0438\u0438 \u043d\u0430 \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u043f\u043b\u043e\u0449\u0430\u0434\u0438.'), 1145);
