(4642, STRINGDECODE('\u042d\u0422\u041e\u0422 \u043f\u043e\u0442\u043e\u043c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0414\u0412\u041e\u0420\u042f\u041d\u0418\u041d \u0440\u043e\u0434\u0438\u043b\u0441\u044f 8 \u044f\u043d\u0432\u0430\u0440\u044f 1856 \u0433\u043e\u0434\u0430, \u043a 19 \u0433\u043e\u0434\u0430\u043c \u043e\u0441\u0442\u0430\u043b\u0441\u044f \u043a\u0440\u0443\u0433\u043b\u044b\u043c \u0441\u0438\u0440\u043e\u0442\u043e\u0439, \u0430 \u0432 20 \u043b\u0435\u0442 \u0431\u044b\u043b \u0432\u043d\u0435 \u043e\u0447\u0435\u0440\u0435\u0434\u0438 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d \u0432 \u0447\u0438\u043d \u0442\u0438\u0442\u0443\u043b\u044f\u0440\u043d\u043e\u0433\u043e \u0441\u043e\u0432\u0435\u0442\u043d\u0438\u043a\u0430.'), 1161),
(4643, STRINGDECODE('\u0412 \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0441\u0432\u043e\u0438\u0445 \u043a\u043e\u043c\u0435\u0434\u0438\u0439 \u041e\u041d \u0437\u0430\u044f\u0432\u0438\u043b: \"\u0411\u044b\u0442\u044c \u043a\u0440\u044b\u043b\u0430\u0442\u044b\u043c \u043e\u0442 \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u043b\u0443\u0447\u0448\u0435 \u0432\u0441\u0435\u0445 \u043d\u0430 \u0441\u0432\u0435\u0442\u0435 \u0431\u043b\u0430\u0433\".'), 1161),
(4644, STRINGDECODE('\u041d\u0435\u043a\u0438\u0439 \u043c\u0438\u043b\u0438\u0446\u0438\u043e\u043d\u0435\u0440 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043d\u0430 \u0432\u0442\u043e\u0440\u043e\u043c \u043c\u0435\u0441\u0442\u0435 \u0432 \u0440\u0435\u0439\u0442\u0438\u043d\u0433\u0435 \u043c\u0438\u043b\u0438\u0446\u0438\u043e\u043d\u0435\u0440\u043e\u0432-\u0440\u043e\u043c\u0430\u043d\u0442\u0438\u043a\u043e\u0432 \u043f\u043e \u0432\u0435\u0440\u0441\u0438\u0438 \"\u041a\u043e\u043c\u0441\u043e\u043c\u043e\u043b\u044c\u0441\u043a\u043e\u0439 \u043f\u0440\u0430\u0432\u0434\u044b\", \u043f\u0440\u0430\u0432\u0434\u0430 \u0441 \u043f\u043e\u043c\u0435\u0442\u043a\u043e\u0439 \"\u0431\u0435\u0437 \u0432\u0442\u043e\u0440\u043e\u0433\u043e \u0437\u0430\u0433\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430 \u0444\u0438\u043b\u044c\u043c\u0430\". \u0410 \u041a\u0410\u041a\u041e\u0413\u041e \u0424\u0418\u041b\u042c\u041c\u0410?'), 1161),
(4645, STRINGDECODE('\u042d\u0422\u041e\u0422 \u041f\u041e\u041b\u0423\u0417\u0410\u0429\u0418\u0422\u041d\u0418\u041a \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u0433\u043e \"\u0428\u0442\u0443\u0442\u0433\u0430\u0440\u0442\u0430\" \u0431\u044b\u043b \u0432\u043a\u043b\u044e\u0447\u0435\u043d \u0432 \u0441\u0438\u043c\u0432\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0441\u0431\u043e\u0440\u043d\u0443\u044e \u0421\u041d\u0413 \u0438 \u0411\u0430\u043b\u0442\u0438\u0438 \u043f\u043e \u0438\u0442\u043e\u0433\u0430\u043c 2004 \u0433\u043e\u0434\u0430.'), 1162),
(4646, STRINGDECODE('\u041f\u043e\u0431\u0435\u0434\u0430 \u042d\u0422\u041e\u0413\u041e \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0412\u0415\u041b\u041e\u0421\u0418\u041f\u0415\u0414\u0418\u0421\u0422\u0410 \u0432 \u0420\u0438\u043c\u0435 \u0432 1960 \u0433\u043e\u0434\u0443 \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044f \u0441\u0442\u043e\u043b\u044c \u0436\u0435 \u0437\u043d\u0430\u043a\u043e\u0432\u043e\u0439 \u0434\u043b\u044f \u0432\u0435\u043b\u043e\u0441\u043f\u043e\u0440\u0442\u0430, \u043a\u0430\u043a \u0438 \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u044b\u0435 \"\u0442\u0440\u0438 \u0441\u0435\u043a\u0443\u043d\u0434\u044b \u041c\u044e\u043d\u0445\u0435\u043d\u0430\" \u0434\u043b\u044f \u0431\u0430\u0441\u043a\u0435\u0442\u0431\u043e\u043b\u0430.'), 1162),
(4647, STRINGDECODE('\u0421\u0442\u0430\u0440\u0448\u0438\u0439 \u0438\u0437 \u041d\u0418\u0425 - \u0413\u0435\u043e\u0440\u0433\u0438\u0439 - \u0431\u044b\u043b \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u043e\u043c \u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b, \u0430 \u0432 \"\u0413\u043e\u0441\u043a\u0438\u043d\u043e\" \u043f\u0440\u0438\u0448\u0435\u043b \u0432 1924 \u0433\u043e\u0434\u0430. \u041c\u043b\u0430\u0434\u0448\u0438\u0439 - \u0421\u0435\u0440\u0433\u0435\u0439 - \u0442\u043e\u0436\u0435 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a \u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b, \u0440\u0430\u0431\u043e\u0442\u0430\u043b \u0432 \u0421\u0435\u0432\u0437\u0430\u043f\u043a\u0438\u043d\u043e \u0434\u043e \u043c\u043e\u043c\u0435\u043d\u0442\u0430 \u0435\u0433\u043e \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044f \u0441 \u0413\u043e\u0441\u043a\u0438\u043d\u043e. \u0410 \u043a\u0430\u043a\u043e\u0432\u0430 \u0438\u0445 \u0444\u0430\u043c\u0438\u043b\u0438\u044f?'), 1162);
