(4648, STRINGDECODE('\u0412 \u0441\u0432\u043e\u0435\u043c \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0435 \u041e\u041d \u043f\u0440\u0438\u043c\u0435\u043d\u044f\u043b \u043f\u0440\u0438\u043d\u0446\u0438\u043f \"\u0434\u0432\u043e\u0439\u043d\u043e\u0439 \u044d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u0438\", \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432\u0438\u0434\u0435\u043d, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u0432 \u0440\u0430\u0431\u043e\u0442\u0430\u0445 \"1918 \u0433\u043e\u0434 \u0432 \u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0435\", \"\u041f\u043e\u0441\u043b\u0435 \u0431\u043e\u044f\" \u0438 \"\u0421\u043c\u0435\u0440\u0442\u044c \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u0430\".'), 1162),
(4649, STRINGDECODE('\u0421 \u042d\u0422\u041e\u0419 \u0426\u0415\u041b\u042c\u042e \u0432 \u0430\u043f\u0440\u0435\u043b\u0435 2005 \u0433\u043e\u0434\u0430 140 \"\u0417\u0418\u041b\u043e\u0432\" \u0431\u044b\u043b\u0438 \u043f\u0435\u0440\u0435\u043e\u0431\u043e\u0440\u0443\u0434\u043e\u0432\u0430\u043d\u044b \u043f\u043e\u0434 \u043c\u0430\u0448\u0438\u043d\u044b \"\u0417\u0438\u0421-5\".'), 1163),
