(4788, STRINGDECODE('\"\u0412\u0441\u0451 \u043e\u0447\u0435\u043d\u044c \u043f\u0440\u043e\u0441\u0442\u043e - \u043d\u0435\u0442 \u0433\u043e\u0440 \u0437\u043e\u043b\u043e\u0442\u044b\u0445. \u041f\u0430\u0434\u0430\u044e\u0442 \u0437\u0432\u0435\u0437\u0434\u044b \u0432 \u0440\u0443\u043a\u0438 \u0434\u0440\u0443\u0433\u0438\u0445...\" \u0423\u0437\u043d\u0430\u043b\u0438? \u0422\u0435\u043f\u0435\u0440\u044c \u043e\u0442\u0432\u0435\u0442\u044c\u0442\u0435: \u041a\u041e\u0413\u041e \u043d\u0435\u0442 \u0441\u0440\u0435\u0434\u0438 \u0432\u043e\u0440\u043e\u043d\u044c\u044f?'), 1197),
