(4888, STRINGDECODE('\u0412 \u0433\u043e\u0431\u043b\u0438\u043d\u0441\u043a\u043e\u043c \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0435 \u0432\u0442\u043e\u0440\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \"\u0412\u043b\u0430\u0441\u0442\u0435\u043b\u0438\u043d\u0430 \u043a\u043e\u043b\u0435\u0446\" \u0432\u0441\u043b\u0435\u0434 \u0437\u0430 \u0440\u0435\u0447\u044c\u044e \u0421\u0430\u0440\u0443\u043c\u044f\u043d\u0430, \u043d\u0430\u043f\u0443\u0442\u0441\u0442\u0432\u0443\u044e\u0449\u0435\u0433\u043e \u0443\u0440\u043e\u043a \u043f\u0435\u0440\u0435\u0434 \u0448\u0442\u0443\u0440\u043c\u043e\u043c \u0425\u0435\u043b\u044c\u043c\u043e\u0432\u043e\u0439 \u043f\u0430\u0434\u0438, \u0437\u0432\u0443\u0447\u0438\u0442 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u044f.'), 1222),
