(4892, STRINGDECODE('\u041f\u043e \u0441\u043b\u043e\u0432\u0430\u043c \u0431\u0438\u043e\u0433\u0440\u0430\u0444\u043e\u0432, \u043d\u0430 \u0412.\u0418. \u041b\u0435\u043d\u0438\u043d\u0430 \u0432 \u044e\u043d\u043e\u0448\u0435\u0441\u0442\u0432\u0435 \u0441\u0438\u043b\u044c\u043d\u043e \u043f\u043e\u0432\u043b\u0438\u044f\u043b\u0430 \u0441\u043c\u0435\u0440\u0442\u044c \u0435\u0433\u043e \u0441\u0435\u0441\u0442\u0440\u044b \u041e\u043b\u044c\u0433\u0438 \u043e\u0442 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u0431\u043e\u043b\u0435\u0437\u043d\u0438.'), 1223);
