(4911, STRINGDECODE('\u041e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u044f\u0435\u043c\u044b\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u0438\u043c\u0438 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u0430 \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u043b\u0438 \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c \u043d\u0435\u043a\u043e\u0435\u0433\u043e \"\u0441\u0442\u0430\u0440\u0446\u0430 \u0441 \u0433\u043e\u0440\".'), 1228),
(4912, STRINGDECODE('\u041f\u043e\u0441\u043b\u0435 \u0434\u0432\u0443\u0445 \u043f\u043e\u0434\u0440\u044f\u0434 \u0430\u0432\u0442\u043e\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444 1952 \u0433. \u0438 \u043c\u043d\u043e\u0433\u043e\u043a\u0440\u0430\u0442\u043d\u043e\u0433\u043e \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u043c\u043e\u0440\u0444\u0438\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u043e\u043d\u0430 \u043f\u043e\u043f\u0430\u043b\u0430 \u0432 \u043d\u0430\u0440\u043a\u043e\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c, \u043e\u0442 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043d\u0435 \u0441\u0443\u043c\u0435\u043b \u0438\u0437\u0431\u0430\u0432\u0438\u0442\u044c \u0434\u0430\u0436\u0435 \u0447\u0435\u0442\u044b\u0440\u0435\u0445\u043b\u0435\u0442\u043d\u0438\u0439 \u0431\u0440\u0430\u043a \u0441 \u0416\u0430\u043a\u043e\u043c \u041f\u0438\u043b\u0441\u043e\u043c.'), 1228),
(4913, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u043e\u043c \u043a\u043b\u0438\u043f\u0435 \u0430\u043d\u0433\u0435\u043b \u0441\u043d\u0430\u0447\u0430\u043b\u0430 \u0441\u043e \u0441\u043c\u0430\u043a\u043e\u043c \u043e\u043f\u0440\u043e\u043a\u0438\u0434\u044b\u0432\u0430\u0435\u0442 \u0441\u043f\u0438\u0440\u0442\u043d\u043e\u0439 \u043d\u0430\u043f\u0438\u0442\u043e\u043a \u0432\u043f\u0440\u0438\u043a\u0443\u0441\u043a\u0443 \u0441 \u043b\u0438\u043c\u043e\u043d\u043e\u043c \u0438 \u0449\u0435\u043f\u043e\u0442\u044c\u044e \u0441\u043e\u043b\u0438, \u0430 \u043f\u043e\u0442\u043e\u043c \u043e\u0431\u043c\u0430\u043d\u044b\u0432\u0430\u0435\u0442 \u041a\u0438\u043d\u0447\u0435\u0432\u0430.'), 1229),
