(4915, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u043c\u0443 \"\u0432\u0435\u0447\u043d\u043e \u0432\u0442\u043e\u0440\u043e\u043c\u0443\" \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0430\u0442 \u0442\u0430\u043a\u0438\u0435 \u0435\u043c\u043a\u0438\u0435 \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f, \u043a\u0430\u043a \"\u0418\u0441\u0442\u043e\u0440\u0438\u044f \u0418\u0440\u043b\u0430\u043d\u0434\u0438\u0438\" (1870), \"\u041a \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0434\u0440\u0435\u0432\u043d\u0438\u0445 \u0433\u0435\u0440\u043c\u0430\u043d\u0446\u0435\u0432\", \"\u041c\u0430\u0440\u043a\u0430\", \"\u0424\u0440\u0430\u043d\u043a\u0441\u043a\u0438\u0439 \u043f\u0435\u0440\u0438\u043e\u0434\" (\u0432\u0441\u0435 \u0442\u0440\u0438 - 1881-82), \"\u041a \u0436\u0438\u043b\u0438\u0449\u043d\u043e\u043c\u0443 \u0432\u043e\u043f\u0440\u043e\u0441\u0443\" (1872-73) \u0438 \"\u041f\u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0432\u043e\u0434\u043a\u0430 \u0432 \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u043c \u0440\u0435\u0439\u0445\u0441\u0442\u0430\u0433\u0435\" (1876).'), 1229),
(4916, STRINGDECODE('\u041d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0439 \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u043e\u0439 \u043a\u043e\u043c\u0430\u043d\u0434\u044b - \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0442\u0440\u0438\u0443\u043c\u0444\u0430 \u0416\u043e\u0437\u0435 \u041c\u043e\u0443\u0440\u0438\u043d\u044c\u043e, \u043f\u0440\u043e\u0437\u0432\u0443\u0447\u0430\u0432\u0448\u0435\u0435 \u0438\u0437 \u0443\u0441\u0442 \u0432\u043b\u0430\u0434\u0435\u043b\u044c\u0446\u0430 \u0448\u0445\u0443\u043d\u044b, \u0443\u0441\u043f\u043e\u043a\u043e\u0438\u043b\u043e \u0431\u044b\u043b\u043e \u0434''\u0410\u0440\u0442\u0430\u043d\u044c\u044f\u043d\u0430. \u0410 \u0437\u0440\u044f, \u0432\u0435\u0434\u044c \u043d\u0430 \u0441\u0430\u043c\u043e\u043c \u0434\u0435\u043b\u0435 \u0442\u0430\u043c \u0431\u044b\u043b \u043f\u043e\u0440\u043e\u0445, \u0430 \u043d\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e.'), 1229),
(4917, STRINGDECODE('\u0411\u0435\u0437\u0430\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u044c \u043f\u0440\u0435\u0441\u0441\u044b \u043d\u0430\u0442\u043e\u043b\u043a\u043d\u0443\u043b\u0430 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u043d\u0430 \u044d\u0442\u043e\u0442 \u0432\u044b\u0432\u043e\u0434.'), 1230),
(4918, STRINGDECODE('16 \u044f\u043d\u0432\u0430\u0440\u044f 1991 \u0433. \u0433\u0430\u0437\u0435\u0442\u0430 \"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0435 \u043d\u043e\u0432\u043e\u0441\u0442\u0438\" \u0432\u044b\u0448\u043b\u0430 \u0432 \u0442\u0440\u0430\u0443\u0440\u043d\u043e\u0439 \u0440\u0430\u043c\u043a\u0435 \u0441 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u043e\u043c \u043d\u0430 \u043f\u0435\u0440\u0432\u043e\u0439 \u043f\u043e\u043b\u043e\u0441\u0435 \"\u041f\u0440\u0435\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 \u0440\u0435\u0436\u0438\u043c\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043d\u0435 \u0445\u043e\u0447\u0435\u0442 \u0441\u0445\u043e\u0434\u0438\u0442\u044c \u0441\u043e \u0441\u0446\u0435\u043d\u044b\". \u0410 \u0431\u044b\u043b\u043e \u044d\u0442\u043e \u043f\u043e\u0441\u043b\u0435 \u0442\u0440\u0430\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0441\u043e\u0431\u044b\u0442\u0438\u0439 \u0438\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0435.'), 1230),
(4919, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0433\u043b\u0430\u0432\u043d\u044b\u0439 \u0440\u0435\u0434\u0430\u043a\u0442\u043e\u0440 \u0437\u0430\u043a\u0440\u044b\u0442\u043e\u0439 \u043f\u043e \u0446\u0435\u043d\u0437\u0443\u0440\u043d\u044b\u043c \u0441\u043e\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u044f\u043c \"\u0411\u0430\u043c\u0431\u0435\u0440\u0433\u0441\u043a\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u044b\" \u0432 \u0411\u0430\u0432\u0430\u0440\u0438\u0438 \u043f\u043e\u0437\u0436\u0435 \u0431\u044b\u043b \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u043e\u043c \u0436\u0435\u043d\u0441\u043a\u043e\u0439 \u0433\u0438\u043c\u043d\u0430\u0437\u0438\u0438 \u0432 \u041d\u044e\u0440\u043d\u0431\u0435\u0440\u0433\u0435 \u0438 \u043e\u0442\u0432\u0440\u0430\u0442\u043d\u044b\u043c \u043b\u0435\u043a\u0442\u043e\u0440\u043e\u043c, \u0445\u043e\u0442\u044f \u0441 \"\u043d\u0430\u0443\u043a\u043e\u0439 \u043b\u043e\u0433\u0438\u043a\u0438\" \u0443 \u043d\u0435\u0433\u043e, \u0441\u0443\u0434\u044f \u043f\u043e \u0432\u0441\u0435\u043c\u0443, \u0431\u044b\u043b\u043e \u043e\u0447\u0435\u043d\u044c \u0434\u0430\u0436\u0435 \u043d\u0435\u043f\u043b\u043e\u0445\u043e.'), 1230);
