(4972, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438\u043c \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u0438\u043b\u0441\u044f \u042f\u043d \u0411\u0430\u043f\u0442\u0438\u0441\u0442 \u0432\u0430\u043d \u0413\u0435\u043b\u044c\u043c\u043e\u043d\u0442 (1579-1644), \u043d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0439 \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u043e\u0438\u0441\u043f\u044b\u0442\u0430\u0442\u0435\u043b\u044c, \u0432\u0438\u0434\u043d\u044b\u0439 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044c \u044f\u0442\u0440\u043e\u0445\u0438\u043c\u0438\u0438 \u0438 \u0432\u0438\u0442\u0430\u043b\u0438\u0437\u043c\u0430.'), 1243),
