(4993, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u041e\u041d\u0410 \u0432\u043e\u0441\u043f\u0435\u043b\u0430 \u043e\u0434\u0443 \u0431\u0430\u043b\u0435\u0442\u0443, \u0442\u0440\u0438\u0436\u0434\u044b \u0432 \u043f\u0440\u0438\u043f\u0435\u0432\u0435 \u0441\u0432\u043e\u0435\u0439 \u043f\u0435\u0441\u043d\u0438 \u0443\u043f\u043e\u043c\u044f\u043d\u0443\u0432 \u0435\u0433\u043e.'), 1249),
