(4998, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0438\u0445 \u0432 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438 \"\u0433\u043b\u043e\u0442\u043a\u043e\u0439 \u0413\u0435\u0431\u0431\u0435\u043b\u044c\u0441\u0430\", \u0430 \u0438\u0445 \u0430\u043d\u0430\u043b\u043e\u0433\u0430\u043c\u0438 \u0432 \u043c\u0438\u0440\u0435 \u041e\u0440\u0443\u044d\u043b\u043b\u0430 \u0431\u044b\u043b\u0438 \u043c\u043e\u043d\u0438\u0442\u043e\u0440\u044b.'), 1250),
(4999, STRINGDECODE('\u0412 \u0441\u0446\u0435\u043d\u0435 \u043f\u043e\u0434 \u044d\u0442\u0438\u043c \u043c\u043d\u043e\u0433\u0438\u0435 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0435 \u0447\u0438\u043d\u043e\u0432\u043d\u0438\u043a\u0438 \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0438 \u043d\u0435\u043f\u0440\u0438\u043a\u0440\u044b\u0442\u0443\u044e \u044d\u0440\u043e\u0442\u0438\u043a\u0443. \u0412 \u043a\u043e\u043c\u0435\u0434\u0438\u0438-\u0442\u043e \u0413\u0430\u0439\u0434\u0430\u044f!'), 1250),
