(5001, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0430\u0432\u0442\u043e\u0440 \u0440\u0430\u0431\u043e\u0442 \"\u0411\u0440\u0443\u0442\", \"\u041e\u0440\u0430\u0442\u043e\u0440\", \"\u041e \u043d\u0430\u0438\u043b\u0443\u0447\u0448\u0435\u043c \u0432\u0438\u0434\u0435 \u043e\u0440\u0430\u0442\u043e\u0440\u043e\u0432\" \u0431\u044b\u043b \u0443\u0431\u0438\u0442 7 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 43 \u0433\u043e\u0434\u0430 \u0434\u043e \u043d.\u044d. \u043f\u043e \u043d\u0430\u0441\u0442\u043e\u044f\u043d\u0438\u044e \u041c\u0430\u0440\u043a\u0430 \u0410\u043d\u0442\u043e\u043d\u0438\u044f.'), 1251);
