(5010, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438\u043c \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \u0434\u043d\u0435\u0432\u043d\u043e\u0439 \u044e\u0436\u043d\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0431\u0430\u0431\u043e\u0447\u043a\u0438 \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0438\u043b\u0438 \u0432 \u043d\u0435\u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0435 \u0445/\u0444 \"\u0425\u0440\u043e\u043d\u0438\u043a\u0438 \u041d\u0430\u0440\u043d\u0438\u0438\" \u0444\u0430\u0432\u043d\u0430 \u0422\u0443\u043c\u043d\u0443\u0441\u0430.'), 1253),
(5011, STRINGDECODE('\u041c\u044b \u043d\u0435 \u0437\u043d\u0430\u0435\u043c \u043e \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043f\u0430\u043c\u044f\u0442\u0438 \u0443 \u044d\u0442\u043e\u0439 \u0434\u043d\u0435\u0432\u043d\u043e\u0439 \u0431\u0430\u0431\u043e\u0447\u043a\u0438, \u043d\u043e, \u0441\u0443\u0434\u044f \u043f\u043e \u0438\u043c\u0435\u043d\u0438, \u043f\u043e\u043a\u0440\u043e\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u0430 \u043e \u043d\u0435\u0439 \u0432\u0440\u044f\u0434 \u043b\u0438 \u0437\u0430\u0431\u044b\u0432\u0430\u0435\u0442.'), 1253),
(5012, STRINGDECODE('\u041f\u0440\u0435\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0434\u0440\u0443\u0433\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u0443 \u0440\u0430\u0441\u0444\u0440\u0430\u043d\u0447\u0435\u043d\u043d\u0443\u044e \u0431\u0430\u0431\u043e\u0447\u043a\u0443 \u042e\u0440\u0438\u0439 \u0411\u0430\u0440\u0430\u043d\u043a\u0438\u043d \u0432\u043e\u0441\u043f\u0440\u0438\u043d\u044f\u043b \u0441 \u0432\u043e\u0441\u0442\u043e\u0440\u0433\u043e\u043c \u0438 \u0434\u0430\u0436\u0435 \u043d\u0430\u0447\u0430\u043b \u0434\u0440\u0430\u0437\u043d\u0438\u0442\u044c \u0442\u043e\u0433\u043e \"\u0434\u0435\u0432\u0447\u043e\u043d\u043e\u0447\u044c\u0435\u0439\" \u0440\u0430\u0441\u043a\u0440\u0430\u0441\u043a\u043e\u0439.'), 1253),
(5013, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0435\u043d\u0438\u0435 \u0420\u0435\u0439\u043d\u0441\u043a\u0438\u0445 \u0421\u043b\u0430\u043d\u0446\u0435\u0432\u044b\u0445 \u0433\u043e\u0440 \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u044f\u043d\u0432\u0430\u0440\u044f \u0432 \u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0435 XX \u0432\u0435\u043a\u0430 \u0441\u0442\u0430\u043b\u043e \u0441\u0438\u043c\u0432\u043e\u043b\u043e\u043c \u043f\u043e\u0437\u043e\u0440\u043d\u043e\u0433\u043e \u0431\u0435\u0433\u0441\u0442\u0432\u0430.'), 1254),
(5014, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u0431\u043e\u043b\u0433\u0430\u0440\u0441\u043a\u0430\u044f \u0433\u043e\u0440\u043d\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0443\u043f\u043e\u043c\u0438\u043d\u0430\u043b\u0430\u0441\u044c \u0432 \u0440\u0438\u043c\u0441\u043a\u043e\u043c \u043f\u0440\u043e\u0437\u0432\u0438\u0449\u0435 \u0441\u0435\u0441\u0442\u0440\u044b \u0421\u043f\u0430\u0440\u0442\u0430\u043a\u0430, \u043f\u043e \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443 \u0414\u0436\u043e\u0432\u0430\u043d\u044c\u043e\u043b\u0438.'), 1254),
(5015, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0433\u043e\u0440\u043d\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0432 \u0418\u043d\u0434\u0438\u0438 \u0438 \u041a\u0438\u0442\u0430\u0435, \u043c\u0435\u0436\u0434\u0443 \u041f\u0430\u043c\u0438\u0440\u043e\u043c \u0438 \u041a\u0443\u043d\u044c\u043b\u0443\u043d\u0435\u043c \u043d\u0430 \u0441\u0435\u0432\u0435\u0440\u0435, \u0413\u0438\u043c\u0430\u043b\u0430\u044f\u043c\u0438 \u0438 \u0413\u0430\u043d\u0434\u0438\u0441\u044b\u0448\u0430\u043d\u0435\u043c \u043d\u0430 \u044e\u0433\u0435, \u0441 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u0438\u043c\u0438 \u0432\u043e\u0441\u044c\u043c\u0438\u0442\u044b\u0441\u044f\u0447\u043d\u0438\u043a\u0430\u043c\u0438, \u044f\u0432\u043b\u044f\u044e\u0449\u0430\u044f\u0441\u044f \u0442\u0435\u0437\u043a\u043e\u0439 \u043d\u0435\u043a\u043e\u0435\u0433\u043e \u0425\u0430\u0440\u0430-\u0425\u043e\u0440\u0438\u043d\u0430.'), 1254);
