(5016, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0433\u043e\u0440\u043d\u044b\u0439 \u043c\u0430\u0441\u0441\u0438\u0432 \u0432 \u041f\u043e\u043b\u044c\u0448\u0435 \u0438 \u0421\u043b\u043e\u0432\u0430\u043a\u0438\u0438 \u043e\u0431\u0435\u0449\u0430\u043b \u043f\u0440\u043e\u0439\u0442\u0438 \u0432 \u043f\u043e\u0438\u0441\u043a\u0430\u0445 \u0441\u0432\u043e\u0435\u0439 \u043b\u044e\u0431\u0432\u0438 \u043b\u0438\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0433\u0435\u0440\u043e\u0439 \"\u041f\u043b\u0430\u0447\u0430 \u0419\u0435\u0440\u0435\u043c\u0438\u0438\".'), 1254),
(5017, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0431\u044b\u043b\u0438 \u0442\u0443\u0440\u0438\u0441\u0442\u044b \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u0442\u043e\u043b\u044c\u043a\u043e \u0447\u0442\u043e \u043f\u0440\u043e\u0446\u0438\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u043c\u0443 \u0430\u043d\u0435\u043a\u0434\u043e\u0442\u0443.'), 1255),
(5018, STRINGDECODE('\u0412 \u043f\u043e\u0433\u043e\u043d\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u0437\u0430 \u044d\u0442\u043e\u0439 \u0431\u0443\u043c\u0430\u0436\u043a\u043e\u0439 \u0434\u0432\u0443\u043c \u0433\u0440\u0443\u043f\u043f\u0430\u043c \u0438\u0437 \u0442\u0440\u0435\u0445 \u0438 \u0434\u0432\u0443\u0445 \u043b\u044e\u0434\u0435\u0439 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043d\u0435\u0432\u043e\u043b\u044c\u043d\u043e \u043f\u0440\u0438\u0448\u043b\u043e\u0441\u044c \u043f\u0440\u043e\u0439\u0442\u0438 \u0433\u043e\u0440\u043d\u044b\u0439 \u0442\u0443\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442, \u0447\u0442\u043e\u0431\u044b \u0434\u043e\u0433\u043d\u0430\u0442\u044c \u043d\u0435\u043a\u043e\u0435\u0433\u043e \u041c\u0438\u0448\u0443.'), 1255),
(5019, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438 \u0434\u0432\u0435 \u0441\u0442\u0430\u0442\u044c\u0438 \u0432 \u0411\u042d\u0421, \u043f\u043e\u0447\u0442\u0438 \u0430\u043a\u0442\u0443\u0430\u043b\u044c\u043d\u044b\u0435 \u043d\u0430 \u0434\u0430\u043d\u043d\u044b\u0439 \u043c\u043e\u043c\u0435\u043d\u0442, \u0440\u0430\u0437\u0434\u0435\u043b\u044f\u0435\u0442 \u043b\u0438\u0448\u044c \u0441\u0442\u0430\u0442\u044c\u044f \u043e \u0448\u0432\u0435\u0434\u0441\u043a\u043e\u043c \u043f\u043e\u044d\u0442\u0435-\u0441\u0435\u043d\u0442\u0438\u043c\u0435\u043d\u0442\u0430\u043b\u0438\u0441\u0442\u0435 \u0422\u043e\u043c\u0430\u0441\u0435 \u0422\u0443\u0440\u0438\u043b\u044c\u0434\u0435.'), 1255),
(5020, STRINGDECODE('\u0412 \u044d\u0442\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u043e\u043a\u043e\u043b\u043e 120 \u0441\u0442\u0440\u0430\u043d, \u0430 \u043f\u043e \u0435\u0435 \u0430\u0431\u0431\u0440\u0435\u0432\u0438\u0430\u0442\u0443\u0440\u0435 \u043c\u043e\u0436\u043d\u043e \u043f\u043e\u0434\u0443\u043c\u0430\u0442\u044c, \u0447\u0442\u043e \u0432 \u043d\u0435\u0439 \u043d\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u0442 \u043b\u0438\u0448\u044c \u0420\u043e\u0441\u0441\u0438\u044f, \u041a\u0438\u0442\u0430\u0439, \u0423\u043a\u0440\u0430\u0438\u043d\u0430 \u0438 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0431\u043e\u043b\u0435\u0435 \u043c\u0435\u043b\u043a\u0438\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430, \u0445\u043e\u0442\u044f \u0438 \u043e\u0447\u0435\u043d\u044c \u0445\u043e\u0442\u044f\u0442 \u0431\u044b\u0442\u044c \u0432 \u043d\u0435\u0439.'), 1255),
(5021, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \"\u044d\u0442\u0430 \u043a\u0440\u0430\u0441\u043e\u0442\u0430\" \u0431\u044b\u043b\u0430 \u043f\u0440\u043e\u043a\u043b\u044f\u0442\u0430 \u0445\u043e\u0437\u044f\u0438\u043d\u043e\u043c \u0448\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u043a\u043e\u0439 \u0433\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u044b - \u0431\u044b\u0432\u0448\u0438\u043c \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0438\u043d\u043e\u043c, \u043b\u044e\u0431\u043e\u0432\u0430\u0432\u0448\u0438\u043c\u0441\u044f \u043d\u0430 \u043d\u0435\u0435 \u043c\u0438\u043b\u043e\u0441\u0442\u044c\u044e \u0434\u0440\u0443\u0433\u043e\u0433\u043e \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0438\u043d\u0430.'), 1256);
