(5022, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0437\u0430\u043c\u0431\u0435\u0437\u0438\u0439\u0441\u043a\u0438\u0439 \u043f\u043e\u0447\u0442\u0438 \u0434\u0432\u0443\u0445\u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u043e\u0432\u044b\u0439 \u0432 \u0448\u0438\u0440\u0438\u043d\u0443 \u0432\u043e\u0434\u043e\u043f\u0430\u0434 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u0433\u043b\u0430\u0432\u043d\u044b\u0445 \u0442\u0443\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0446\u0435\u043d\u0442\u0440\u043e\u0432 \u0432 \u042e\u0436\u043d\u043e\u0439 \u0410\u0444\u0440\u0438\u043a\u0435.'), 1256),
(5023, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0439 \u0432\u043e\u0434\u043e\u043f\u0430\u0434 \u0432 \u0419\u0435\u043b\u043b\u043e\u0443\u0441\u0442\u043e\u043d\u0441\u043a\u043e\u043c \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u043c \u043f\u0430\u0440\u043a\u0435, \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0439 \u043d\u0430 1200-\u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u043e\u0432\u043e\u043c \u043f\u0440\u0430\u0432\u043e\u043c \u043f\u0440\u0438\u0442\u043e\u043a\u0435 \u041c\u0438\u0441\u0441\u0443\u0440\u0438.'), 1256),
