(5065, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u043e\u0431\u043b\u0430\u0434\u0430\u0442\u0435\u043b\u044c \u0442\u0435\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0444\u0430\u043c\u0438\u043b\u0438\u0438 \u0432\u044b\u0441\u043c\u0435\u0438\u0432\u0430\u043b \u0431\u043b\u0438\u043d\u043d\u0443\u044e \u0442\u0435\u043e\u0440\u0438\u044e \u0434\u0438\u043b\u0435\u0442\u0430\u043d\u0442\u0430.'), 1267),
(5066, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0433\u043b\u0430\u0432\u043d\u0430\u044f \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043e\u0431\u0441\u0435\u0440\u0432\u0430\u0442\u043e\u0440\u0438\u044f \u0420\u0410\u041d, \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u0432 1839 \u0433.'), 1267);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(5067, STRINGDECODE('\u0423 \u0418\u0432\u0430\u043d\u0430 \u0415\u0444\u0440\u0435\u043c\u043e\u0432\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0422\u0430\u043c\u0430\u0441\u043e\u043c, \u0432 \u0447\u0435\u0441\u0442\u044c \u043e\u043a\u0435\u0430\u043d\u0430 \u0431\u0435\u0437\u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u044d\u043d\u0435\u0440\u0433\u0438\u0438 \u0432 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0440\u0435\u043b\u0438\u0433\u0438\u0438, \u0430 \u0432 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0439 \u043d\u0430\u0443\u043a\u0435 \u043e\u043d \u0434\u043e \u0441\u0438\u0445 \u043f\u043e\u0440 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0433\u0438\u043f\u043e\u0442\u0435\u0437\u043e\u0439.'), 1267),
(5068, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0435\u0433\u043e \u0444\u0443\u043d\u0434\u0430\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u0442\u0440\u0443\u0434 \"\u0422\u0435\u043e\u0440\u0438\u044f \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f \u043d\u0435\u0431\u0435\u0441\u043d\u044b\u0445 \u0442\u0435\u043b\", \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0438\u0437\u043b\u043e\u0436\u0435\u043d\u044b \u043c\u0435\u0442\u043e\u0434\u044b \u0432\u044b\u0447\u0438\u0441\u043b\u0435\u043d\u0438\u044f \u043f\u043b\u0430\u043d\u0435\u0442\u043d\u044b\u0445 \u043e\u0440\u0431\u0438\u0442, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u043c\u044b\u0435 (\u0441 \u043d\u0435\u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438 \u0443\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f\u043c\u0438) \u0438 \u043f\u043e\u043d\u044b\u043d\u0435, \u0432\u044b\u0448\u0435\u043b \u0432 1809 \u0433\u043e\u0434\u0443.'), 1267),
(5069, STRINGDECODE('\u041d\u0430 \u043c\u0440\u0430\u043c\u043e\u0440\u043d\u043e\u0439 \u0441\u0442\u0435\u043d\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u044f \u0421\u043e\u0441\u0442\u0440\u0430\u0442 \u041a\u043d\u0438\u0434\u0441\u043a\u0438\u0439 \u0432\u044b\u0441\u0435\u043a \u043d\u0430\u0434\u043f\u0438\u0441\u044c: \"\u0421\u043e\u0441\u0442\u0440\u0430\u0442, \u0441\u044b\u043d \u0414\u0435\u043a\u0441\u0438\u0444\u0430\u043d\u0430 \u0438\u0437 \u041a\u043d\u0438\u0434\u0430, \u043f\u043e\u0441\u0432\u044f\u0442\u0438\u043b \u0431\u043e\u0433\u0430\u043c-\u0441\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044f\u043c \u0440\u0430\u0434\u0438 \u043c\u043e\u0440\u0435\u0445\u043e\u0434\u043e\u0432\".'), 1268),
(5070, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0432 \u0414\u0440\u0435\u0432\u043d\u0435\u0439 \u0413\u0440\u0435\u0446\u0438\u0438 \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0430\u0441\u044c \u0436\u0435\u043d\u0441\u043a\u0430\u044f \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0430 \u0432 \u0437\u0430\u0434\u043d\u0435\u0439 \u0447\u0430\u0441\u0442\u0438 \u0434\u043e\u043c\u0430.'), 1268),
(5071, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438 \u043f\u043e\u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u0423\u0440\u0430\u043d\u0430 \u0438 \u0413\u0435\u0438 \u0432\u043d\u0435\u0441\u043b\u0438 \u0440\u0435\u0448\u0430\u044e\u0449\u0438\u0439 \u0432\u043a\u043b\u0430\u0434 \u0432 \u043f\u043e\u0431\u0435\u0434\u0443 \u0431\u043e\u0433\u043e\u0432 \u043d\u0430\u0434 \u0442\u0438\u0442\u0430\u043d\u0430\u043c\u0438.'), 1268),
(5072, STRINGDECODE('\u041f\u0435\u0440\u0435\u0434 \u0421\u0430\u043b\u0430\u043c\u0438\u043d\u0441\u043a\u0438\u043c \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\u043c \u0433\u0440\u0435\u043a\u0438, \u043f\u043e \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443 \u0413\u0435\u0440\u043e\u0434\u043e\u0442\u0430, \u043f\u043e\u043c\u0438\u043c\u043e \u0431\u043e\u0433\u043e\u0432, \u0432\u043e\u0437\u0437\u0432\u0430\u043b\u0438 \u0435\u0449\u0435 \u0438 \u043a \u044d\u0442\u0438\u043c \u0434\u0432\u0443\u043c \u0433\u0435\u0440\u043e\u044f\u043c, \u043e\u0442\u0446\u0443 \u0438 \u0441\u044b\u043d\u0443, \u0434\u0430\u0440\u043e\u043c \u0447\u0442\u043e \u0441\u044b\u043d\u0443\u043b\u044f \u0438\u043d\u043e\u0433\u0434\u0430 \u0431\u044b\u043b \u043d\u0435 \u0441\u043e\u0432\u0441\u0435\u043c \u0434\u0440\u0443\u0436\u0435\u043d \u0441 \u0433\u043e\u043b\u043e\u0432\u043e\u0439.'), 1268);
