(5078, STRINGDECODE('\u0414\u0430\u0436\u0435 \u0435\u0441\u043b\u0438 \u0432\u044b \u043d\u0435 \u0438\u0437 \u043e\u0434\u0435\u0441\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u0430\u043d\u0434\u044b, \u043e\u0442\u0432\u0435\u0442\u044c\u0442\u0435, \u043a\u0430\u043a \u0432 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0431\u0438\u043b\u043b\u0438\u0430\u0440\u0434\u043d\u044b\u0445 \u0438\u0433\u0440\u0430\u0445 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0443\u0434\u0430\u0440, \u043a\u043e\u0433\u0434\u0430 \u0434\u0432\u0430 \u0448\u0430\u0440\u0430 \u043f\u043e\u043f\u0430\u0434\u0430\u044e\u0442 \u0432 \u043b\u0443\u0437\u044b \u043e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e.'), 1270),
