(5080, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438\u043c \u043a\u0440\u0430\u0442\u043a\u0438\u043c \u0441\u043b\u043e\u0432\u043e\u043c \u0432 \u0431\u0438\u043b\u043b\u0438\u0430\u0440\u0434\u0435 \u043d\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u043f\u043b\u043e\u0445\u043e\u0439 \u0443\u0434\u0430\u0440.'), 1270);
