(5123, STRINGDECODE('\u041c\u0430\u0441\u0442\u0435\u0440 \u0441\u0432\u043e\u0435\u0433\u043e \u0434\u0435\u043b\u0430, \u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c \u0421\u0442\u0435\u0439\u043d\u0438\u0446 \u0432\u0441\u043a\u043e\u0440\u0435 \u043f\u043e\u0441\u043b\u0435 \u0441\u0432\u043e\u0435\u0433\u043e \u0432\u0442\u043e\u0440\u043e\u0433\u043e \u043c\u0430\u0442\u0447\u0430 \u043f\u0440\u043e\u0442\u0438\u0432 \u041b\u0430\u0441\u043a\u0435\u0440\u0430 \u043e\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u043e\u043c \u0437\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u0438. \u0414\u0430 \u0438 \u0434\u043e\u0436\u0438\u0432\u0430\u043b \u043e\u043d \u0441\u0432\u043e\u044e \u0436\u0438\u0437\u043d\u044c \u043d\u0435\u0441\u0447\u0430\u0441\u0442\u043d\u044b\u0439, \u043d\u0438\u0449\u0438\u0439 \u0438, \u0432 \u0441\u0443\u0449\u043d\u043e\u0441\u0442\u0438, \u0431\u0435\u0437\u0434\u043e\u043c\u043d\u044b\u0439.'), 1281);
