(5124, STRINGDECODE('\u0421\u0430\u043c\u044b\u0439 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439, \u0435\u0441\u043b\u0438 \u0441\u0443\u0434\u0438\u0442\u044c \u043f\u043e \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u0443 \u043f\u0430\u0440\u0442\u0438\u0439, \u043c\u0430\u0442\u0447 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0431\u043e\u0440\u044c\u0431\u044b \u0437\u0430 \u0448\u0430\u0445\u043c\u0430\u0442\u043d\u0443\u044e \u043a\u043e\u0440\u043e\u043d\u0443 \u0441\u044b\u0433\u0440\u0430\u043b\u0438, \u043a\u0430\u043a \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e, \u041a\u0430\u0440\u043f\u043e\u0432 \u0438 \u041a\u0430\u0441\u043f\u0430\u0440\u043e\u0432 - 48 \u043f\u0430\u0440\u0442\u0438\u0439. \u041d\u0430 \u0432\u0442\u043e\u0440\u043e\u043c \u043c\u0435\u0441\u0442\u0435 - 34 \u043f\u0430\u0440\u0442\u0438\u0438 - \u0431\u0438\u0442\u0432\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438\u0445 \u0438\u0433\u0440\u043e\u043a\u043e\u0432.'), 1281),
