(5484, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0441\u043e\u0443\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c \u0444\u0438\u0440\u043c\u044b \"\u042e\u043d\u0430\u0439\u0442\u0435\u0434 \u0430\u0440\u0442\u0438\u0441\u0442\u0441\" \u0438 \u043c\u0443\u0436 \u041c\u044d\u0440\u0438 \u041f\u0438\u043a\u0444\u043e\u0440\u0434, \u043e\u0434\u0438\u043d \u0438\u0437 \u0441\u0435\u043a\u0441-\u0441\u0438\u043c\u0432\u043e\u043b\u043e\u0432 \u043d\u0435\u043c\u043e\u0433\u043e \u043a\u0438\u043d\u043e, \u0441\u044b\u0433\u0440\u0430\u043b \u0433\u043b\u0430\u0432\u043d\u044b\u0435 \u0440\u043e\u043b\u0438 \u0432 \u043a\u0430\u0440\u0442\u0438\u043d\u0430\u0445 \"\u0417\u043d\u0430\u043a \u0417\u043e\u0440\u0440\u043e\", \"\u0420\u043e\u0431\u0438\u043d \u0413\u0443\u0434\" \u0438 \"\u0411\u0430\u0433\u0434\u0430\u0434\u0441\u043a\u0438\u0439 \u0432\u043e\u0440\", \u0441\u0442\u0430\u0432\u0448\u0438\u0435 \u0432\u0435\u0440\u0448\u0438\u043d\u043e\u0439 \u0435\u0433\u043e \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u0430\u0440\u044c\u0435\u0440\u044b.'), 1371);
