(5485, STRINGDECODE('\u041f\u043e\u0441\u043b\u0435 \u0434\u0443\u0431\u043b\u044f \u0432 \u0432\u043e\u0440\u043e\u0442\u0430 \u0431\u0440\u0430\u0437\u0438\u043b\u044c\u0446\u0435\u0432 \u0432 \u0440\u0435\u0448\u0430\u044e\u0449\u0435\u043c \u043c\u0430\u0442\u0447\u0435 \u0427\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u0430 \u043c\u0438\u0440\u0430 1998 \u0433. \u0415\u0413\u041e \u0441\u0442\u0430\u043b\u0438 \u043d\u0430\u0437\u044b\u0432\u0430\u0442\u044c \"\u043d\u043e\u0432\u044b\u043c \u041f\u043b\u0430\u0442\u0438\u043d\u0438\".'), 1372),
(5486, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u0440\u043e\u0441\u043b\u0430\u044f \u0437\u0432\u0435\u0437\u0434\u0430 \u0444\u0438\u043b\u044c\u043c\u043e\u0432 \"\u0411\u0435\u0433\u043b\u0435\u0446\u044b\", \"\u041f\u0430\u043f\u0430\u0448\u0438\" \u0438 \"\u041d\u0435 \u0443\u043f\u0443\u0441\u043a\u0430\u0439 \u0438\u0437 \u0432\u0438\u0434\u0443\" \u0432 1995 \u0433. \u0441\u043d\u044f\u043b\u0430\u0441\u044c \u0432 \u043a\u0438\u043d\u043e\u043a\u043e\u043c\u0435\u0434\u0438\u0438 \u0433\u0440\u0443\u0437\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0430 \u041d. \u0414\u0436\u043e\u0440\u0434\u0436\u0430\u0434\u0437\u0435 \"\u0422\u044b\u0441\u044f\u0447\u0430 \u0438 \u043e\u0434\u0438\u043d \u0440\u0435\u0446\u0435\u043f\u0442 \u0432\u043b\u044e\u0431\u043b\u0435\u043d\u043d\u043e\u0433\u043e \u043a\u0443\u043b\u0438\u043d\u0430\u0440\u0430\".'), 1372),
(5487, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0435\u0440 \u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0432 \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u0441 1665 \u0433. \u0441\u0438\u043b\u044c\u043d\u043e \u043f\u043e\u0441\u043f\u043e\u0441\u043e\u0431\u0441\u0442\u0432\u043e\u0432\u0430\u043b \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u044e \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043d\u0430\u0443\u043a, \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043c\u0443\u0437\u044b\u043a\u0438 \u0438 \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u044b, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 18 \u043b\u0435\u0442 \u0444\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u043b \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0435\u0439 \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u043e\u0439 \u0424\u0440\u0430\u043d\u0446\u0438\u0438.'), 1372),
(5488, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u043b\u0430\u0443\u0440\u0435\u0430\u0442 \u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u041b\u0435\u043d\u0438\u043d\u0441\u043a\u043e\u0439 \u043f\u0440\u0435\u043c\u0438\u0438 \u0437\u0430 1957 \u0433. \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0442\u043e\u0440\u043e\u0432 \u0414\u0432\u0438\u0436\u0435\u043d\u0438\u044f \u0421\u043e\u043f\u0440\u043e\u0442\u0438\u0432\u043b\u0435\u043d\u0438\u044f, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0430\u0432\u0442\u043e\u0440\u043e\u043c \u0440\u043e\u043c\u0430\u043d\u043e\u0432 \"\u0421\u0442\u0440\u0430\u0441\u0442\u043d\u0430\u044f \u043d\u0435\u0434\u0435\u043b\u044f\" \u0438 \"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u044b\".'), 1372),
(5489, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0435 \u0437\u0430\u0431\u043e\u043b\u0435\u043b\u0438 \u0440\u043e\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043a\u0438 \u0410\u043b\u044c\u0444\u0440\u0435\u0434\u0430 \u041a\u0430\u043d\u043d\u0438\u043d\u0433\u0430 \u043f\u043e \u0441\u044e\u0436\u0435\u0442\u0443 \u0441\u043a\u0430\u0437\u043a\u0438 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041c\u0435\u043b\u0435\u043d\u0442\u044c\u0435\u0432\u0438\u0447\u0430.'), 1373);
