(5492, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0434\u0430\u0432\u043d\u043e \u0443\u0436\u0435 \u043e\u0431\u0435\u0437\u043b\u044e\u0434\u0435\u0432\u0448\u0438\u0439 \u0433\u043e\u0440\u043e\u0434 \u0432 \u0418\u043e\u0440\u0434\u0430\u043d\u0438\u0438, \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u0432\u044b\u0441\u0435\u0447\u0435\u043d\u043d\u044b\u0439 \u0432 \u0441\u043a\u0430\u043b\u0430\u0445.'), 1373),
(5493, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0444\u0440\u0430\u043d\u0446\u0443\u0437 \u0432 1865 \u0433. \u0432\u044b\u0441\u0442\u0440\u0435\u043b\u0438\u043b \u0441\u0432\u043e\u0438\u043c\u0438 \u0433\u0435\u0440\u043e\u044f\u043c\u0438 \u043f\u043e \u041b\u0443\u043d\u0435.'), 1374),
(5494, STRINGDECODE('\u041e \u0441\u0442\u0435\u043f\u0435\u043d\u0438 \u044d\u0444\u0444\u0435\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u043c\u0435\u0433\u0430\u043e\u0440\u0443\u0434\u0438\u044f \u043f\u043e\u0434 \u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u0435\u043c \u0432 1942 \u0433. \u0434\u043e \u0441\u0438\u0445 \u043f\u043e\u0440 \u0441\u043f\u043e\u0440\u044f\u0442 \u0432\u043e\u0435\u043d\u043d\u044b\u0435 \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u0438 \u0438 \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u044b.'), 1374),
