(5496, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u043f\u043e\u043b\u043a\u043e\u0432\u043d\u0438\u043a \u0432 1657-1658 \u0433\u0433. \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u043b \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435\u043c \u043d\u0430 \u041b\u0435\u0432\u043e\u0431\u0435\u0440\u0435\u0436\u043d\u043e\u0439 \u0423\u043a\u0440\u0430\u0438\u043d\u0435 \u043f\u0440\u043e\u0442\u0438\u0432 \u0433\u0435\u0442\u043c\u0430\u043d\u0430 \u0418\u0432\u0430\u043d\u0430 \u0412\u044b\u0433\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0438 \u0431\u044b\u043b \u0443\u0431\u0438\u0442 \u0432 \u0440\u0435\u0448\u0430\u044e\u0449\u0435\u043c \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0438 \u043f\u043e\u0434 \u041f\u043e\u043b\u0442\u0430\u0432\u043e\u0439.'), 1374),
