(5531, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0432\u0438\u0434 \u0432\u0437\u0440\u044b\u0432\u0447\u0430\u0442\u043a\u0438 \u0440\u0435\u0448\u0438\u043b\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0433\u0435\u0440\u043e\u0438 \u0436\u044e\u043b\u044c\u0432\u0435\u0440\u043d\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0440\u043e\u043c\u0430\u043d\u0430 \"\u0421 \u0417\u0435\u043c\u043b\u0438 \u043d\u0430 \u041b\u0443\u043d\u0443\" \u0432 \u0441\u0438\u043b\u0443 \u0435\u0435 \u0432\u044b\u0441\u043e\u043a\u043e\u0439 \u043c\u043e\u0449\u0438 (\u0432 10 \u0440\u0430\u0437 \u043c\u043e\u0449\u043d\u0435\u0435 \u043f\u043e\u0440\u043e\u0445\u0430), \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0432 \u0445\u043e\u0434\u0435 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u0438\u0440\u043e\u0432\u043a\u0438 \u0438 \u0443\u043a\u043b\u0430\u0434\u043a\u0438 \u043d\u0430 \u0434\u043d\u043e \u043f\u0443\u0448\u043a\u0438 \u0438 \u0434\u0435\u0448\u0435\u0432\u0438\u0437\u043d\u044b \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u044f.'), 1383),
(5532, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a - \u0431\u043e\u043b\u0435\u0435 \u0440\u0430\u0441\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0435\u043d\u043d\u043e - \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0442\u0440\u0438\u043d\u0438\u0442\u0440\u043e\u0444\u0435\u043d\u043e\u043b, \u043f\u0440\u0438\u043c\u0435\u043d\u044f\u0432\u0448\u0438\u0439\u0441\u044f \u0432\u0435\u043a \u043d\u0430\u0437\u0430\u0434 \u043f\u043e\u0434 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u044f\u043c\u0438 \u043c\u0435\u043b\u0438\u043d\u0438\u0442 (\u0420\u043e\u0441\u0441\u0438\u044f, \u0424\u0440\u0430\u043d\u0446\u0438\u044f), \u043b\u0438\u0434\u0434\u0438\u0442 (\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f), \u0448\u0438\u043c\u043e\u0437\u0430 (\u042f\u043f\u043e\u043d\u0438\u044f), \u0441/88 (\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f).'), 1383);
