(5537, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d\u043e \u0431\u044b\u0432\u0430\u0435\u0442 \u0446\u044b\u0433\u0430\u043d\u0441\u043a\u0438\u043c, \u043a\u0440\u0435\u043e\u043b\u044c\u0441\u043a\u0438\u043c, \u0430\u043d\u0434\u0430\u043b\u0443\u0441\u0438\u0439\u0441\u043a\u0438\u043c, \u043d\u043e \u043d\u0430\u0438\u0431\u043e\u043b\u0435\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430 \u0430\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u0430\u044f \u0440\u0430\u0437\u043d\u043e\u0432\u0438\u0434\u043d\u043e\u0441\u0442\u044c.'), 1385),
