(5622, STRINGDECODE('13-17 \u0438\u044e\u043d\u044f 2005 \u0433. \u0448\u0435\u0441\u0442\u044c \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0430\u0440\u0435\u0439 \u0438\u0437 \u0421\u0428\u0410 \u043f\u043e\u0431\u0438\u043b\u0438 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0440\u0435\u043a\u043e\u0440\u0434 \u043d\u0435\u043f\u0440\u0435\u0440\u044b\u0432\u043d\u043e\u0433\u043e \u0447\u0442\u0435\u043d\u0438\u044f. \u0412 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0435 \u0447\u0442\u0435\u0446\u043e\u0432 \u0431\u044b\u043b\u0438 \u0432\u0435\u0441\u0442\u0435\u0440\u043d\u044b, \u0440\u043e\u043c\u0430\u043d\u044b, \u0434\u0435\u0442\u0435\u043a\u0442\u0438\u0432\u044b, \u0430 \u0446\u0435\u043b\u044b\u0445 72 \u0447\u0430\u0441\u0430 \u0438\u0437 100 \u0437\u0430\u043d\u0438\u043c\u0430\u043b\u043e \u0447\u0442\u0435\u043d\u0438\u0435 \u043f\u044f\u0442\u0438 \u0440\u043e\u043c\u0430\u043d\u043e\u0432 \u043e \u041d\u0415\u041c.'), 1406),
