(5629, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0432\u043e \u0431\u044b\u043b\u043e \u043f\u043e\u043b\u043d\u043e\u0435 \u0438\u043c\u044f \"\u0441\u044b\u043d\u0430 \u0442\u0443\u0440\u0435\u0446\u043a\u043e-\u043f\u043e\u0434\u0434\u0430\u043d\u043d\u043e\u0433\u043e\", \u0435\u0441\u043b\u0438 \u0432\u0435\u0440\u0438\u0442\u044c \u0435\u043c\u0443 \u0441\u0430\u043c\u043e\u043c\u0443.'), 1408),
(5630, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u0432 \u043e\u0434\u043d\u043e\u043c \u0438\u0437 \u0441\u0432\u043e\u0438\u0445 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u0441\u0444\u043e\u0440\u043c\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043b \"\u043f\u0440\u0430\u0432\u0438\u043b\u043e \u0447\u0435\u0442\u044b\u0440\u0435\u0445 \u0423\" - \u0443\u0441\u0443\u0448\u043a\u0438, \u0443\u0442\u0440\u0443\u0441\u043a\u0438, \u0443\u0441\u044b\u043f\u043a\u0438 \u0438 \u0443\u0442\u0435\u0447\u043a\u0438.'), 1408),
(5631, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \"\u0430\u043d\u0430\u043b\u043e\u0433\" \u041c\u0430\u043a\u0441\u0438\u043c\u0430 \u0413\u0430\u043b\u043a\u0438\u043d\u0430 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0441\u044b\u043d\u043e\u043c \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0434\u0435\u044f\u0442\u0435\u043b\u044f \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430.'), 1408),
(5632, STRINGDECODE('\u041d\u0430 \u043f\u0430\u043f\u0435\u0440\u0442\u0438 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438 \u043f\u0440\u043e\u0432\u0435\u043b \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0435 \u0433\u043e\u0434\u044b \u0436\u0438\u0437\u043d\u0438 \u0433\u0430\u043b\u0430\u043d\u0442\u0435\u0440\u0435\u0439\u0449\u0438\u043a \u0411\u043e\u043d\u0430\u0441\u044c\u0435.'), 1408),
(5633, STRINGDECODE('\"\u0412 \u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u0431\u043e\u0433 \u043f\u043e\u0441\u043b\u0430\u043b \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0443 \u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0438\u0447\u0443 \"\u0417\u0443\u0431\u0440\u043e\u0432\u043a\u0443\", \u0434\u043e\u043c\u0430\u0448\u043d\u0438\u0435 \u0441\u043e\u043b\u0435\u043d\u044c\u044f, \u0441\u0432\u0435\u0436\u0438\u0435 \u043e\u0432\u043e\u0449\u0438, \u0440\u0430\u0437\u043d\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u044b\u0435 \u0437\u0430\u043a\u0443\u0441\u043a\u0438, \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \u0431\u043e\u0440\u0449, \u043a\u0443\u0440\u0438\u0446\u0443 \u0438 \u0434\u043e\u043c\u0430\u0448\u043d\u0435\u0435 \u0441\u0443\u0444\u043b\u0435\".'), 1409);
