(5636, STRINGDECODE('\"\u041c\u044b \u043f\u043e\u0435\u0445\u0430\u043b\u0438 \u0432 \"\u0410\u0440\u0430\u0433\u0432\u0438\". \u041c\u044b \u0442\u0430\u043c \u0435\u043b\u0438, \u0438 \u0447\u0442\u043e \u0435\u0449\u0435... \u0443\u0433\u043e\u0449\u0430\u043b\u0438\u0441\u044c... \u0446\u044b\u043f\u043b\u044f\u0442\u0430 \u0442\u0430\u0431\u0430\u043a\u0430, \u0441\u0430\u0446\u0438\u0432\u0438, \u043a\u0443\u043f\u0430\u0442\u044b, \u0448\u0430... \u0448-\u0448\u043b\u044b\u043a\u0438... \u0447\u0435\u0431\u0443\u0440\u0435\u043a\u0438... - \u0427\u0435\u0431\u0443\u0440\u0435\u043a\u0438! \u0427\u0435\u0431\u0443\u0440\u0435\u043a\u0438\".'), 1409),
(5637, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0432\u043e\u0435\u043d\u043d\u0430\u044f \u0431\u0430\u0437\u0430, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u0421\u0428\u0410 \u0430\u0440\u0435\u043d\u0434\u0443\u0435\u0442 \u043d\u0430 \u041a\u0443\u0431\u0435 \u0441 1903 \u0433.'), 1410),
(5638, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u0443\u043f\u043e\u0440\u044f\u0434\u043e\u0447\u0435\u043d\u043d\u0443\u044e \u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u0434\u0430\u043d\u043d\u044b\u0445, \u043f\u0440\u0435\u0434\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u0443\u044e \u0434\u043b\u044f \u0445\u0440\u0430\u043d\u0435\u043d\u0438\u044f, \u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0438 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u043a\u0438 \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u042d\u0412\u041c.'), 1410),
