(5640, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u043e\u0441\u043d\u043e\u0432\u043d\u0443\u044e \u0442\u043e\u043f\u043b\u0438\u0432\u043d\u043e-\u044d\u043d\u0435\u0440\u0433\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0431\u0430\u0437\u0443 \u0446\u0435\u043d\u0442\u0440\u0430 \u0438 \u044e\u0433\u0430 \u0423\u043a\u0440\u0430\u0438\u043d\u044b.'), 1410),
(5641, STRINGDECODE('\u0424\u0435\u0434\u0436\u0438\u043d \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u043b \u0432\u043e\u0440\u043e\u0432-\u043a\u0430\u0440\u043c\u0430\u043d\u043d\u0438\u043a\u043e\u0432 \u0432 \u044d\u0442\u043e\u043c \u0440\u043e\u043c\u0430\u043d\u0435 \u0414\u0438\u043a\u043a\u0435\u043d\u0441\u0430.'), 1411);
