(5839, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0435\u0435 \u0432 \u043d\u043e\u043c\u0435\u0440\u0435 \"95-\u0433\u043e \u043a\u0432\u0430\u0440\u0442\u0430\u043b\u0430\" \u0441 \u043e\u0433\u0440\u043e\u043c\u043d\u044b\u043c \u0443\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0438\u0435\u043c \u043e\u0431\u044b\u0441\u043a\u0438\u0432\u0430\u043b\u0430 \u0432\u0441\u044f \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0442\u0430\u043c\u043e\u0436\u043d\u044f. \u0412\u0430\u0442\u0438\u043a\u0430\u043d \u043c\u043e\u0433 \u0431\u044b \u0432\u043e\u0441\u043f\u0440\u043e\u0442\u0438\u0432\u0438\u0442\u044c\u0441\u044f.'), 1460),
(5840, STRINGDECODE('\u041a\u0438\u0440 \u0411\u0443\u043b\u044b\u0447\u0435\u0432 \u043d\u0430 \u0441\u0432\u043e\u0435\u043c \u0441\u0430\u0439\u0442\u0435 \u0432 \u043f\u0435\u0440\u0432\u044b\u0435 \u0434\u043d\u0438 2001 \u0433. \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043a\u043e\u043d\u043a\u0443\u0440\u0441 \u043d\u0430 \u043e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0435 \u0435\u0433\u043e \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430 \"\u041e\u0431\u044b\u0441\u043a\", 7 \u0430\u043f\u0440\u0435\u043b\u044f \u044d\u0442\u043e\u0433\u043e \u0436\u0435 \u0433\u043e\u0434\u0430 \u043e\u043d \u043f\u043e\u0434\u0432\u0435\u043b \u0438\u0442\u043e\u0433\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0437\u0432\u0443\u0447\u0430\u043b\u0438 \u0438\u043c\u0435\u043d\u043d\u043e \u0422\u0410\u041a.'), 1460),
