(5843, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043a\u043b\u0430\u0441\u0441, \u0441\u043e\u0441\u0442\u043e\u044f\u0449\u0438\u0439 \u0438\u0437 \u0442\u0440\u0435\u0445 \u043f\u043e\u0434\u043a\u043b\u0430\u0441\u0441\u043e\u0432 - \u043f\u0435\u0440\u0435\u0434\u043d\u0435\u0436\u0430\u0431\u0435\u0440\u043d\u044b\u0435, \u043b\u0435\u0433\u043e\u0447\u043d\u044b\u0435, \u0437\u0430\u0434\u043d\u0435\u0436\u0430\u0431\u0435\u0440\u043d\u044b\u0435, - \u0432 \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432\u0445\u043e\u0434\u044f\u0442 \u043e\u043a\u043e\u043b\u043e 90 \u0442\u044b\u0441\u044f\u0447 \u0432\u0438\u0434\u043e\u0432, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u043a\u0430\u043a \u043a\u043b\u0430\u0441\u0441 \u0443\u043b\u0438\u0442\u043a\u0438.'), 1461),
(5844, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0435\u0449\u0435 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043c\u043e\u043b\u043b\u044e\u0441\u043a \u043c\u043e\u0440\u0441\u043a\u0430\u044f \u0443\u043b\u0438\u0442\u043a\u0430.'), 1461),
