(5923, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0432\u043e\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 \u0433\u0440\u0443\u043f\u043f\u0430 \"\u0410\u0440\u0438\u044f\" \u043e\u043f\u0438\u0441\u044b\u0432\u0430\u043b\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c: \"\u0412\u0441\u0451 \u0442\u0440\u0443\u0434\u043d\u0435\u0439 \u0434\u044b\u0448\u0430\u0442\u044c \u043f\u0440\u043e\u043d\u0437\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u0432\u043e\u0437\u0434\u0443\u0445\u043e\u043c, \u0432\u0441\u0451 \u0442\u0440\u0443\u0434\u043d\u0435\u0435 \u043d\u0435\u0431\u0443 \u0441\u043b\u0430\u0442\u044c \u043f\u0440\u043e\u043a\u043b\u044f\u0442\u044c\u044f, \u0432\u0441\u0451 \u0442\u0440\u0443\u0434\u043d\u0435\u0439 \u0431\u0435\u0436\u0430\u0442\u044c, \u043f\u043e\u043b\u0436\u0438\u0437\u043d\u0438 \u0442\u044b \u043e\u0442\u0434\u0430\u043b \u0431\u044b, \u0447\u0442\u043e\u0431 \u0437\u0430\u0431\u044b\u0442\u044c \u0442\u043e\u0442 \u0431\u043e\u0439 \u0437\u0430 \u0441\u043f\u0438\u043d\u043e\u0439\".'), 1481),
