(5986, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u043c\u0435\u0445\u043e\u0432\u043e\u0439 \u043f\u0440\u0435\u0434\u043c\u0435\u0442 \u0440\u043e\u0441\u043a\u043e\u0448\u0438 \u043e\u0441\u0442\u0430\u0432\u0438\u043b\u0430 \u0441\u0435\u0431\u0435 \u043c\u0430\u043b\u0435\u043d\u044c\u043a\u0430\u044f \u0440\u0430\u0437\u0431\u043e\u0439\u043d\u0438\u0446\u0430.'), 1497),
