(5992, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0434\u0435\u0441\u044f\u0442\u0438\u0441\u0435\u0440\u0438\u0439\u043d\u044b\u0439 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0442\u0435\u043b\u0435\u0441\u0435\u0440\u0438\u0430\u043b \u0437\u0430\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u0435\u0441\u043d\u0435\u0439 \"\u041d\u043e\u0447\u0435\u043d\u044c\u043a\u0430, \u043d\u043e\u0447\u044c \u0437\u0438\u043c\u043d\u044f\u044f\" \u0432 \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0438 \u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u0411\u043e\u044f\u0440\u0441\u043a\u043e\u0433\u043e.'), 1498),
