(6065, STRINGDECODE('\u041d\u0430\u0432\u0441\u0442\u0440\u0435\u0447\u0443 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u043c\u0443 \u0440\u0438\u043c\u0441\u043a\u043e\u043c\u0443 \u043f\u0440\u0435\u0434\u0440\u0430\u0441\u0441\u0432\u0435\u0442\u043d\u043e\u043c\u0443 \u0432\u0435\u0442\u0435\u0440\u043a\u0443 \u043f\u0440\u0438\u0437\u044b\u0432\u0430\u043b \u044f\u0432\u0438\u0442\u044c\u0441\u044f \u0441\u0432\u043e\u044e \u0433\u0435\u0440\u043e\u0438\u043d\u044e \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u043a\u043b\u0430\u0441\u0441\u0438\u043a.'), 1517),
(6066, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d\u0430 \u043f\u0435\u043b\u0430: \"\u042f \u0437\u0430 \u0442\u0435\u0431\u044f \u043c\u043e\u043b\u044e\u0441\u044c, \u044f \u0437\u0430 \u0442\u0435\u0431\u044f \u0431\u043e\u044e\u0441\u044c, \u0438 \u0441\u043b\u044b\u0448\u0443 \u044f, \u043c\u043e\u0439 \u0431\u043e\u0433, \u0442\u0432\u043e\u0439 \u043a\u0430\u0436\u0434\u044b\u0439 \u0432\u0437\u0434\u043e\u0445\".'), 1517),
(6067, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0432\u0441\u0435\u0432\u0438\u0434\u044f\u0449\u0435\u0435 \u0434\u043e\u043e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u043e\u0435 \u0431\u043e\u0436\u0435\u0441\u0442\u0432\u043e \u0447\u0430\u0449\u0435 \u0432\u0441\u0435\u0433\u043e \u043f\u0440\u0438\u0437\u044b\u0432\u0430\u043b\u0438 \u0432 \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u0438 \u0438 \u043c\u0441\u0442\u0438\u0442\u0435\u043b\u0438 \u0434\u0440\u0435\u0432\u043d\u0438\u0435 \u0433\u0440\u0435\u043a\u0438, \u0447\u0442\u043e\u0431\u044b \u043e\u043d\u043e \u043f\u043e\u043a\u0430\u0440\u0430\u043b\u043e \u0441\u043b\u0435\u043f\u043e\u0442\u043e\u0439 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043d\u0438\u043a\u043e\u0432.'), 1517),
(6068, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a \u0437\u0432\u0430\u043b\u0438 \u0432 \u0440\u0438\u043c\u0441\u043a\u043e\u0439 \u043c\u0438\u0444\u043e\u043b\u043e\u0433\u0438\u0438 \u0431\u043e\u0433\u0438\u043d\u044e-\u043f\u0435\u0440\u0441\u043e\u043d\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044e \u0433\u043e\u0440\u043e\u0434\u0430 \u0420\u0438\u043c\u0430, \u0430 \u0441\u0435\u0439\u0447\u0430\u0441 \u044d\u0442\u043e - \u0431\u043e\u0436\u0435\u0441\u0442\u0432\u043e \u0434\u043e\u0431\u0440\u043e\u0439 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u044b \u043c\u0443\u0436\u0441\u043a\u043e\u0439 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u044b \u0420\u0438\u043c\u0430.'), 1517),
(6069, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0435\u0435 \u0440\u0430\u043d\u043d\u0438\u0439 \u0443\u0445\u043e\u0434 \u043b\u0438\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0433\u0435\u0440\u043e\u0439 \u0431\u0430\u0440\u0434\u0430 \u043e\u043f\u0440\u0430\u0432\u0434\u044b\u0432\u0430\u043b \u0442\u0435\u043c, \u0447\u0442\u043e \u0435\u0439 \u0431\u044b\u0442\u044c \"\u043d\u043e\u0447\u044c\u044e \u0443 \u043c\u0443\u0436\u0447\u0438\u043d\u044b - \u0431\u043e\u0433 \u0432\u0435\u0441\u0442\u044c, \u0447\u0442\u043e \u043b\u044e\u0434\u0438 \u0441\u043a\u0430\u0436\u0443\u0442 \u043f\u0440\u043e \u043d\u0435\u0435\".'), 1518),
(6070, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u0432 \"\u0415\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439\" \u043f\u0438\u0441\u0430\u043b: \"\u0412\u043e\u043a\u0440\u0443\u0433 \u0432\u0430\u0441 \u0432\u0441\u0435\u0433\u0434\u0430 \u0432\u0438\u0442\u0430\u0435\u0442 \u043c\u043d\u043e\u0433\u043e \u0438\u0434\u0435\u0439, \u043d\u043e \u043e\u0447\u0435\u043d\u044c \u0447\u0430\u0441\u0442\u043e \u0432\u044b \u043f\u0440\u043e\u0441\u0442\u043e \u043d\u0435 \u0445\u043e\u0442\u0438\u0442\u0435 \u0438\u0445 \u0432\u0438\u0434\u0435\u0442\u044c! \u041a\u043e\u0433\u0434\u0430 \u0432\u044b \u0436\u0434\u0435\u0442\u0435 \u0432\u0434\u043e\u0445\u043d\u043e\u0432\u0435\u043d\u0438\u044f - \u0432\u0430\u043c \u043d\u0443\u0436\u043d\u044b \u043d\u043e\u0432\u044b\u0435 \u0438\u0434\u0435\u0438... \u0418 \u0442\u043e\u043b\u044c\u043a\u043e \u0432\u044b \u0441\u0430\u043c\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0430\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0438\u0434\u0435\u044e \u0432\u043e\u043f\u043b\u043e\u0442\u0438\u0442\u044c\u0441\u044f!\", \u043e\u043f\u0440\u0430\u0432\u0434\u044b\u0432\u0430\u044f, \u0442\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \"\u0414\u0436\u043e\u043d\u0430\u0442\u0430\u043d\u0430\".'), 1518);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(6071, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u043b: \"\u041a\u0438\u0448\u0438\u0442 \u043f\u0435\u0432\u0446\u043e\u0432 \u0441\u0442\u043e\u043b\u043f\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0435, / \u0446\u0435\u0434\u044f \u0438\u0437 \u043a\u0430\u0441\u0441\u044b \u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u044c; / \u043a\u043e\u0433\u0434\u0430 \u043f\u0440\u043e\u0434\u0430\u0436\u043d\u043e \u0432\u0434\u043e\u0445\u043d\u043e\u0432\u0435\u043d\u0438\u0435, / \u0442\u043e \u0441\u043b\u043e\u0436\u043d\u043e \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u044c \u043f\u0440\u043e\u0434\u0430\u0442\u044c\".'), 1518),
(6072, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u043c\u0443 \u0440\u0443\u0441\u0441\u043a\u043e\u043c\u0443 \u043f\u043e\u044d\u0442\u0443 XIX \u0432\u0435\u043a\u0430 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0430\u0442 \u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u044f \"\u0412\u0434\u043e\u0445\u043d\u043e\u0432\u0435\u043d\u0438\u0435\", \"\u0420\u0430\u0437\u043e\u0447\u0430\u0440\u043e\u0432\u0430\u043d\u0438\u0435\", \"\u041f\u0435\u0440\u0435\u043c\u0435\u043d\u0447\u0438\u0432\u043e\u0441\u0442\u044c\", \"\u0422\u043b\u0435\u043d\u043d\u043e\u0441\u0442\u044c\", \"\u0423\u0442\u0435\u0448\u0435\u043d\u0438\u0435\", \"\u0416\u0430\u043b\u043e\u0431\u0430\" \u0438 \"\u0421\u043c\u0435\u0440\u0442\u044c\".'), 1518),
(6073, STRINGDECODE('\u0421\u0440\u043e\u043a \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a\u043e\u0439 \u0434\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u043e\u0442\u0441\u0438\u0434\u0435\u043b \u043b\u0438\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0433\u0435\u0440\u043e\u0439 \u0412\u044b\u0441\u043e\u0446\u043a\u043e\u0433\u043e \u043f\u0440\u0435\u0436\u0434\u0435, \u0447\u0435\u043c \u043d\u0430\u0447\u0430\u0442\u044c \u0436\u0438\u0437\u043d\u044c.'), 1519),
(6074, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u043e\u0431\u044a\u0435\u043a\u0442, \u0441\u0443\u0434\u044f \u043f\u043e \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0439 \u0441\u043f\u0440\u0430\u0432\u043a\u0435 \u0431\u043e\u0440\u0442\u043e\u0432\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u0430, \u043b\u0438\u0448\u0435\u043d\u043d\u044b\u0439 \u043a\u0430\u043a\u043e\u0433\u043e-\u043b\u0438\u0431\u043e \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u043e\u0433\u043e, \u0441\u0435\u043b\u044c\u0441\u043a\u043e\u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0438\u043b\u0438 \u043a\u043e\u043c\u043c\u0435\u0440\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u0430, \u0431\u044b\u043b \u043e\u0431\u0436\u0438\u0442 \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0430\u043d\u0434\u0440\u043e\u0438\u0434\u043d\u043e\u0439 \u0444\u043e\u0440\u043c\u043e\u0439 \u0436\u0438\u0437\u043d\u0438.'), 1519),
(6075, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0441\u043e\u0431\u044b\u0442\u0438\u0435 \u0433\u0440\u0430\u0444 \u041c\u043e\u043d\u0442\u0435-\u041a\u0440\u0438\u0441\u0442\u043e \u043d\u0430\u0437\u044b\u0432\u0430\u043b \u0441\u0430\u043c\u044b\u043c \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u044b\u043c \u0432 \u0436\u0438\u0437\u043d\u0438.'), 1519),
(6076, STRINGDECODE('\u0412 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0438, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u043e\u0437\u0432\u0443\u0447\u0430\u043b \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u044b\u0439 \u043f\u0440\u0438\u0437\u044b\u0432 \u0441\u0432\u044f\u0437\u0430\u0442\u044c\u0441\u044f \u0441 \u043d\u0435\u044e, \u0433\u0435\u0440\u043e\u0438\u043d\u044f \u0432 \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0438 \u0438\u043c\u0435\u043d\u043d\u043e \u042d\u0422\u041e\u0419 \u0430\u043a\u0442\u0440\u0438\u0441\u044b \u0442\u0430\u043a\u0436\u0435 \u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u0438\u043b\u0430 \u0436\u0438\u0437\u043d\u044c.'), 1519);
