(6077, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u043f\u043e\u043f-\u043f\u0435\u0432\u0438\u0446\u0430 \u043f\u0440\u0438\u0437\u044b\u0432\u0430\u043b\u0430 \u043d\u0435 \u043f\u043b\u0430\u043a\u0430\u0442\u044c \u0443\u0436\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \u0441\u0432\u043e\u0435\u0439 \u043f\u0435\u0441\u043d\u0438.'), 1520),
