(6079, STRINGDECODE('\u041a\u0430\u0434\u0440\u044b \u0441 \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0435\u043c \u044d\u0442\u0438\u0445 \u0434\u0432\u0443\u0445 \u0431\u0440\u0430\u0442\u044c\u0435\u0432 \u0441\u043e \u0441\u043b\u0435\u0437\u0430\u043c\u0438 \u043d\u0430 \u0433\u043b\u0430\u0437\u0430\u0445 \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u0431\u0435\u0434\u044b \u0441\u0442\u0430\u0440\u0448\u0435\u0433\u043e \u0438\u0437 \u043d\u0438\u0445 \u043e\u0431\u043e\u0448\u043b\u0438 \u0432\u0435\u0441\u044c \u043c\u0438\u0440 \u043a\u0430\u043a \u043f\u0440\u0438\u043c\u0435\u0440 \u043b\u044e\u0431\u0432\u0438 \u043a \u043c\u0430\u0442\u0435\u0440\u0438.'), 1520),
