(6103, STRINGDECODE('\u0412 1895 \u0433. \u0432 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u0448\u0430\u0445\u043c\u0430\u0442\u043d\u044b\u0439 \u043c\u0430\u0442\u0447-\u0442\u0443\u0440\u043d\u0438\u0440 \u0441 \u0443\u0447\u0430\u0441\u0442\u0438\u0435\u043c \u0421\u0442\u0435\u0439\u043d\u0438\u0446\u0430, \u0427\u0438\u0433\u043e\u0440\u0438\u043d\u0430, \u041f\u0438\u043b\u044c\u0441\u0431\u0435\u0440\u0438, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0448\u0430\u0445\u043c\u0430\u0442\u0438\u0441\u0442\u0430, \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0418\u043b\u044c\u0444 \u0438 \u041f\u0435\u0442\u0440\u043e\u0432 \u0432 \u0441\u0432\u043e\u0438\u0445 \"\u0414\u0432\u0435\u043d\u0430\u0434\u0446\u0430\u0442\u0438 \u0441\u0442\u0443\u043b\u044c\u044f\u0445\" \u0437\u0430\u0447\u0435\u043c-\u0442\u043e \u043d\u0430\u0440\u044f\u0434\u0438\u043b\u0438 \u0432 \u0437\u0435\u043b\u0435\u043d\u044b\u0435 \u043d\u043e\u0441\u043a\u0438.'), 1526),
(6104, STRINGDECODE('\u041f\u043e\u043c\u0438\u043c\u043e \u0422\u0438\u043d\u043a\u0438-\u0412\u0438\u043d\u043a\u0438, \u0414\u0438\u043f\u0441\u0438 \u0438 \u041b\u0430-\u041b\u0430, \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 \u0447\u0435\u0442\u0432\u0435\u0440\u043a\u0438 \u0442\u0435\u043b\u0435\u043f\u0443\u0437\u0438\u043a\u043e\u0432 \u0432\u0445\u043e\u0434\u0438\u043b \u0435\u0449\u0435 \u0438 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0442\u0435\u0437\u043a\u0430 \u0440\u0435\u043a\u0438.'), 1526),
(6105, STRINGDECODE('\u041e\u0434\u043d\u043e \u0438\u0437 \u0435\u0433\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u0437\u0432\u0443\u0447\u0438\u0442 \u0438\u043c\u0435\u043d\u043d\u043e \u0442\u0430\u043a: \"\u0415\u0441\u043b\u0438 \u0442\u044b \u0432\u0435\u0441\u044c \u043c\u0438\u0440 \u043d\u0430\u0441\u0438\u043b\u044c\u044f / \u0421\u043e\u0431\u0438\u0440\u0430\u0435\u0448\u044c\u0441\u044f \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u0442\u044c, / \u0418 \u043f\u0440\u0438 \u044d\u0442\u043e\u043c \u0441\u0442\u0430\u0442\u044c \u043c\u0435\u0447\u0442\u0430\u0435\u0448\u044c / \u0412\u0441\u0435\u043c, \u043d\u0435 \u0431\u0443\u0434\u0443\u0447\u0438 \u043d\u0438\u0447\u0435\u043c, / \u0421\u043c\u0435\u043b\u043e \u0434\u0432\u0438\u0433\u0430\u0439\u0441\u044f \u0437\u0430 \u043d\u0430\u043c\u0438 / \u041f\u043e \u043f\u0440\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0435, / \u041c\u044b \u0442\u0435\u0431\u0435 \u0434\u043e\u0440\u043e\u0433\u0443 \u044d\u0442\u0443 / \u041c\u043e\u0436\u0435\u043c \u0434\u0430\u0436\u0435 \u0443\u0441\u0442\u0443\u043f\u0438\u0442\u044c\".'), 1527);
INSERT INTO PUBLIC.QUESTION(ID, TEXT, TOPIC_ID) VALUES
(6106, STRINGDECODE('\u0412\u043e\u0441\u043f\u043e\u043c\u0438\u043d\u0430\u043d\u0438\u044f \u043e \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0445 \u0434\u0432\u0430\u0434\u0446\u0430\u0442\u0438 \u0433\u043e\u0434\u0430\u0445 \u043d\u0430 \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435 \u0421\u0421\u0421\u0420 \u0438 \u0421\u041d\u0413 \u0432 \u043f\u0435\u0441\u0435\u043d\u043d\u043e\u0439 \u0444\u043e\u0440\u043c\u0435 \u043f\u043e\u0434 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \"\u0427\u0442\u043e \u0412\u044b \u0441\u0434\u0435\u043b\u0430\u043b\u0438 \u0441 \u0412\u0430\u0448\u0435\u0439 \u043c\u0435\u0447\u0442\u043e\u0439?\" \u0435\u0441\u0442\u044c \u0432 \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u0433\u0440\u0443\u043f\u043f\u044b, \u043a\u0430\u043a \u0438 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043d\u0430\u0438\u0432\u043d\u0430\u044f \u0431\u0430\u043b\u043b\u0430\u0434\u0430 \"\u041c\u0435\u0447\u0442\u044b\".'), 1527),
(6107, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0435\u0433\u043e \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0418\u0441\u043f\u0430\u043d\u0438\u0438 \u0434\u043e\u043d \u0425\u043e\u0441\u0435 \u0434\u0435 \u0421\u0430\u043d\u0442\u0430\u0440\u0435\u043d \u043e\u0431\u043e\u0437\u0432\u0430\u043b \u0440\u043e\u043c\u0430\u043d\u0442\u0438\u043a\u043e\u043c, \u0438\u0434\u0435\u0430\u043b\u0438\u0441\u0442\u043e\u043c \u0438 \u0434\u0430\u0436\u0435 \u043c\u0435\u0447\u0442\u0430\u0442\u0435\u043b\u0435\u043c, \u043f\u044b\u0442\u0430\u044f\u0441\u044c \u0443\u0431\u0435\u0434\u0438\u0442\u044c \u0432 \u0442\u043e\u043c, \u0447\u0442\u043e \u0435\u0433\u043e \u0436\u0435\u043d\u0430 - \u043d\u0435 \u044e\u043d\u0430\u044f \u043a\u0440\u0430\u0441\u0430\u0432\u0438\u0446\u0430.'), 1527),
(6108, STRINGDECODE('\u0412 \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0444\u0430\u043d\u0442\u0430\u0441\u0442\u0430 \u043f\u043e\u0434 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \"\u042d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0442\u0435\u043b\u043e \u043f\u043e\u044e!\" \u0435\u0441\u0442\u044c \u0441\u043b\u043e\u0432\u0430: \"\u0427\u0435\u043b\u043e\u0432\u0435\u043a \u0432\u0441\u0435\u0433\u0434\u0430 \u043c\u0435\u043d\u044c\u0448\u0435 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043c\u0435\u0447\u0442\u044b. \u0421\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e, \u0435\u0441\u043b\u0438 \u043c\u0430\u0448\u0438\u043d\u0430 \u0432\u043e\u043f\u043b\u043e\u0449\u0430\u0435\u0442 \u043c\u0435\u0447\u0442\u0443 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u043e\u043d\u0430 \u0431\u043e\u043b\u044c\u0448\u0435 \u0442\u043e\u0433\u043e, \u043a\u0442\u043e \u0435\u0435 \u0441\u043e\u0437\u0434\u0430\u043b\".'), 1527),
(6109, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0435\u0435 \u0430\u0434 \u0432\u0435\u0440\u043d\u0443\u043b \u043a \u0436\u0438\u0437\u043d\u0438, \u0430\u0434 \u0434\u0430\u043b \u0435\u0439 \u043d\u043e\u0432\u043e\u0435 \u0438\u043c\u044f, \u0441\u0434\u0435\u043b\u0430\u043b \u043d\u0435\u0443\u0437\u043d\u0430\u0432\u0430\u0435\u043c\u043e\u0439, \u043d\u043e \u043d\u0435 \u0441\u043c\u044b\u043b \u043a\u043b\u0435\u0439\u043c\u0430 \u0438 \u0433\u0440\u044f\u0437\u0438.'), 1528),
(6110, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d, \u043f\u043e \u043c\u043d\u0435\u043d\u0438\u044e \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u0439 \u0442\u0435\u043a\u0441\u0442\u043e\u0432, \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0432\u0442\u043e\u0440\u0443\u044e \u0436\u0438\u0437\u043d\u044c, \u0447\u0442\u043e\u0431\u044b \u0432\u0441\u0435-\u0442\u0430\u043a\u0438 \u0432\u044b\u043f\u043e\u043b\u043d\u0438\u0442\u044c \u0441\u0432\u043e\u044e \u043c\u0438\u0441\u0441\u0438\u044e \u0432 \u0410\u0440\u0434\u0435. \u0412 \u0441\u0430\u043c\u043e\u043c \u0434\u0435\u043b\u0435, \u043a\u043e\u043c\u0443 \u0436 \u0435\u0449\u0435, \u043f\u043e\u0441\u043b\u0435 \u0443\u0445\u043e\u0434\u0430 \u041a\u0430\u0440\u0435\u0433\u043e, \u0433\u0438\u0431\u0435\u043b\u0438 \u0421\u0438\u043d\u0438\u0445 \u0438 \u043f\u0440\u0435\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0411\u0435\u043b\u043e\u0433\u043e.'), 1528);
