(6111, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u043e\u043d \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u043f\u044b\u0442\u043a\u0438 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0438\u044f \u0441\u0430\u043c\u043e\u0433\u043e \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0441\u0432\u043e\u0435\u0433\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u044f 1885 \u0433\u043e\u0434\u0430 \u043f\u043e\u043f\u044b\u0442\u0430\u043b\u0441\u044f \u043f\u043e\u043c\u043e\u0447\u044c \u0432 \u0435\u0433\u043e \u0440\u0435\u0441\u0442\u0430\u0432\u0440\u0430\u0446\u0438\u0438, \u043e\u0434\u043d\u0430\u043a\u043e \u0447\u0443\u0442\u044c \u043d\u0435 \u0438\u0441\u043f\u043e\u0440\u0442\u0438\u043b \u0435\u0433\u043e \u043e\u043a\u043e\u043d\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e, \u0437\u0430\u0442\u0435\u043c\u043d\u0438\u0432 \u0438 \u043f\u0435\u0440\u0435\u0431\u0440\u0430\u0432 \u0441 \u0444\u0438\u043e\u043b\u0435\u0442\u043e\u0432\u043e-\u0441\u0438\u043d\u0438\u043c\u0438 \u0442\u043e\u043d\u0430\u043c\u0438, \u043f\u043b\u043e\u0445\u043e \u0432\u043e\u0441\u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u043c\u044b\u043c\u0438 \u0435\u0433\u043e \u0441\u0442\u0430\u0440\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u0433\u043b\u0430\u0437\u0430\u043c\u0438.'), 1528),
(6112, STRINGDECODE('\u041f\u043e \u0432\u0435\u0440\u0441\u0438\u0438 \u0413.\u041b. \u041e\u043b\u0434\u0438, \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u043b\u0430\u0432\u0430\u0433\u0435\u0442 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u043f\u0440\u043e\u0436\u0438\u0442\u044c \u0432\u0442\u043e\u0440\u0443\u044e \u0436\u0438\u0437\u043d\u044c \u0432 \u0442\u0435\u043b\u0435 \u0441\u0432\u043e\u0435\u0433\u043e \u0432\u043d\u0443\u043a\u0430 \u0418\u043e\u043b\u0430\u044f.'), 1528),
(6113, STRINGDECODE('\u041d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0448\u0442\u0430\u0442\u0430 \u0440\u0430\u0441\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442\u0441\u044f \u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c \u043d\u0430 \u043c\u044b\u0441\u0435 \u041a\u0430\u043d\u0430\u0432\u0435\u0440\u0430\u043b.'), 1529),
(6114, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c \u0432 \u043d\u0430\u0447\u0430\u043b\u0435 \u0441\u0432\u043e\u0435\u0433\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f \u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043b\u0441\u044f \u0422\u044e\u0440\u0430\u0442\u0430\u043c.'), 1529),
(6115, STRINGDECODE('\u0412 \u0441\u0438\u043b\u0443 \u0440\u044f\u0434\u0430 \u043e\u0431\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u0441\u0442\u0432 \u0437\u0430\u043f\u0443\u0441\u043a\u0438 \u0440\u0430\u043a\u0435\u0442 \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u0442\u044c \u0432 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0438 \u043d\u0430 \u0432\u043e\u0441\u0442\u043e\u043a. \u0422\u0430\u043a \u043f\u043e\u0441\u0442\u0443\u043f\u0430\u044e\u0442 \u0432\u0441\u0435, \u043a\u0440\u043e\u043c\u0435 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430, \u0432\u043b\u0430\u0434\u0435\u044e\u0449\u0435\u0433\u043e \u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c\u043e\u043c \u041f\u0430\u043b\u043c\u0430\u0445\u0438\u043c. \u041f\u0440\u0438\u0447\u0438\u043d\u0430 \u043f\u0440\u043e\u0441\u0442\u0430 - \u043d\u0430 \u0432\u043e\u0441\u0442\u043e\u043a\u0435 \u0441 \u0434\u0430\u043d\u043d\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u043e\u0439 \u0433\u0440\u0430\u043d\u0438\u0447\u0430\u0442 \u0441\u043f\u043b\u043e\u0448\u044c \u0438 \u0440\u044f\u0434\u043e\u043c \u0432\u0440\u0430\u0433\u0438. \u0410 \u043d\u0430 \u0437\u0430\u043f\u0430\u0434\u0435 \u0432\u043e\u043e\u0431\u0449\u0435 \u043d\u0435\u0442 \u0441\u0443\u0445\u043e\u043f\u0443\u0442\u043d\u044b\u0445 \u0441\u043e\u0441\u0435\u0434\u0435\u0439.'), 1529);
