(6116, STRINGDECODE('\u0421 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0442\u043e\u0447\u043a\u0438 \u0437\u0440\u0435\u043d\u0438\u044f \u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c \u0442\u0435\u043c \u0432\u044b\u0433\u043e\u0434\u043d\u0435\u0435, \u0447\u0435\u043c \u0431\u043b\u0438\u0436\u0435 \u043e\u043d \u043a \u044d\u043a\u0432\u0430\u0442\u043e\u0440\u0443. \u0412 \u044d\u0442\u043e\u043c \u043f\u043b\u0430\u043d\u0435 \u043b\u0443\u0447\u0448\u0435 \u0432\u0441\u0435\u0445 \u0441\u0442\u0430\u0440\u0442\u043e\u0432\u044b\u0445 \u043f\u043b\u043e\u0449\u0430\u0434\u043e\u043a \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d \u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c \u0410\u043b\u044c\u043a\u0430\u043d\u0442\u0430\u0440\u0430, \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0430\u0449\u0438\u0439 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u044e\u0436\u043d\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u0435.'), 1529),
(6117, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u043f\u043e\u044d\u0442 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0430\u0432\u0442\u043e\u0440\u043e\u043c \u043b\u0438\u0431\u0440\u0435\u0442\u0442\u043e \u0440\u043e\u043a-\u043e\u043f\u0435\u0440\u044b \"\u042e\u043d\u043e\u043d\u0430 \u0438 \u0410\u0432\u043e\u0441\u044c\".'), 1530),
(6118, STRINGDECODE('\u041e\u0434\u043d\u0438\u043c \u0438\u0437 \u0433\u0435\u0440\u043e\u0435\u0432 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u0440\u043e\u043a-\u043e\u043f\u0435\u0440\u044b, \u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043d\u043e\u0439 \u043f\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u044e \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u043a\u043b\u0430\u0441\u0441\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u044b, \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043f\u043e\u043b\u0438\u0446\u0435\u0439\u0441\u043a\u0438\u0439 \u0416\u0430\u0432\u0435\u0440.'), 1530),
(6119, STRINGDECODE('\u041f\u0440\u043e\u0442\u043e\u0442\u0438\u043f\u043e\u043c \u0424\u0440\u0435\u0434\u0434\u0438 \u0422\u0440\u0430\u043c\u043f\u0435\u0440\u0430 - \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u0440\u043e\u043a-\u043e\u043f\u0435\u0440\u044b, \u043c\u0443\u0437\u044b\u043a\u0430 \u043a \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0431\u044b\u043b\u0430 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0430 \u043c\u0443\u0436\u0441\u043a\u043e\u0439 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u043e\u0439 \u0433\u0440\u0443\u043f\u043f\u044b \"\u0410\u0411\u0411\u0410\", - \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0411\u043e\u0431\u0431\u0438 \u0424\u0438\u0448\u0435\u0440.'), 1530),
(6120, STRINGDECODE('\u0420\u043e\u043a-\u043e\u043f\u0435\u0440\u0430 \"\u0422\u043e\u043c\u043c\u0438\" \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u043b\u0443\u0447\u0448\u0438\u0445 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0439 \u0433\u0440\u0443\u043f\u043f\u044b, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0439, \u0432 \u0447\u0430\u0441\u0442\u043d\u043e\u0441\u0442\u0438, \u0442\u0435\u043c, \u0447\u0442\u043e \u0435\u0435 \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f \u0447\u0430\u0441\u0442\u0435\u043d\u044c\u043a\u043e \u043e\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u043b\u0438\u0441\u044c \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0438\u0435\u043c \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u043e\u0432.'), 1530);
