(6121, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u044f\u0435\u0442 \u043b\u0435\u0434 \u0432 \u043b\u0443\u0436\u0430\u0445, \u0448\u043a\u043e\u043b\u044c\u043d\u044b\u0435 \u0433\u043e\u0434\u0430, \u043f\u0435\u0440\u0432\u0443\u044e \u043b\u044e\u0431\u043e\u0432\u044c.'), 1531),
(6122, STRINGDECODE('\u0412 \u043c\u0430\u0440\u0442\u0435 2006 \u0433. \u041e\u043b\u0435\u0433 \u041f\u0440\u043e\u0442\u0430\u0441\u043e\u0432 \u043f\u0440\u043e\u0438\u0437\u043d\u0435\u0441 \u0441\u043b\u043e\u0432\u0430: \"\u041e\u043d \u043f\u043e\u0434\u0432\u0435\u043b \u043a\u043e\u043c\u0430\u043d\u0434\u0443, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0435\u043c\u0443 \u0431\u0435\u0437\u0440\u0430\u0437\u043b\u0438\u0447\u043d\u0430. \u0422\u0435\u043f\u0435\u0440\u044c \u0438 \u043e\u043d \u0431\u0435\u0437\u0440\u0430\u0437\u043b\u0438\u0447\u0435\u043d \u043d\u0430\u043c \u043a\u0430\u043a \u0444\u0443\u0442\u0431\u043e\u043b\u0438\u0441\u0442. \u0414\u043b\u044f \u043c\u0435\u043d\u044f \u0435\u0433\u043e \u043d\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u0435\u0442, \u043e\u043d \u043d\u0438\u043a\u043e\u0433\u0434\u0430 \u043d\u0435 \u0431\u0443\u0434\u0435\u0442 \u043d\u0430\u0448\u0438\u043c \u0438\u0433\u0440\u043e\u043a\u043e\u043c!\", - \u043a\u0430\u0441\u0430\u044e\u0449\u0438\u0435\u0441\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u0435\u0433\u043e. \u0417\u0440\u044f \u0437\u0430\u0440\u0435\u043a\u0430\u043b\u0441\u044f.'), 1531),
(6123, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u043e\u043c \u0430\u043b\u044c\u0431\u043e\u043c\u0435 \u0433\u0440\u0443\u043f\u043f\u0430 \"\u041e\u043a\u0435\u0430\u043d \u042d\u043b\u044c\u0437\u044b\" \u0441 \u0437\u0430\u0432\u0438\u0434\u043d\u043e\u0439 \u0444\u0430\u043d\u0442\u0430\u0437\u0438\u0435\u0439 \u0438 \u043d\u0430\u0441\u0442\u043e\u0439\u0447\u0438\u0432\u043e\u0441\u0442\u044c\u044e \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u043b\u0430, \u0447\u0442\u043e \"\u044f \u043d\u0435 \u0437\u0430\u0431\u0443\u0434\u0443 \u0442\u0435\u0431\u0435 \u043di\u043a\u043e\u043b\u0438, \u043di\u043a\u043e\u043b\u0438 \u043d\u0435 \u0437\u0430\u0431\u0443\u0434\u0443 \u0442\u0435\u0431\u0435!\".'), 1531),
(6124, STRINGDECODE('\u0421 \u043f\u0435\u0440\u0435\u0440\u044b\u0432\u043e\u043c \u0432 \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u043f\u0440\u043e\u043c\u0435\u0436\u0443\u0442\u043e\u043a \u0432\u0440\u0435\u043c\u0435\u043d\u0438 \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u043f\u0440\u0438\u043d\u044f\u043b\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0438 \u0434\u0432\u0430 \u0440\u0435\u0448\u0435\u043d\u0438\u044f. \u041e\u0448\u0438\u0431\u043b\u0430\u0441\u044c \u043e\u043d\u0430 \u0432 \u0438\u0442\u043e\u0433\u0435 \u0438\u043b\u0438 \u043d\u0435\u0442 - \u0442\u0430\u043a \u0434\u043e \u0441\u0438\u0445 \u043f\u043e\u0440 \u0438 \u043d\u0435\u043f\u043e\u043d\u044f\u0442\u043d\u043e.'), 1531),
(6125, STRINGDECODE('\u0423 \u043f\u043e\u0434\u043d\u043e\u0436\u0438\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0439 \u0433\u043e\u0440\u044b \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d \u0433\u043e\u0440\u043e\u0434 \u041f\u044f\u0442\u0438\u0433\u043e\u0440\u0441\u043a.'), 1532),
(6126, STRINGDECODE('\u0421 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u0438\u0442\u0441\u044f \u0431\u0443\u043a\u0432\u0430\u043b\u044c\u043d\u043e \u043a\u0430\u043a \"\u0436\u0435\u0432\u0430\u043d\u0430\u044f \u0431\u0443\u043c\u0430\u0433\u0430\".'), 1532),
(6127, STRINGDECODE('\u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u0430 \u0433\u0440\u0443\u043f\u043f\u0430 \u0441\u043f\u0435\u043b\u0430 \u043f\u0440\u043e \u043e\u0431\u0449\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0443\u044e \u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u0443 \u0438\u043c\u0435\u043d\u0438 \u041b\u044e\u0431\u043e\u0432\u044c.'), 1532);
